INSERT INTO `equipment` (`equipmentID`, `equipmentName`, `equipmentDescription`, `image`) VALUES
(1, 'Treadmill', 'A treadmill is a cardio machine that allows users to walk, jog, or run indoors. It typically consists of a moving belt powered by a motor, with adjustable speed and incline settings.', 'https://johnsonfitness.com.ph/cdn/shop/products/HZ20_7.4AT_Hero-Lo_800x.jpg'),
(2, 'Stationary Bike', 'A stationary bike, also known as an exercise bike, is a cardio machine designed to simulate the experience of cycling outdoors. It features a saddle, pedals, and handlebars, with adjustable resistance levels.', 'https://cdn.thewirecutter.com/wp-content/media/2022/10/stationarybikes-2048px-0138.jpg?auto=webp&qua'),
(3, 'Elliptical Trainer', 'An elliptical trainer is a low-impact cardio machine that mimics movements such as walking, running, and stair climbing. It features foot pedals and handlebars for a full-body workout.', 'https://m.media-amazon.com/images/I/51gek3sc56L._AC_UF894,1000_QL80_.jpg'),
(4, 'Rowing Machine', 'A rowing machine, or rower, is a cardio machine that simulates the action of rowing a boat. It consists of a sliding seat, handles, and a resistance mechanism, providing a full-body workout.', 'https://m.economictimes.com/thumb/msid-104629063,width-1200,height-900,resizemode-4,imgsize-66742/ro'),
(5, 'Stair Climber', 'A stair climber, also known as a step machine or stepper, replicates the motion of climbing stairs. It typically consists of two foot pedals that move up and down in a stair-like motion.', 'https://sportshub.cbsistatic.com/i/r/2023/09/14/5993f07e-bf30-4a09-b70e-cd0b7a688f67/resize/750x422/'),
(6, 'Arc Trainer', 'An arc trainer is a cardio machine that combines elements of elliptical training and stair climbing. It offers a low-impact workout with adjustable resistance and incline settings.', 'https://fitdir.com/wp-content/uploads/2017/05/Cybex-770AT-Arc-Trainer-2.jpg'),
(7, 'Ski Ergometer', 'A ski ergometer, or ski erg, simulates the motion of cross-country skiing. It provides a full-body cardio workout by engaging the arms, shoulders, back, and legs.', 'https://www.concept2.com/files/images/skierg/slides/skierg2-empty.jpg'),
(8, 'VersaClimber', 'A VersaClimber is a vertical climbing machine that mimics the action of climbing. It offers a total-body cardio workout, engaging muscles in the arms, legs, and core.', 'https://assets.roguefitness.com/f_auto,q_auto,c_limit,w_1536,b_rgb:f8f8f8/catalog/Conditioning/Versa'),
(9, 'Boxing or Kickboxing Equipment', 'Boxing or kickboxing equipment includes heavy bags, focus mitts, and gloves. These are used for high-intensity cardio workouts involving punching and kicking movements.', 'https://m.media-amazon.com/images/I/61hQo-X8AtL._AC_UF1000,1000_QL80_.jpg'),
(10, 'Indoor Rowing Machine', 'An indoor rowing machine, also known as an ergometer rowing machine, simulates the motion of rowing a boat. It provides a full-body cardio workout targeting muscles in the arms, legs, back, and core.', 'https://m.media-amazon.com/images/I/41kmOFvpQoS._AC_SL1000_.jpg'),
(11, 'Jump Rope', 'A jump rope is a simple piece of equipment consisting of a length of rope with handles on each end. It is used for cardiovascular exercises involving jumping over the rope while swinging it in a circular motion.', 'https://images.squarespace-cdn.com/content/v1/571a776a20c64798c2688cbb/1544037384362-LPBRU4Z155AAPNA'),
(12, 'Battling Ropes', 'Battling ropes are thick, heavy ropes anchored to a stable object, such as a pole or wall. They are used for dynamic, full-body cardio workouts, engaging multiple muscle groups simultaneously. By performing various wave-like movements with the ropes, users can improve cardiovascular endurance, grip strength, and overall muscular endurance.', 'https://cdn02.plentymarkets.com/zkz64ybyye6y/item/images/2432/full/xxxx--Battle-Rope---001.jpg'),
(13, 'Resistance Bands', 'Resistance bands are elastic bands used for strength training and stretching exercises. They come in various resistance levels and can target different muscle groups.', 'https://benchfitness.com/cdn/shop/products/bench_fitness_equipment_resistance_band_red.jpg'),
(14, 'Medicine Balls', 'Medicine balls are weighted balls used for strength and conditioning exercises. They come in various weights and sizes and can be used for throwing, catching, or traditional strength exercises.', 'https://repfitness.com/cdn/shop/products/Shopify-Med-Ball-Thumbnail.jpg'),
(15, 'Kettlebells', 'Kettlebells are cast-iron weights with a handle used for ballistic and strength training exercises. They provide a versatile workout targeting multiple muscle groups simultaneously.', 'https://images.othoba.com/images/thumbs/0297858_kettle-bell-4-kg.jpeg'),
(16, 'Pull-Up Bar', 'A pull-up bar is a horizontal bar mounted on a frame or wall. It is used for upper body exercises such as pull-ups, chin-ups, and hanging leg raises.', 'https://cffstrengthequipment.com/cdn/shop/products/CFF_PULL_UP_BAR_1024x1024.jpg'),
(17, 'Dumbbells', 'Dumbbells are handheld weights used for strength training exercises. They come in various weights and can be used for a wide range of exercises targeting different muscle groups.', 'https://www.globalfitness.com/cdn/shop/products/mileage-fitness-pro-style-dumbbell-set-5-50-lbs.jpg'),
(18, 'Barbells', 'Barbells are long metal bars with weights attached to each end. They are used for various compound exercises such as squats, deadlifts, bench presses, and overhead presses.', 'https://bestgymequipment.co.uk/cdn/shop/products/ScreenShot2020-08-16at18.49.52.png'),
(19, 'Smith Machine', 'A Smith machine is a weight training machine consisting of a barbell fixed within steel rails. It allows for guided vertical movement during exercises such as squats, bench presses, and lunges.', 'https://www.mndfit.com/home/b/6/se8gcl/resource/2022/05/26/628f30a83d76d.jpg'),
(20, 'Leg Press Machine', 'A leg press machine is a resistance training machine used to strengthen the muscles of the lower body, particularly the quadriceps, hamstrings, and glutes. It involves pushing a weighted platform away from the body using the legs.', 'https://m.media-amazon.com/images/I/615R7zSFsPL._AC_UF1000,1000_QL80_.jpg'),
(21, 'Hack Squat Machine', 'A hack squat machine is a resistance training machine used to target the muscles of the legs, particularly the quadriceps, hamstrings, and glutes. It involves performing squats in a reclined position against a weighted sled.', 'https://m.media-amazon.com/images/I/61QeVhh2yIL.jpg'),
(22, 'Leg Extension Machine', 'A leg extension machine is a resistance training machine used to isolate and strengthen the quadriceps muscles in the front of the thigh. It involves extending the legs against resistance while seated.', 'https://m.media-amazon.com/images/I/51iZxQavBOL._AC_UF1000,1000_QL80_.jpg'),
(23, 'Leg Curl Machine', 'A leg curl machine is a resistance training machine used to target the hamstrings muscles in the back of the thigh. It involves curling the legs against resistance while lying face down or seated.', 'https://www.primefitnessusa.com/cdn/shop/products/PRIME-Plate-Loaded-Leg-Extension-800x600-WHT_2_800'),
(24, 'Cable Machines', 'Cable machines consist of pulleys and adjustable weight stacks connected to cables. They are used for a wide range of strength training exercises, offering variable resistance and targeting multiple muscle groups.', 'https://5.imimg.com/data5/SELLER/Default/2022/4/QU/BH/SM/5740021/cable-crossover-machine.jpg'),
(25, 'Lat Pulldown Machine', 'A lat pulldown machine is a resistance training machine used to target the muscles of the upper back, particularly the latissimus dorsi. It involves pulling a bar down towards the chest while seated.', 'https://www.ensayofitness.com/wp-content/uploads/2020/05/Lat-Pull-Down-C.jpg'),
(26, 'Seated Row Machine', 'A seated row machine is a resistance training machine used to target the muscles of the upper back, shoulders, and arms. It involves pulling a handle towards the torso while seated with legs extended.', 'https://m.media-amazon.com/images/I/61dO8O8TZQL._AC_UF1000,1000_QL80_.jpg'),
(27, 'Chest Press Machine', 'A chest press machine is a resistance training machine used to target the muscles of the chest, shoulders, and arms. It involves pushing a set of handles away from the body while seated or lying down.', 'https://www.yanrefitness.com/wp-content/uploads/2023/06/6-15-1024x768.jpg'),
(28, 'Pec Deck Machine', 'A pec deck machine is a resistance training machine used to isolate and strengthen the muscles of the chest, particularly the pectoralis major. It involves bringing the arms together in front of the body against resistance.', 'https://www.yanrefitness.com/wp-content/uploads/2023/06/8-10-1024x768.jpg'),
(29, 'Abdominal Crunch Machine', 'An abdominal crunch machine is a resistance training machine used to target the muscles of the abdomen, particularly the rectus abdominis. It involves performing crunch-like movements against resistance while seated.', 'https://c1.neweggimages.com/productimage/nb640/BG0CS220923047ZO38A.jpg'),
(30, 'Roman Chair', 'A Roman chair is a piece of equipment used for lower back and core exercises. It typically consists of a padded bench with foot and knee supports, allowing for hyperextension and other exercises.', 'https://www.fitnessbodystrong.com/uploads/201712641/p201704011454144414490.jpg'),
(31, 'Hyperextension Bench', 'A hyperextension bench is used for strengthening the lower back, glutes, and hamstrings. It involves lying face down with the hips positioned on the padded bench and performing back extensions.', 'https://www.360fitnesssuperstore.com/cdn/shop/products/TuffStuff_Evolution_Adjustable_Hyper_Extensio'),
(32, 'Bosu Ball', 'A Bosu ball is a half-dome stability ball with a flat platform on one side. It is used for balance, stability, and core training exercises, as well as for adding difficulty to traditional exercises.', 'https://www.gatepro.it/783-large_default/yoga-bosu-ball.jpg'),
(33, 'Pull-Up/Dip Tower', 'A pull-up/dip tower is a multifunctional piece of equipment that allows users to perform pull-ups, chin-ups, dips, and other bodyweight exercises. It typically features a vertical frame with handles at various heights.', 'https://assets.kogan.com/images/seranno/SER-NWC-PTSTA-2273/1-aea0f91ef3-62a03b65bec9e.png?auto=webp&'),
(34, 'Plyometric Box', 'A plyometric box, also known as a jump box or training platform, is a sturdy box used for plyometric exercises such as box jumps, step-ups, and depth jumps. It helps improve explosive power and lower body strength.', 'https://down-ph.img.susercontent.com/file/41c527b667b6f3c1bd1852db3ba9f056'),
(35, 'Suspension Trainer', 'A suspension trainer, such as the TRX system, consists of adjustable straps with handles or foot cradles that can be anchored to a stable structure. It is used for bodyweight exercises targeting strength, stability, and flexibility.', 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ5Wc_CVeJRZQ_AHvJHR3C72IQRLwCc4iuGvg&usqp=CAU'),
(36, 'Prowler Sled', 'A prowler sled is a weighted sled used for pushing or pulling exercises on various surfaces, such as turf or pavement. It is commonly used for strength and conditioning workouts, as well as athletic training.', 'https://static.wixstatic.com/media/466604_a090900a706c44799fbce305407f48e0~mv2.png/v1/fill/w_392,h_2'),
(37, 'Squat Rack', 'A squat rack, also known as a power rack or squat cage, is a piece of equipment used for performing squats, bench presses, and other barbell exercises safely. It typically consists of four vertical posts with adjustable J-hooks or safety pins.', 'https://assets.roguefitness.com/f_auto,q_auto,c_limit,w_1536,b_rgb:f8f8f8/XX7989-H_uxuhr9.png'),
(38, 'Cable Crossover Machine', 'A cable crossover machine is a resistance training machine with adjustable pulleys and cables. It is used for performing various upper body exercises, such as chest flies, rows, and triceps extensions.', 'https://www.ensayofitness.com/wp-content/uploads/2018/06/Cable-Crossover-Machine-Plate-Load-Junior-1'),
(39, 'Pilates Reformer', 'A Pilates reformer is a piece of equipment used for Pilates workouts, which focus on strengthening and lengthening muscles while improving flexibility and alignment. It consists of a sliding carriage attached to springs, pulleys, and straps for resistance-based exercises.', 'https://yourreformer.nz/cdn/shop/files/YRO-7_025d2caf-99f7-407d-84c5-ec04fe620d9e.jpg'),
(40, 'Battle Rope Anchor Strap', 'A battle rope anchor strap is a sturdy strap used to secure battling ropes to various anchor points, such as poles, trees, or racks. It provides a stable attachment point for effective battling rope workouts, allowing users to perform various exercises with proper form and safety.', 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTaIP-wsPEqhk2Hb-uq53Hs68PmCNDLGxPR6A&usqp=CAU');
INSERT INTO `exercises` (`ExerciseID`, `ExerciseName`, `Description`, `CategoryID`, `PartOfBody`, `EquipmentID`, `Difficulty`, `set`, `reps`, `duration`, `Instructions`, `ImageURL`, `VideoURL`, `Goal`, `Workoutset`) VALUES
(1, 'Push-Up', 'A classic bodyweight exercise that targets the chest, shoulders, and triceps', 'Strength', 'Upper Body', 'None', 'BEGINNER', '2 to 3 sets', '8 to 12 reps per set', '5 minutes', 'Start in a plank position with your hands shoulder-width apart.\r\nLower your body until your chest nearly touches the floor.\r\nPush back up to the starting position.\r\nRepeat for 10-15 repetitions.', 'https://www.inspireusafoundation.org/wp-content/uploads/2023/07/plank-benefits.png', 'https://www.youtube.com/embed/R08gYyypGto?si=pqF7riN58nDrOM3u', 'Muscle Gain', 'Chest Beginner'),
(2, 'Barbell Squat', 'he barbell squat is a compound exercise that targets the lower body, primarily the quadriceps, hamstrings, and glutes. It also engages the core muscles for stabilization.', 'Strength', 'Lower Body', 'Barbell, Squat Rack', 'INTERMEDIATE', '3 to 4 sets', '8 to 12 reps per set', '30-60 seconds per set', 'Stand with feet shoulder-width apart, barbell resting on shoulders. Squat down by bending hips and knees until thighs are parallel to the ground. Keep back straight and chest up. Push through heels to return to starting position.', 'https://www.verywellfit.com/thmb/orvm0m_9btiiFSKktafbV-x3g5o=/1500x0/filters:no_upscale():max_bytes(150000):strip_icc()/gym---men-doing-front-squats-651184881-a59548749d6243aa8b3781cc66af77ab.jpg', 'https://www.youtube.com/embed/Dy28eq2PjcM?si=Y6sc4MUoW7_4cnE4', 'Gain Weight', ''),
(3, 'Barbell Squat', 'he barbell squat is a compound exercise that targets the lower body, primarily the quadriceps, hamstrings, and glutes. It also engages the core muscles for stabilization.', 'Lower Body', 'Upper Body', 'Barbell, Squat Rack', 'INTERMEDIATE', '3 to 4 sets', '8 to 12 reps per set', '30-60 seconds per set', 'Stand with feet shoulder-width apart, barbell resting on shoulders. Squat down by bending hips and knees until thighs are parallel to the ground. Keep back straight and chest up. Push through heels to return to starting position.', 'https://www.verywellfit.com/thmb/orvm0m_9btiiFSKktafbV-x3g5o=/1500x0/filters:no_upscale():max_bytes(150000):strip_icc()/gym---men-doing-front-squats-651184881-a59548749d6243aa8b3781cc66af77ab.jpg', 'https://www.youtube.com/embed/Dy28eq2PjcM?si=Y6sc4MUoW7_4cnE4', 'Muscle Gain', ''),
(4, 'Jumping Jacks', 'Jumping jacks are a dynamic cardiovascular exercise that involves jumping while spreading the legs and arms to the sides and then returning to the starting position. This exercise elevates heart rate and improves overall cardiovascular fitness.', 'Cardiovascular', 'Legs', 'None', 'BEGINNER', '3 to 4 sets', '30 to 60 seconds', '5 to 10 minutes', 'Start with feet together and arms at sides. Jump up, spreading legs and raising arms overhead. Return to starting position and repeat.', 'https://media.post.rvohealth.io/wp-content/uploads/sites/2/2020/04/GRT-two-people-jumping-jacks-1296x728-header.jpg', 'https://www.youtube.com/embed/iSSAk4XCsRA?si=ZPfA-daml9Gv087T', 'Maintain Weight', 'Abs Beginner'),
(5, 'Jumping Jacks', 'Jumping jacks are a dynamic cardiovascular exercise that involves jumping while spreading the legs and arms to the sides and then returning to the starting position. This exercise elevates heart rate and improves overall cardiovascular fitness.', 'Cardiovascular', 'Upper Body', 'None', 'BEGINNER', '3 to 4 sets', '30 to 60 seconds', '5 to 10 minutes', 'Start with feet together and arms at sides. Jump up, spreading legs and raising arms overhead. Return to starting position and repeat.', 'https://media.post.rvohealth.io/wp-content/uploads/sites/2/2020/04/GRT-two-people-jumping-jacks-1296x728-header.jpg', 'https://www.youtube.com/embed/iSSAk4XCsRA?si=ZPfA-daml9Gv087T', 'Maintain Weight', 'Chest Beginner'),
(6, 'Jumping Jacks', 'Jumping jacks are a dynamic cardiovascular exercise that involves jumping while spreading the legs and arms to the sides and then returning to the starting position. This exercise elevates heart rate and improves overall cardiovascular fitness.', 'Full Body', 'Lower Body', 'None', 'BEGINNER', '3 to 4 sets', '30 to 60 seconds', '5 to 10 minutes', 'Start with feet together and arms at sides. Jump up, spreading legs and raising arms overhead. Return to starting position and repeat.', 'https://media.post.rvohealth.io/wp-content/uploads/sites/2/2020/04/GRT-two-people-jumping-jacks-1296x728-header.jpg', 'https://www.youtube.com/embed/iSSAk4XCsRA?si=ZPfA-daml9Gv087T', 'Lose Weight', 'Arm Beginner'),
(7, 'Forward Bend (Standing or Seated', 'The forward bend is a stretching exercise that targets the hamstrings and lower back. It improves flexibility and mobility in the posterior chain. This stretch can be performed in a standing or seated position, depending on preference and comfort.', 'Flexibility', 'Lower Body', 'None', 'BEGINNER', '', '', '30 to 60 seconds', 'Stand or sit with legs straight. Slowly bend forward at hips, reaching towards toes or floor. Hold stretch for desired duration, feeling a gentle pull in hamstrings and lower back.', 'https://worldpeaceyogaschool.com/blog/wp-content/uploads/2016/09/seated-forward-bend.jpg', 'https://www.youtube.com/embed/0kOOvLPN23Q?si=8zcKnplBECY1HChF', 'Weight Loss', ''),
(8, 'Forward Bend (Standing or Seated', 'The forward bend is a stretching exercise that targets the hamstrings and lower back. It improves flexibility and mobility in the posterior chain. This stretch can be performed in a standing or seated position, depending on preference and comfort.', 'Flexibility', 'Upper Body', 'None', 'BEGINNER', '', '', '30 to 60 seconds', 'Stand or sit with legs straight. Slowly bend forward at hips, reaching towards toes or floor. Hold stretch for desired duration, feeling a gentle pull in hamstrings and lower back.', 'https://worldpeaceyogaschool.com/blog/wp-content/uploads/2016/09/seated-forward-bend.jpg', 'https://www.youtube.com/embed/0kOOvLPN23Q?si=8zcKnplBECY1HChF', 'Maintain Weight', ''),
(9, 'Trunk Rotation Stretch', 'The trunk rotation stretch targets the muscles of the spine and core, particularly the obliques. It improves flexibility and range of motion in the torso. This stretch can help alleviate tension and discomfort in the lower back.', 'Flexibility', 'Upper Body', 'None', 'BEGINNER', '', '', '30 to 60 seconds', 'Sit on the floor with legs extended. Twist torso to one side, placing opposite hand on knee and other hand on floor behind body. Hold stretch, then repeat on opposite side.', 'https://i.ytimg.com/vi/2GmRCbA5yJU/maxresdefault.jpg', 'https://www.youtube.com/embed/LyiS74HzQOQ?si=4BZczMD-ACPX66NV', 'Weight Loss', ''),
(10, 'Trunk Rotation Stretch', 'The trunk rotation stretch targets the muscles of the spine and core, particularly the obliques. It improves flexibility and range of motion in the torso. This stretch can help alleviate tension and discomfort in the lower back.', 'Flexibility', 'Core', 'None', 'BEGINNER', '', '', '30 to 60 seconds', 'Sit on the floor with legs extended. Twist torso to one side, placing opposite hand on knee and other hand on floor behind body. Hold stretch, then repeat on opposite side.', 'https://i.ytimg.com/vi/2GmRCbA5yJU/maxresdefault.jpg', 'https://www.youtube.com/embed/LyiS74HzQOQ?si=4BZczMD-ACPX66NV', 'Maintain Weight', ''),
(11, 'Plank', 'The plank is an isometric core exercise that targets the muscles of the abdominals, lower back, and shoulders. It improves core stability and strength, promoting better posture and spinal alignment. Planks can be performed in various positions to challenge different muscle groups.', 'Core', 'Core', 'None', 'BEGINNER', '3 to 4 sets', '', '30 to 60 seconds', 'Start in a push-up position with elbows bent and forearms on the ground. Keep body straight from head to heels, engaging core muscles. Hold position for desired duration.', 'https://www.telegraph.co.uk/content/dam/health-fitness/2023/07/26/TELEMMGLPICT000343914358_16903815600780_trans_NvBQzQNjv4Bq_pGgH2Q63B9K0JDR-jLfc3L4Y8c-QL1pBa89XEthAG4.jpeg', 'https://www.youtube.com/embed/pvIjsG5Svck?si=jCKws3wJYNl3jgSk', 'Muscle Gain', 'Abs Beginner'),
(12, 'Plank', 'The plank is an isometric core exercise that targets the muscles of the abdominals, lower back, and shoulders. It improves core stability and strength, promoting better posture and spinal alignment. Planks can be performed in various positions to challenge different muscle groups.', 'Core', 'Upper Body', 'None', 'BEGINNER', '3 to 4 sets', '', '30 to 60 seconds', 'Start in a push-up position with elbows bent and forearms on the ground. Keep body straight from head to heels, engaging core muscles. Hold position for desired duration.', 'https://www.telegraph.co.uk/content/dam/health-fitness/2023/07/26/TELEMMGLPICT000343914358_16903815600780_trans_NvBQzQNjv4Bq_pGgH2Q63B9K0JDR-jLfc3L4Y8c-QL1pBa89XEthAG4.jpeg', 'https://www.youtube.com/embed/pvIjsG5Svck?si=jCKws3wJYNl3jgSk', 'Weight Loss', 'Abs Intermediate'),
(13, 'Russian Twist', 'The Russian twist is a core exercise that targets the obliques and abdominals. It also engages the hip flexors and lower back muscles for stability. This exercise improves rotational strength and trunk stability, which are essential for athletic performance and daily activities.', 'Core', 'Core', 'Medicine Ball or Dumbbell', 'INTERMEDIATE', '3 to 4 sets', '10 to 15 per side', '', 'Sit on the floor with knees bent, holding weight in front of chest. Lean back slightly, engage core, and twist torso to one side. Return to center and repeat on opposite side.', 'https://hips.hearstapps.com/hmg-prod/images/russian-twist-sharpened-1548270008.jpg', 'https://www.youtube.com/embed/wkD8rjkodUI?si=M_4rM1WBVuF8T025', 'Weight Loss', 'Abs Beginner'),
(14, 'Russian Twist', 'The Russian twist is a core exercise that targets the obliques and abdominals. It also engages the hip flexors and lower back muscles for stability. This exercise improves rotational strength and trunk stability, which are essential for athletic performance and daily activities.', 'Core', 'Lower Body', 'Medicine Ball or Dumbbell', 'INTERMEDIATE', '3 to 4 sets', '10 to 15 per side', '', 'Sit on the floor with knees bent, holding weight in front of chest. Lean back slightly, engage core, and twist torso to one side. Return to center and repeat on opposite side.', 'https://hips.hearstapps.com/hmg-prod/images/russian-twist-sharpened-1548270008.jpg', 'https://www.youtube.com/embed/wkD8rjkodUI?si=M_4rM1WBVuF8T025', 'Muscle Gain', 'Abs Advanced'),
(15, 'Single Leg Balance', 'Single leg balance is a balance exercise that targets the muscles of the legs and core. It improves proprioception, coordination, and stability. This exercise can help prevent falls and injuries by enhancing balance and control.', 'Balance', 'Legs', 'None', 'BEGINNER', '', '', '30 to 60 seconds per leg', 'Stand on one leg with knee slightly bent, engaging core for balance. Hold position for desired duration, then switch legs.', 'https://moticon.com/wp-content/uploads/2022/03/RT012-01.jpg', 'https://www.youtube.com/embed/HTVVv4ESgms?si=35Uu2sh64S19nDwJ', 'Maintain Weight', 'Leg Intermediate'),
(16, 'Single Leg Balance', 'Single leg balance is a balance exercise that targets the muscles of the legs and core. It improves proprioception, coordination, and stability. This exercise can help prevent falls and injuries by enhancing balance and control.', 'Balance', 'Lower Body', 'None', 'BEGINNER', '', '', '30 to 60 seconds per leg', 'Stand on one leg with knee slightly bent, engaging core for balance. Hold position for desired duration, then switch legs.', 'https://moticon.com/wp-content/uploads/2022/03/RT012-01.jpg', 'https://www.youtube.com/embed/HTVVv4ESgms?si=35Uu2sh64S19nDwJ', 'Muscle Gain', 'Leg Intermediate'),
(17, 'Bosu Ball Squat', 'The Bosu ball squat is a balance exercise that targets the lower body and core muscles. It adds an element of instability, requiring greater activation of stabilizing muscles. This exercise improves balance, coordination, and lower body strength.', 'Balance', 'Legs', 'Bosu Ball', 'INTERMEDIATE', '3 to 4 sets', '10 to 15', '30 to 60 seconds per set', 'Stand on the flat side of the Bosu ball with feet shoulder-width apart. Engage core muscles for stability. Lower body into a squat position, keeping knees aligned with toes and chest up. Pause briefly at the bottom, then push through heels to return to standing position. Focus on maintaining balance throughout the movement.', 'https://i.pinimg.com/originals/b3/30/ca/b330cae7668094cf296782a80f19feb4.jpg', 'https://www.youtube.com/embed/xb48vhjvmjk?si=ASvWG4mBzdr6Wrur', 'Gain Weight', ''),
(18, 'Bosu Ball Squat', 'The Bosu ball squat is a balance exercise that targets the lower body and core muscles. It adds an element of instability, requiring greater activation of stabilizing muscles. This exercise improves balance, coordination, and lower body strength.', 'Strength', 'Lower Body', 'Bosu Ball', 'INTERMEDIATE', '3 to 4 sets', '10 to 15', '30 to 60 seconds per set', 'Stand on the flat side of the Bosu ball with feet shoulder-width apart. Engage core muscles for stability. Lower body into a squat position, keeping knees aligned with toes and chest up. Pause briefly at the bottom, then push through heels to return to standing position. Focus on maintaining balance throughout the movement.', 'https://i.pinimg.com/originals/b3/30/ca/b330cae7668094cf296782a80f19feb4.jpg', 'https://www.youtube.com/embed/xb48vhjvmjk?si=ASvWG4mBzdr6Wrur', 'Muscle Gain', ''),
(19, 'Romanian Deadlift (RDL)', 'The Romanian deadlift primarily targets the hamstrings, glutes, and lower back. Unlike the conventional deadlift, the RDL focuses on hip hinge movement and emphasizes the stretch and contraction of the hamstrings. It\'s an excellent exercise for developing posterior chain strength and improving hip mobility.', 'Strength', 'Legs', 'Barbell, Weight Plates', 'iNTERMEDIATE', '3 to 4 sets', '8 to 12 reps per set', '30 to 60 seconds per set', 'Stand with feet hip-width apart and hold a barbell with an overhand grip, palms facing body. Hinge at the hips while maintaining a slight bend in the knees, lowering the barbell towards the floor while keeping the back straight. Feel the stretch in the hamstrings, then return to the starting position by driving through the hips.', 'https://hips.hearstapps.com/hmg-prod/images/barbell-deadlift-1598365963.jpg', 'https://www.youtube.com/embed/7j-2w4-P14I?si=9TSN1Mc4V51sMMbO', 'Gain Weight', ''),
(20, 'Romanian Deadlift (RDL)', 'The Romanian deadlift primarily targets the hamstrings, glutes, and lower back. Unlike the conventional deadlift, the RDL focuses on hip hinge movement and emphasizes the stretch and contraction of the hamstrings. It\'s an excellent exercise for developing posterior chain strength and improving hip mobility.', 'Lower Body', 'Lower Body', 'Barbell, Weight Plates', 'iNTERMEDIATE', '3 to 4 sets', '8 to 12 reps per set', '30 to 60 seconds per set', 'Stand with feet hip-width apart and hold a barbell with an overhand grip, palms facing body. Hinge at the hips while maintaining a slight bend in the knees, lowering the barbell towards the floor while keeping the back straight. Feel the stretch in the hamstrings, then return to the starting position by driving through the hips.', 'https://hips.hearstapps.com/hmg-prod/images/barbell-deadlift-1598365963.jpg', 'https://www.youtube.com/embed/7j-2w4-P14I?si=9TSN1Mc4V51sMMbO', 'Gain Weight', ''),
(21, 'Romanian Deadlift (RDL)', 'The Romanian deadlift primarily targets the hamstrings, glutes, and lower back. Unlike the conventional deadlift, the RDL focuses on hip hinge movement and emphasizes the stretch and contraction of the hamstrings. It\'s an excellent exercise for developing posterior chain strength and improving hip mobility.', 'Lower Body', 'Upper Body', 'Barbell, Weight Plates', 'iNTERMEDIATE', '3 to 4 sets', '8 to 12 reps per set', '30 to 60 seconds per set', 'Stand with feet hip-width apart and hold a barbell with an overhand grip, palms facing body. Hinge at the hips while maintaining a slight bend in the knees, lowering the barbell towards the floor while keeping the back straight. Feel the stretch in the hamstrings, then return to the starting position by driving through the hips.', 'https://hips.hearstapps.com/hmg-prod/images/barbell-deadlift-1598365963.jpg', 'https://www.youtube.com/embed/7j-2w4-P14I?si=9TSN1Mc4V51sMMbO', 'Muscle Gain', ''),
(22, 'Romanian Deadlift (RDL)', 'The Romanian deadlift primarily targets the hamstrings, glutes, and lower back. Unlike the conventional deadlift, the RDL focuses on hip hinge movement and emphasizes the stretch and contraction of the hamstrings. It\'s an excellent exercise for developing posterior chain strength and improving hip mobility.', 'Lower Body', 'Core', 'Barbell, Weight Plates', 'iNTERMEDIATE', '3 to 4 sets', '8 to 12 reps per set', '30 to 60 seconds per set', 'Stand with feet hip-width apart and hold a barbell with an overhand grip, palms facing body. Hinge at the hips while maintaining a slight bend in the knees, lowering the barbell towards the floor while keeping the back straight. Feel the stretch in the hamstrings, then return to the starting position by driving through the hips.', 'https://hips.hearstapps.com/hmg-prod/images/barbell-deadlift-1598365963.jpg', 'https://www.youtube.com/embed/7j-2w4-P14I?si=9TSN1Mc4V51sMMbO', 'Muscle Gain', ''),
(23, 'Bench Press', 'The bench press is a compound exercise that targets the chest, shoulders, and triceps. It\'s performed lying on a flat bench, using a barbell or dumbbells, and involves pressing the weight away from the body. The bench press is a fundamental exercise for building upper body strength and muscle mass.', 'Strength', 'Upper Body', 'Barbell or Dumbbells, Bench', 'BEGINNER', '3 to 4 sets', '8 to 12 reps per set', '30 to 60 seconds per set', 'Lie on a flat bench with feet planted firmly on the floor. Grip the barbell or dumbbells slightly wider than shoulder-width apart, lowering the weight to chest level. Press the weight upward until arms are fully extended, then lower back down with control.', 'https://cdn.mos.cms.futurecdn.net/pLaRi5jXSHDKu6WRydetBo-1200-80.jpg', 'https://www.youtube.com/embed/gRVjAtPip0Y?si=AQmp1dPQjDUE5Hvp', 'Gain Weight', ''),
(24, 'Bench Press', 'The bench press is a compound exercise that targets the chest, shoulders, and triceps. It\'s performed lying on a flat bench, using a barbell or dumbbells, and involves pressing the weight away from the body. The bench press is a fundamental exercise for building upper body strength and muscle mass.', 'Upper Body', 'Core', 'Barbell or Dumbbells, Bench', 'BEGINNER', '3 to 4 sets', '8 to 12 reps per set', '30 to 60 seconds per set', 'Lie on a flat bench with feet planted firmly on the floor. Grip the barbell or dumbbells slightly wider than shoulder-width apart, lowering the weight to chest level. Press the weight upward until arms are fully extended, then lower back down with control.', 'https://cdn.mos.cms.futurecdn.net/pLaRi5jXSHDKu6WRydetBo-1200-80.jpg', 'https://www.youtube.com/embed/gRVjAtPip0Y?si=AQmp1dPQjDUE5Hvp', 'Gain Weight', ''),
(25, 'Bench Press', 'The bench press is a compound exercise that targets the chest, shoulders, and triceps. It\'s performed lying on a flat bench, using a barbell or dumbbells, and involves pressing the weight away from the body. The bench press is a fundamental exercise for building upper body strength and muscle mass.', 'Strength', 'Lower Body', 'Barbell or Dumbbells, Bench', 'BEGINNER', '3 to 4 sets', '8 to 12 reps per set', '30 to 60 seconds per set', 'Lie on a flat bench with feet planted firmly on the floor. Grip the barbell or dumbbells slightly wider than shoulder-width apart, lowering the weight to chest level. Press the weight upward until arms are fully extended, then lower back down with control.', 'https://cdn.mos.cms.futurecdn.net/pLaRi5jXSHDKu6WRydetBo-1200-80.jpg', 'https://www.youtube.com/embed/gRVjAtPip0Y?si=AQmp1dPQjDUE5Hvp', 'Muscle Gain', ''),
(26, 'Bench Press', 'The bench press is a compound exercise that targets the chest, shoulders, and triceps. It\'s performed lying on a flat bench, using a barbell or dumbbells, and involves pressing the weight away from the body. The bench press is a fundamental exercise for building upper body strength and muscle mass.', 'Upper Body', 'Upper Body', 'Barbell or Dumbbells, Bench', 'BEGINNER', '3 to 4 sets', '8 to 12 reps per set', '30 to 60 seconds per set', 'Lie on a flat bench with feet planted firmly on the floor. Grip the barbell or dumbbells slightly wider than shoulder-width apart, lowering the weight to chest level. Press the weight upward until arms are fully extended, then lower back down with control.', 'https://cdn.mos.cms.futurecdn.net/pLaRi5jXSHDKu6WRydetBo-1200-80.jpg', 'https://www.youtube.com/embed/gRVjAtPip0Y?si=AQmp1dPQjDUE5Hvp', 'Muscle Gain', ''),
(27, 'Bench Press', 'The bench press is a compound exercise that targets the chest, shoulders, and triceps. It\'s performed lying on a flat bench, using a barbell or dumbbells, and involves pressing the weight away from the body. The bench press is a fundamental exercise for building upper body strength and muscle mass.', 'Upper Body', 'Core', 'Barbell or Dumbbells, Bench', 'BEGINNER', '3 to 4 sets', '8 to 12 reps per set', '30 to 60 seconds per set', 'Lie on a flat bench with feet planted firmly on the floor. Grip the barbell or dumbbells slightly wider than shoulder-width apart, lowering the weight to chest level. Press the weight upward until arms are fully extended, then lower back down with control.', 'https://cdn.mos.cms.futurecdn.net/pLaRi5jXSHDKu6WRydetBo-1200-80.jpg', 'https://www.youtube.com/embed/gRVjAtPip0Y?si=AQmp1dPQjDUE5Hvp', 'Gain Weight', ''),
(28, 'Renegade Rows', 'Renegade rows are a compound exercise that targets the back, shoulders, and core. It\'s performed in a plank position while alternating rows with dumbbells. Renegade rows help improve upper body strength, stability, and coordination.', 'Strength', 'Upper Body', 'Dumbbells', 'INTERMEDIATE', '3 to 4 sets', '8 to 12 reps per side', '30 to 60 per set', 'Start in a plank position with hands gripping dumbbells and arms extended. Keep core engaged and back flat. Perform a row with one arm, pulling the dumbbell towards the hip, then lower back down. Alternate sides for the desired number of reps.', 'https://i.ytimg.com/vi/LccyTxiUrhg/maxresdefault.jpg', 'https://www.youtube.com/embed/Q28cLuweLv4?si=Xt24RS3AO1HJU3DF', 'Maintain Weight', ''),
