(33, 'Lateral Lunges', 'Lateral lunges target the inner and outer thighs, glutes, and hips. Unlike traditional lunges, lateral lunges involve stepping to the side and bending one knee while keeping the other leg straight. This exercise helps improve lower body strength, stability, and flexibility.', 'Strength', 'Legs', 'None', 'BEGINNER', '3 to 4 sets', '10 to 12 per leg', '30 to 60 seconds per set', 'Stand with feet together and hands on hips. Take a large step to the side with one foot, bending the knee and lowering the body while keeping the other leg straight. Push through the heel to return to the starting position, then repeat on the opposite side.', 'https://images.contentful.com/3s5io6mnxfqz/7jv9EjAclB8uf4ld81WP8E/307a33568baf13fb24b1f3117a01dd59/MasterClassSEO_Lateral_Lunge_TWO.jpg', 'https://www.youtube.com/embed/gwWv7aPcD88?si=xZTUM7cSR_fT70Lz', 'Weight Loss', ''),
