(38, 'Dumbbell Shoulder Press', 'The dumbbell shoulder press targets the deltoid muscles of the shoulders, as well as the triceps. It\'s performed sitting or standing with dumbbells held at shoulder height, then pressing them overhead. This exercise helps build shoulder strength and stability.', 'Strength', 'Upper Body', 'Dumbbells', 'BEGINNER', '3 to 4 sets', '8 to 12 per set', '30 to 60 second per set', 'Sit or stand with feet shoulder-width apart and dumbbells held at shoulder height, palms facing forward. Press the dumbbells overhead until arms are fully extended, then lower back down with control.', 'https://www.bodybuilding.com/images/2020/xdb/originals/xdb-104d-standing-dumbbell-shoulder-press-m2-16x9.jpg', 'https://www.youtube.com/embed/B-aVuyhvLHU?si=eZMTNd6W9JbNPt87', 'Muscle Gain', ''),
(39, 'Dumbbell Shoulder Press', 'The dumbbell shoulder press targets the deltoid muscles of the shoulders, as well as the triceps. It\'s performed sitting or standing with dumbbells held at shoulder height, then pressing them overhead. This exercise helps build shoulder strength and stability.', 'Strength', 'Lower Body', 'Dumbbells', 'BEGINNER', '3 to 4 sets', '8 to 12 per set', '30 to 60 second per set', 'Sit or stand with feet shoulder-width apart and dumbbells held at shoulder height, palms facing forward. Press the dumbbells overhead until arms are fully extended, then lower back down with control.', 'https://www.bodybuilding.com/images/2020/xdb/originals/xdb-104d-standing-dumbbell-shoulder-press-m2-16x9.jpg', 'https://www.youtube.com/embed/B-aVuyhvLHU?si=eZMTNd6W9JbNPt87', 'Gain Weight', ''),
