(42, 'Leg Press', 'The leg press is a compound exercise that primarily targets the quadriceps, hamstrings, and glutes. It\'s performed on a leg press machine by pushing a weighted platform away from the body. The leg press is an effective exercise for building lower body strength and muscle mass.', 'Strength', 'Core', 'Leg Press Machine', 'BEGINNER', '3 to 4 sets', '8 to 12 per set', '30 to 60 seconds per set', 'Sit on the leg press machine with back flat against the pad and feet shoulder-width apart on the platform. Push the platform away by extending the knees until legs are almost fully extended, then lower back down with control.', 'https://boxlifemagazine.com/wp-content/uploads/2023/06/leg-press-weight.png', 'https://www.youtube.com/embed/yZmx_Ac3880?si=rojPg7lZ8UVXzIym', 'Gain Weight', ''),
