(45, 'Leg Press', 'The leg press is a compound exercise that primarily targets the quadriceps, hamstrings, and glutes. It\'s performed on a leg press machine by pushing a weighted platform away from the body. The leg press is an effective exercise for building lower body strength and muscle mass.', 'Lower Body', 'Core', 'Leg Press Machine', 'BEGINNER', '3 to 4 sets', '8 to 12 per set', '30 to 60 seconds per set', 'Sit on the leg press machine with back flat against the pad and feet shoulder-width apart on the platform. Push the platform away by extending the knees until legs are almost fully extended, then lower back down with control.', 'https://boxlifemagazine.com/wp-content/uploads/2023/06/leg-press-weight.png', 'https://www.youtube.com/embed/yZmx_Ac3880?si=rojPg7lZ8UVXzIym', 'Muscle Gain', ''),
(46, 'Chest Flyes', 'Chest flyes target the pectoral muscles (chest) and are typically performed using dumbbells or a cable machine. This exercise involves lying on a bench or flat surface and opening the arms out to the sides in a controlled motion, then bringing them back together. Chest flyes help develop chest strength and enhance muscle definition.', 'Strength', 'Upper Body', 'Dumbbells, Bench', 'BEGINNER', '3 to 4 sets', '8 to 12 per set', '30 to 60 seconds per set', 'Lie on a flat bench with a dumbbell in each hand, arms extended upward directly above the chest, palms facing each other. With a slight bend in the elbows, lower the arms out to the sides in a wide arc until you feel a stretch in the chest. Keep control of the movement and squeeze the chest muscles as you bring the dumbbells back up to the starting position.', 'https://hips.hearstapps.com/hmg-prod/images/mh-3-3-fitness-1646321567.jpg', 'https://www.youtube.com/embed/Nhvz9EzdJ4U?si=sRev_qJOmbPZCu0u', 'Muscle Gain', ''),
(47, 'Chest Flyes', 'Chest flyes target the pectoral muscles (chest) and are typically performed using dumbbells or a cable machine. This exercise involves lying on a bench or flat surface and opening the arms out to the sides in a controlled motion, then bringing them back together. Chest flyes help develop chest strength and enhance muscle definition.', 'Upper Body', 'Core', 'Dumbbells, Bench', 'BEGINNER', '3 to 4 sets', '8 to 12 per set', '30 to 60 seconds per set', 'Lie on a flat bench with a dumbbell in each hand, arms extended upward directly above the chest, palms facing each other. With a slight bend in the elbows, lower the arms out to the sides in a wide arc until you feel a stretch in the chest. Keep control of the movement and squeeze the chest muscles as you bring the dumbbells back up to the starting position.', 'https://hips.hearstapps.com/hmg-prod/images/mh-3-3-fitness-1646321567.jpg', 'https://www.youtube.com/embed/Nhvz9EzdJ4U?si=sRev_qJOmbPZCu0u', 'Weight Loss', ''),
(48, 'Barbell Bent-over Rows', 'Barbell bent-over rows are a compound exercise targeting the back, particularly the latissimus dorsi, rhomboids, and traps. By pulling a loaded barbell towards the lower chest, this exercise strengthens the back muscles and improves posture.', 'Strength', 'Upper Body', 'Barbell, Weight Plates', 'INTERMEDIATE', '3 to 4 sets', '8 to 12 per set', '30 to 60 seconds per set', 'Stand with feet shoulder-width apart, knees slightly bent, and grip a barbell with hands slightly wider than shoulder-width apart. Hinge at the hips to bend forward until your torso is almost parallel to the floor. Pull the barbell towards your lower chest, squeezing your shoulder blades together, then lower the barbell back down with control.', 'https://thefitnessmaverick.com/wp-content/uploads/2020/10/F265CF38-5010-4DBF-BE3A-68C68A2A7E02_1_201_a-e1602589179813.jpeg', 'https://www.youtube.com/embed/FWJR5Ve8bnQ?si=7PjVCGgmj0aGfRVn', 'Muscle Gain', ''),
(49, 'Barbell Bent-over Rows', 'Barbell bent-over rows are a compound exercise targeting the back, particularly the latissimus dorsi, rhomboids, and traps. By pulling a loaded barbell towards the lower chest, this exercise strengthens the back muscles and improves posture.', 'Upper Body', 'Core', 'Barbell, Weight Plates', 'INTERMEDIATE', '3 to 4 sets', '8 to 12 per set', '30 to 60 seconds per set', 'Stand with feet shoulder-width apart, knees slightly bent, and grip a barbell with hands slightly wider than shoulder-width apart. Hinge at the hips to bend forward until your torso is almost parallel to the floor. Pull the barbell towards your lower chest, squeezing your shoulder blades together, then lower the barbell back down with control.', 'https://thefitnessmaverick.com/wp-content/uploads/2020/10/F265CF38-5010-4DBF-BE3A-68C68A2A7E02_1_201_a-e1602589179813.jpeg', 'https://www.youtube.com/embed/FWJR5Ve8bnQ?si=7PjVCGgmj0aGfRVn', 'Weight Loss', ''),
(50, 'Seated Dumbbell Shoulder Press', 'The seated dumbbell shoulder press targets the deltoid muscles of the shoulders and triceps. By pressing dumbbells overhead while seated, this exercise stabilizes the core and isolates the shoulder muscles for strength and definition.', 'Strength', 'Upper Body', 'Dumbbells, Bench', 'BEGINNER', '3 to 4 sets', '8 to 12 per set', '30 to 60 seconds per set', 'it on a bench with back support, holding a dumbbell in each hand at shoulder height, palms facing forward. Press the dumbbells overhead until arms are fully extended, then lower them back down to shoulder height with control.', 'https://i.ytimg.com/vi/b5JzUH8gsOg/maxresdefault.jpg', 'https://www.youtube.com/embed/HzIiNhHhhtA?si=b05kW4e2LW-X7ytC', 'Muscle Gain', ''),
(51, 'Seated Dumbbell Shoulder Press', 'The seated dumbbell shoulder press targets the deltoid muscles of the shoulders and triceps. By pressing dumbbells overhead while seated, this exercise stabilizes the core and isolates the shoulder muscles for strength and definition.', 'Strength', 'Lower Body', 'Dumbbells, Bench', 'BEGINNER', '3 to 4 sets', '8 to 12 per set', '30 to 60 seconds per set', 'it on a bench with back support, holding a dumbbell in each hand at shoulder height, palms facing forward. Press the dumbbells overhead until arms are fully extended, then lower them back down to shoulder height with control.', 'https://i.ytimg.com/vi/b5JzUH8gsOg/maxresdefault.jpg', 'https://www.youtube.com/embed/HzIiNhHhhtA?si=b05kW4e2LW-X7ytC', 'Weight Loss', ''),
(52, 'Seated Dumbbell Shoulder Press', 'The seated dumbbell shoulder press targets the deltoid muscles of the shoulders and triceps. By pressing dumbbells overhead while seated, this exercise stabilizes the core and isolates the shoulder muscles for strength and definition.', 'Upper Body', 'Core', 'Dumbbells, Bench', 'BEGINNER', '3 to 4 sets', '8 to 12 per set', '30 to 60 seconds per set', 'it on a bench with back support, holding a dumbbell in each hand at shoulder height, palms facing forward. Press the dumbbells overhead until arms are fully extended, then lower them back down to shoulder height with control.', 'https://i.ytimg.com/vi/b5JzUH8gsOg/maxresdefault.jpg', 'https://www.youtube.com/embed/HzIiNhHhhtA?si=b05kW4e2LW-X7ytC', 'Muscle Gain', ''),
(53, 'Seated Dumbbell Shoulder Press', 'The seated dumbbell shoulder press targets the deltoid muscles of the shoulders and triceps. By pressing dumbbells overhead while seated, this exercise stabilizes the core and isolates the shoulder muscles for strength and definition.', 'Upper Body', 'Upper body', 'Dumbbells, Bench', 'BEGINNER', '3 to 4 sets', '8 to 12 per set', '30 to 60 seconds per set', 'it on a bench with back support, holding a dumbbell in each hand at shoulder height, palms facing forward. Press the dumbbells overhead until arms are fully extended, then lower them back down to shoulder height with control.', 'https://i.ytimg.com/vi/b5JzUH8gsOg/maxresdefault.jpg', 'https://www.youtube.com/embed/HzIiNhHhhtA?si=b05kW4e2LW-X7ytC', 'Weight Loss', ''),
(54, 'Leg Curl', 'Leg curls target the hamstrings, located on the back of the thigh. This exercise involves flexing the knee to lift a resistance (either a machine or a dumbbell) towards the buttocks. Leg curls strengthen the hamstrings, aiding in knee stability and lower body function.', 'Strength', 'Legs', 'Leg Curl Machine or Dumbbell', 'BEGINNER', '3 to 4 sets', '8 to 12 per set', '30 to 60 seconds per set', 'Lie face down on a leg curl machine with the pad positioned just above the ankles. Grasp the handles for stability and curl your legs upwards towards your buttocks, keeping the rest of your body stationary. Pause briefly at the top, then slowly lower the weight back down to the starting position.', 'https://staticg.sportskeeda.com/editor/2023/04/2d53b-16827554373189-1920.jpg', 'https://www.youtube.com/embed/SbSNUXPRkc8?si=5WHRwQ2aYRzPDZ3W', 'Maintain Weight', ''),
(55, 'Leg Curl', 'Leg curls target the hamstrings, located on the back of the thigh. This exercise involves flexing the knee to lift a resistance (either a machine or a dumbbell) towards the buttocks. Leg curls strengthen the hamstrings, aiding in knee stability and lower body function.', 'Lower Body', 'Lower Body', 'Leg Curl Machine or Dumbbell', 'BEGINNER', '3 to 4 sets', '8 to 12 per set', '30 to 60 seconds per set', 'Lie face down on a leg curl machine with the pad positioned just above the ankles. Grasp the handles for stability and curl your legs upwards towards your buttocks, keeping the rest of your body stationary. Pause briefly at the top, then slowly lower the weight back down to the starting position.', 'https://staticg.sportskeeda.com/editor/2023/04/2d53b-16827554373189-1920.jpg', 'https://www.youtube.com/embed/SbSNUXPRkc8?si=5WHRwQ2aYRzPDZ3W', 'Muscle Gain', ''),
(56, 'Dumbbell Bicep Curl', 'Dumbbell bicep curls isolate the biceps brachii muscles of the upper arm. By curling dumbbells towards the shoulders while standing or seated, this exercise strengthens and builds mass in the biceps for improved arm definition.', 'Strength', 'Upper Body', 'Dumbbells', 'INTERMEDIATE', '3 to 4 sets', '8 to 12 per leg', '30 to 60 seconds per set', 'Stand with feet shoulder-width apart, holding dumbbells at arm\'s length by your sides, palms facing forward. Keep elbows close to your body and curl the dumbbells upwards towards your shoulders, contracting the biceps. Slowly lower the dumbbells back down to the starting position.', 'https://www.inspireusafoundation.org/wp-content/uploads/2023/04/dumbbell-curl-benefits.png', 'https://www.youtube.com/embed/ykJmrZ5v0Oo?si=ecAXFMrt2PJAHA2i', 'Muscle Gain', ''),
(57, 'Dumbbell Bicep Curl', 'Dumbbell bicep curls isolate the biceps brachii muscles of the upper arm. By curling dumbbells towards the shoulders while standing or seated, this exercise strengthens and builds mass in the biceps for improved arm definition.', 'Upper Body', 'Lower Body', 'Dumbbells', 'INTERMEDIATE', '3 to 4 sets', '8 to 12 per leg', '30 to 60 seconds per set', 'Stand with feet shoulder-width apart, holding dumbbells at arm\'s length by your sides, palms facing forward. Keep elbows close to your body and curl the dumbbells upwards towards your shoulders, contracting the biceps. Slowly lower the dumbbells back down to the starting position.', 'https://www.inspireusafoundation.org/wp-content/uploads/2023/04/dumbbell-curl-benefits.png', 'https://www.youtube.com/embed/ykJmrZ5v0Oo?si=ecAXFMrt2PJAHA2i', 'Weight Loss', ''),
(58, 'Tricep Dips', 'Tricep dips target the triceps brachii muscles located on the back of the upper arm. By lowering and lifting the body using a stable surface, such as parallel bars or a bench, this exercise strengthens and tones the triceps for improved arm definition and strength.', 'Strength', 'Upper Body', 'Parallel Bars or Bench', 'INTERMEDIATE', '3 to 4 sets', '8 to 12 per set', '30 to 60 seconds per set', 'Position your hands shoulder-width apart on parallel bars or the edge of a bench, fingers pointing forward. Lift your body until arms are fully extended, then lower yourself by bending your elbows until they reach a 90-degree angle. Push yourself back up to the starting position by straightening your arms.', 'https://images-na.ssl-images-amazon.com/images/I/61tWnYpyLfL._AC_SL1500_.jpg', 'https://www.youtube.com/embed/0326dy_-CzM?si=rtqpHU53-QH63JyW', 'Muscle Gain', ''),
(59, 'Tricep Dips', 'Tricep dips target the triceps brachii muscles located on the back of the upper arm. By lowering and lifting the body using a stable surface, such as parallel bars or a bench, this exercise strengthens and tones the triceps for improved arm definition and strength.', 'Upper Body', 'Core', 'Parallel Bars or Bench', 'INTERMEDIATE', '3 to 4 sets', '8 to 12 per set', '30 to 60 seconds per set', 'Position your hands shoulder-width apart on parallel bars or the edge of a bench, fingers pointing forward. Lift your body until arms are fully extended, then lower yourself by bending your elbows until they reach a 90-degree angle. Push yourself back up to the starting position by straightening your arms.', 'https://images-na.ssl-images-amazon.com/images/I/61tWnYpyLfL._AC_SL1500_.jpg', 'https://www.youtube.com/embed/0326dy_-CzM?si=rtqpHU53-QH63JyW', 'Weight Loss', ''),
(60, 'Barbell Lunges', 'Barbell lunges are a lower body exercise that targets the quadriceps, hamstrings, and glutes. By stepping forward and lowering the body into a lunge position while holding a barbell, this exercise strengthens the lower body and improves balance and coordination.', 'Strength', 'Upper Body', 'Barbell', 'INTERMEDIATE', '3 to 4 sets', '8 to 12 per set', '30 to 60 seconds per set', 'Stand with feet shoulder-width apart, holding a barbell across your upper back. Take a large step forward with one foot and lower your body until both knees form 90-degree angles. Push through the heel of your front foot to return to the starting position, then repeat on the opposite side.', 'https://i.ytimg.com/vi/I__9oV1UDv0/hqdefault.jpg', 'https://www.youtube.com/embed/I__9oV1UDv0?si=6sSZUK6SqfPnLCrT', 'Weight Loss', '');
INSERT INTO `exercises` (`ExerciseID`, `ExerciseName`, `Description`, `CategoryID`, `PartOfBody`, `EquipmentID`, `Difficulty`, `set`, `reps`, `duration`, `Instructions`, `ImageURL`, `VideoURL`, `Goal`, `Workoutset`) VALUES
(61, 'Barbell Lunges', 'Barbell lunges are a lower body exercise that targets the quadriceps, hamstrings, and glutes. By stepping forward and lowering the body into a lunge position while holding a barbell, this exercise strengthens the lower body and improves balance and coordination.', 'Strength', 'Lower Body', 'Barbell', 'INTERMEDIATE', '3 to 4 sets', '8 to 12 per set', '30 to 60 seconds per set', 'Stand with feet shoulder-width apart, holding a barbell across your upper back. Take a large step forward with one foot and lower your body until both knees form 90-degree angles. Push through the heel of your front foot to return to the starting position, then repeat on the opposite side.', 'https://i.ytimg.com/vi/I__9oV1UDv0/hqdefault.jpg', 'https://www.youtube.com/embed/I__9oV1UDv0?si=6sSZUK6SqfPnLCrT', 'Weight Loss', ''),
