(66, 'Lat Pulldown', 'The lat pulldown targets the latissimus dorsi (back muscles) and the biceps. It\'s performed using a cable machine with an overhead bar attachment. The exercise involves pulling the bar down towards the chest while seated, engaging the back muscles. Lat pulldowns help build upper body strength and improve back definition.', 'Strength', 'Upper Body', 'Cable Machine with Overhead Bar Attachment', 'BEGINNER', '3 to 4 sets', '8 to 12 per set', '30 to 60 seconds per set', 'Hold a dumbbell in each hand at arm\'s length by your sides. Place one foot entirely on a bench or platform. Press through the heel of the foot on the bench to extend the hip and knee, lifting the body up until the leg is straight. Step back down and repeat on the other leg.', 'https://assets-global.website-files.com/633e1d90d9eb74e3a709f68a/633e1d90d9eb74293109f8b9_lat%20pulldowns%20main%20image.jpg', 'https://www.youtube.com/embed/AOpi-p0cJkc?si=TGTOEnOzpngbMHTn', 'Maintain Weight', ''),
(67, 'Lat Pulldown', 'The lat pulldown targets the latissimus dorsi (back muscles) and the biceps. It\'s performed using a cable machine with an overhead bar attachment. The exercise involves pulling the bar down towards the chest while seated, engaging the back muscles. Lat pulldowns help build upper body strength and improve back definition.', 'Strength', 'Lower Body', 'Cable Machine with Overhead Bar Attachment', 'BEGINNER', '3 to 4 sets', '8 to 12 per set', '30 to 60 seconds per set', 'Sit on the lat pulldown machine with knees secured under the pads. Grasp the bar with an overhand grip, hands wider than shoulder-width apart. Pull the bar down towards the chest, squeezing the shoulder blades together, then slowly return to the starting position.', 'https://assets-global.website-files.com/633e1d90d9eb74e3a709f68a/633e1d90d9eb74293109f8b9_lat%20pulldowns%20main%20image.jpg', 'https://www.youtube.com/embed/AOpi-p0cJkc?si=TGTOEnOzpngbMHTn', 'Maintain Weight', ''),
(68, 'Lat Pulldown', 'The lat pulldown targets the latissimus dorsi (back muscles) and the biceps. It\'s performed using a cable machine with an overhead bar attachment. The exercise involves pulling the bar down towards the chest while seated, engaging the back muscles. Lat pulldowns help build upper body strength and improve back definition.', 'Upper Body', 'Core', 'Cable Machine with Overhead Bar Attachment', 'BEGINNER', '3 to 4 sets', '8 to 12 per set', '30 to 60 seconds per set', 'Sit on the lat pulldown machine with knees secured under the pads. Grasp the bar with an overhand grip, hands wider than shoulder-width apart. Pull the bar down towards the chest, squeezing the shoulder blades together, then slowly return to the starting position.', 'https://assets-global.website-files.com/633e1d90d9eb74e3a709f68a/633e1d90d9eb74293109f8b9_lat%20pulldowns%20main%20image.jpg', 'https://www.youtube.com/embed/AOpi-p0cJkc?si=TGTOEnOzpngbMHTn', 'Muscle Gain', ''),
(69, 'Barbell Overhead Press (Military', 'The barbell overhead press, also known as the military press, targets the shoulders, triceps, and upper chest. It\'s performed by pressing a barbell overhead from shoulder height to full arm extension. This exercise builds shoulder strength and stability, enhancing upper body pressing power.', 'Strength', 'Upper Body', 'Barbell, Weight Plates', 'INTERMEDIATE', '3 to 4 sets', '8 to 12 per set', '30 to 60 seconds per set', 'Stand with feet hip-width apart and hold a barbell at shoulder height with an overhand grip. Press the barbell overhead until arms are fully extended, then lower back down to shoulder height with control.', 'https://cdn.mos.cms.futurecdn.net/HWsdNRx3FEGjtpBn3ZVCHK-1200-80.jpg', 'https://www.youtube.com/embed/2yjwXTZQDDI?si=puFjDoGabFQVVBK5', 'Gain Weight', ''),
(70, 'Barbell Overhead Press (Military', 'The barbell overhead press, also known as the military press, targets the shoulders, triceps, and upper chest. It\'s performed by pressing a barbell overhead from shoulder height to full arm extension. This exercise builds shoulder strength and stability, enhancing upper body pressing power.', 'Strength', 'Core', 'Barbell, Weight Plates', 'INTERMEDIATE', '3 to 4 sets', '8 to 12 per set', '30 to 60 seconds per set', 'Stand with feet hip-width apart and hold a barbell at shoulder height with an overhand grip. Press the barbell overhead until arms are fully extended, then lower back down to shoulder height with control.', 'https://cdn.mos.cms.futurecdn.net/HWsdNRx3FEGjtpBn3ZVCHK-1200-80.jpg', 'https://www.youtube.com/embed/2yjwXTZQDDI?si=puFjDoGabFQVVBK5', 'Gain Weight', ''),
(71, 'Barbell Overhead Press (Military', 'The barbell overhead press, also known as the military press, targets the shoulders, triceps, and upper chest. It\'s performed by pressing a barbell overhead from shoulder height to full arm extension. This exercise builds shoulder strength and stability, enhancing upper body pressing power.', 'Upper Body', 'Lower Body', 'Barbell, Weight Plates', 'INTERMEDIATE', '3 to 4 sets', '8 to 12 per set', '30 to 60 seconds per set', 'Stand with feet hip-width apart and hold a barbell at shoulder height with an overhand grip. Press the barbell overhead until arms are fully extended, then lower back down to shoulder height with control.', 'https://cdn.mos.cms.futurecdn.net/HWsdNRx3FEGjtpBn3ZVCHK-1200-80.jpg', 'https://www.youtube.com/embed/2yjwXTZQDDI?si=puFjDoGabFQVVBK5', 'Muscle Gain', ''),
(72, 'Jumping Rope', 'Jumping rope is a classic cardiovascular exercise that improves coordination, agility, and endurance. It targets the lower body muscles while also providing a full-body workout.', 'Cardiovascular', 'Cardio', 'Jump Rope', 'BEGINNER', '', '', '10 to 15 minutes', 'Hold the jump rope handles in each hand and jump over the rope, landing lightly on the balls of the feet. Start with basic jumps and progress to variations such as double unders or cross-overs.', 'https://blog.torokhtiy.com/wp-content/uploads/2023/07/How-to-Get-Better-at-Jumping-Rope.jpg', 'https://www.youtube.com/embed/u3zgHI8QnqE?si=xHnAWToOrsyoGC3P', 'Weight Loss', ''),
(73, 'Dumbbell Step-ups', 'Dumbbell step-ups target the quadriceps, glutes, and hamstrings. It\'s performed by stepping onto a raised platform or bench with one foot, then driving through the heel to lift the body upward. This exercise improves lower body strength, balance, and coordination.', 'Strength', 'Legs', 'Dumbbells, Raised Platform or Bench', 'BEGINNER', '3 To 4 sets', '10 to 12 per leg', '30 to 60 seconds per set', 'Hold a dumbbell in each hand at arm\'s length by your sides. Place one foot entirely on a bench or platform. Press through the heel of the foot on the bench to extend the hip and knee, lifting the body up until the leg is straight. Step back down and repeat on the other leg.', 'https://i.ytimg.com/vi/-wcgEGQN5_U/maxresdefault.jpg', 'https://www.youtube.com/embed/-wcgEGQN5_U?si=o2R2XXy2EjHLQS5t', 'Weight Loss', ''),
(74, 'Dumbbell Step-ups', 'Dumbbell step-ups target the quadriceps, glutes, and hamstrings. It\'s performed by stepping onto a raised platform or bench with one foot, then driving through the heel to lift the body upward. This exercise improves lower body strength, balance, and coordination.', 'Strength', 'Lower Body', 'Dumbbells, Raised Platform or Bench', 'BEGINNER', '3 To 4 sets', '10 to 12 per leg', '30 to 60 seconds per set', 'Hold a dumbbell in each hand at arm\'s length by your sides. Place one foot entirely on a bench or platform. Press through the heel of the foot on the bench to extend the hip and knee, lifting the body up until the leg is straight. Step back down and repeat on the other leg.', 'https://i.ytimg.com/vi/-wcgEGQN5_U/maxresdefault.jpg', 'https://www.youtube.com/embed/-wcgEGQN5_U?si=o2R2XXy2EjHLQS5t', 'Maintain Weight', ''),
(75, 'Dumbbell Step-ups', 'Dumbbell step-ups target the quadriceps, glutes, and hamstrings. It\'s performed by stepping onto a raised platform or bench with one foot, then driving through the heel to lift the body upward. This exercise improves lower body strength, balance, and coordination.', 'Strength', 'Core', 'Dumbbells, Raised Platform or Bench', 'BEGINNER', '3 To 4 sets', '10 to 12 per leg', '30 to 60 seconds per set', 'Hold a dumbbell in each hand at arm\'s length by your sides. Place one foot entirely on a bench or platform. Press through the heel of the foot on the bench to extend the hip and knee, lifting the body up until the leg is straight. Step back down and repeat on the other leg.', 'https://i.ytimg.com/vi/-wcgEGQN5_U/maxresdefault.jpg', 'https://www.youtube.com/embed/-wcgEGQN5_U?si=o2R2XXy2EjHLQS5t', 'Muscle Gain', ''),
(76, 'Boxing', 'Boxing is a dynamic cardiovascular workout that engages the entire body. It involves punching, footwork, and defensive movements, providing both aerobic and anaerobic benefits.', 'Cardiovascular', 'Cardio', 'Boxing Gloves, Punching Bag or Partner', 'BEGINNER', '', '', '20 to 30 minutes', 'Shadowbox or hit a punching bag, incorporating a variety of punches (jabs, crosses, hooks, uppercuts) and defensive movements (slips, rolls, blocks).', 'https://www.shape.com/thmb/juZ1SfooOdjIq6zvXgmsoYRp8Rc=/1500x0/filters:no_upscale():max_bytes(150000):strip_icc()/boxing-8fa6221ec7ad4a80ba1e730eb9d1c507.jpg', 'https://www.youtube.com/embed/kKDHdsVN0b8?si=_mk2ie-0-BFgYBE', 'Weight Loss', ''),
(77, 'Stationary Bike Sprints', 'Stationary bike sprints are a high-intensity cardiovascular exercise that targets the lower body. It involves alternating between short bursts of maximum effort and periods of recovery.', 'Cardiovascular', 'Cardio', 'Stationary Bike', 'INTERMEDIATE', '', '', '30 to 30 minutes', 'Set the stationary bike to a high resistance level. Cycle at maximum effort for 20-30 seconds, then reduce intensity for 60-90 seconds of active recovery. Repeat this cycle multiple times.', 'https://www.wahoofitness.com/blog/wp-content/uploads/2020/08/Wahoo-Le-Col57366-3.jpg', 'https://www.youtube.com/embed/4Hl1WAGKjMc?si=xoVRYSzIfoLha0Y9', 'Weight Loss', ''),
(78, 'Battle Ropes', 'Battle ropes are a high-intensity cardiovascular exercise that also strengthens the arms, shoulders, and core. It involves rapidly waving heavy ropes up and down or in circular motions.', 'Cardiovascular', 'Cardio', 'Battle Ropes', 'iNTERMEDIATE', '', '', '15 to 20 minutes', 'Hold one end of the battle rope in each hand and stand with feet shoulder-width apart. Move the ropes simultaneously in various patterns, such as waves, slams, or circles, maintaining a steady pace.', 'https://hips.hearstapps.com/hmg-prod/images/gettyimages-657495548-1527710829.jpg', 'https://www.youtube.com/embed/zw0OMi00X5g?si=VOoI_ssDOTdby2ku', 'Weight Loss', ''),
(79, 'Seated Leg Curl', 'The seated leg curl targets the hamstrings and calves. It\'s performed on a leg curl machine by bending the knees and curling the weight toward the body while seated. This exercise isolates the hamstring muscles, promoting strength and hypertrophy.', 'Strength', 'Legs', 'Leg Curl Machine', 'BEGINNER', '3 To 4 sets', '10 to 12 per leg', '30 to 60 seconds per set', 'Sit on the leg curl machine with the legs extended and the padded lever resting on the back of the ankles. Grasp the handles for stability and flex the knees to curl the lever towards the body, squeezing the hamstrings at the top of the movement. Slowly return to the starting position.', 'https://i.ytimg.com/vi/ELOCsoDSmrg/maxresdefault.jpg', 'https://www.youtube.com/embed/ELOCsoDSmrg?si=-a0Dn8Vx_XTHRZ4Z', 'Muscle Gain', ''),
(80, 'Seated Leg Curl', 'The seated leg curl targets the hamstrings and calves. It\'s performed on a leg curl machine by bending the knees and curling the weight toward the body while seated. This exercise isolates the hamstring muscles, promoting strength and hypertrophy.', 'Strength', 'Core', 'Leg Curl Machine', 'BEGINNER', '3 To 4 sets', '10 to 12 per leg', '30 to 60 seconds per set', 'Sit on the leg curl machine with the legs extended and the padded lever resting on the back of the ankles. Grasp the handles for stability and flex the knees to curl the lever towards the body, squeezing the hamstrings at the top of the movement. Slowly return to the starting position.', 'https://i.ytimg.com/vi/ELOCsoDSmrg/maxresdefault.jpg', 'https://www.youtube.com/embed/ELOCsoDSmrg?si=-a0Dn8Vx_XTHRZ4Z', 'Muscle Gain', ''),
(81, 'Seated Leg Curl', 'The seated leg curl targets the hamstrings and calves. It\'s performed on a leg curl machine by bending the knees and curling the weight toward the body while seated. This exercise isolates the hamstring muscles, promoting strength and hypertrophy.', 'Lower Body', 'Lower Body', 'Leg Curl Machine', 'BEGINNER', '3 To 4 sets', '10 to 12 per leg', '30 to 60 seconds per set', 'Sit on the leg curl machine with the legs extended and the padded lever resting on the back of the ankles. Grasp the handles for stability and flex the knees to curl the lever towards the body, squeezing the hamstrings at the top of the movement. Slowly return to the starting position.', 'https://i.ytimg.com/vi/ELOCsoDSmrg/maxresdefault.jpg', 'https://www.youtube.com/embed/ELOCsoDSmrg?si=-a0Dn8Vx_XTHRZ4Z', 'Maintain Weight', 'Leg Intermediate'),
(82, 'Boxing', 'Boxing is a dynamic cardiovascular workout that engages the entire body. It involves punching, footwork, and defensive movements, providing both aerobic and anaerobic benefits.', 'Cardiovascular', 'Legs', 'Boxing Gloves, Punching Bag or Partner', 'BEGINNER', '', '', '20 to 30 minutes', 'Shadowbox or hit a punching bag, incorporating a variety of punches (jabs, crosses, hooks, uppercuts) and defensive movements (slips, rolls, blocks).', 'https://www.shape.com/thmb/juZ1SfooOdjIq6zvXgmsoYRp8Rc=/1500x0/filters:no_upscale():max_bytes(150000):strip_icc()/boxing-8fa6221ec7ad4a80ba1e730eb9d1c507.jpg', 'https://www.youtube.com/embed/kKDHdsVN0b8?si=_mk2ie-0-BFgYBE', 'Muscle Gain', 'Leg Advanced'),
(83, 'Rowing Machine', 'The rowing machine provides a full-body cardiovascular workout, engaging the arms, legs, and core muscles. It simulates the action of rowing a boat, incorporating both strength and endurance elements.', 'Cardiovascular', 'Upper Body', 'Rowing Machine', 'BEGINNER', '', '', '20 to minutes', 'Sit on the rowing machine with feet secured and grip the handle. Push through the legs, then pull the handle towards the chest while leaning back slightly. Extend the arms, then reverse the motion to return to the starting position.', 'https://media.post.rvohealth.io/wp-content/uploads/2020/06/rowing-exercising-gym-732x549-thumbnail.jpg', 'https://www.youtube.com/embed/TeFo51Q_Nsc?si=_yN7wd0K57EZuofl', 'Weight Loss', 'Shoulder & Back Advanced'),
