(90, 'Jump Squats', 'Jump squats are a plyometric exercise that elevates heart rate while also strengthening the lower body muscles. It involves performing a squat and exploding upward into a jump.', 'Cardiovascular', 'Core', 'None', 'INTERMEDIATE', '', '', '10 to 15 minutes', 'Start in a squat position with feet shoulder-width apart. Lower into a squat, then explosively jump as high as possible. Land softly and immediately transition into the next squat.', 'https://personaltrainingmequon.com/wp-content/uploads/2019/04/Jump-Squats.jpg', 'https://www.youtube.com/embed/BRfxI2Es2lE?si=HTszH9BX6X9218t_', 'Weight Loss', 'Leg Advanced'),
(91, 'Jump Squats', 'Jump squats are a plyometric exercise that elevates heart rate while also strengthening the lower body muscles. It involves performing a squat and exploding upward into a jump.', 'Cardiovascular', 'Lower Body', 'None', 'INTERMEDIATE', '', '', '10 to 15 minutes', 'Start in a squat position with feet shoulder-width apart. Lower into a squat, then explosively jump as high as possible. Land softly and immediately transition into the next squat.', 'https://personaltrainingmequon.com/wp-content/uploads/2019/04/Jump-Squats.jpg', 'https://www.youtube.com/embed/BRfxI2Es2lE?si=HTszH9BX6X9218t_', 'Muscle Gain', 'Leg Intermediate'),
(92, 'Boxing', 'Boxing is a dynamic cardiovascular workout that engages the entire body. It involves punching, footwork, and defensive movements, providing both aerobic and anaerobic benefits.', 'Cardiovascular', 'Upper Body', 'Boxing Gloves, Punching Bag or Partner', 'BEGINNER', '', '', '20 to 30 minutes', 'Shadowbox or hit a punching bag, incorporating a variety of punches (jabs, crosses, hooks, uppercuts) and defensive movements (slips, rolls, blocks).', 'https://www.shape.com/thmb/juZ1SfooOdjIq6zvXgmsoYRp8Rc=/1500x0/filters:no_upscale():max_bytes(150000):strip_icc()/boxing-8fa6221ec7ad4a80ba1e730eb9d1c507.jpg', 'https://www.youtube.com/embed/kKDHdsVN0b8?si=_mk2ie-0-BFgYBE', 'Weight Loss', ''),
(93, 'Boxing', 'Boxing is a dynamic cardiovascular workout that engages the entire body. It involves punching, footwork, and defensive movements, providing both aerobic and anaerobic benefits.', 'Cardiovascular', 'Core', 'Boxing Gloves, Punching Bag or Partner', 'BEGINNER', '', '', '20 to 30 minutes', 'Shadowbox or hit a punching bag, incorporating a variety of punches (jabs, crosses, hooks, uppercuts) and defensive movements (slips, rolls, blocks).', 'https://www.shape.com/thmb/juZ1SfooOdjIq6zvXgmsoYRp8Rc=/1500x0/filters:no_upscale():max_bytes(150000):strip_icc()/boxing-8fa6221ec7ad4a80ba1e730eb9d1c507.jpg', 'https://www.youtube.com/embed/kKDHdsVN0b8?si=_mk2ie-0-BFgYBE', 'Weight Loss', ''),
(94, 'Boxing', 'Boxing is a dynamic cardiovascular workout that engages the entire body. It involves punching, footwork, and defensive movements, providing both aerobic and anaerobic benefits.', 'Cardiovascular', 'Lower Body', 'Boxing Gloves, Punching Bag or Partner', 'BEGINNER', '', '', '20 to 30 minutes', 'Shadowbox or hit a punching bag, incorporating a variety of punches (jabs, crosses, hooks, uppercuts) and defensive movements (slips, rolls, blocks).', 'https://www.shape.com/thmb/juZ1SfooOdjIq6zvXgmsoYRp8Rc=/1500x0/filters:no_upscale():max_bytes(150000):strip_icc()/boxing-8fa6221ec7ad4a80ba1e730eb9d1c507.jpg', 'https://www.youtube.com/embed/kKDHdsVN0b8?si=_mk2ie-0-BFgYBE', 'Muscle Gain', 'Leg Advanced'),
(95, 'Jumping Rope', 'Jumping rope is a classic cardiovascular exercise that improves coordination, agility, and endurance. It targets the lower body muscles while also providing a full-body workout.', 'Cardiovascular', 'Legs', 'Jump Rope', 'BEGINNER', '', '', '10 to 15 minutes', 'Hold the jump rope handles in each hand and jump over the rope, landing lightly on the balls of the feet. Start with basic jumps and progress to variations such as double unders or cross-overs.', 'https://blog.torokhtiy.com/wp-content/uploads/2023/07/How-to-Get-Better-at-Jumping-Rope.jpg', 'https://www.youtube.com/embed/u3zgHI8QnqE?si=xHnAWToOrsyoGC3P', 'Weight Loss', 'Leg Intermediate'),
(96, 'Jumping Rope', 'Jumping rope is a classic cardiovascular exercise that improves coordination, agility, and endurance. It targets the lower body muscles while also providing a full-body workout.', 'Cardiovascular', 'Lower Body', 'Jump Rope', 'BEGINNER', '', '', '10 to 15 minutes', 'Hold the jump rope handles in each hand and jump over the rope, landing lightly on the balls of the feet. Start with basic jumps and progress to variations such as double unders or cross-overs.', 'https://blog.torokhtiy.com/wp-content/uploads/2023/07/How-to-Get-Better-at-Jumping-Rope.jpg', 'https://www.youtube.com/embed/u3zgHI8QnqE?si=xHnAWToOrsyoGC3P', 'Muscle Gain', ''),
