(98, 'Seated Forward Bend (Paschimotta', 'The seated forward bend stretches the hamstrings, lower back, and spine. It\'s a calming yoga pose that promotes relaxation and flexibility.', 'Flexibility', 'Legs', 'None', 'BEGINNER', '', '', '30 to 60 seconds', 'Sit on the floor with legs extended in front. Inhale and lengthen the spine, then exhale and hinge forward from the hips, reaching for the feet or shins. Hold the stretch without rounding the back.', 'https://cdn.yogajournal.com/wp-content/uploads/2021/12/Seated-Forward-Bend-Pose_Andrew-Clark_2400x1350.jpeg', 'https://www.youtube.com/embed/T8sgVyF4Ux4?si=yPGR4td343EZaQWQ', 'Muscle Gain', ''),
(99, 'Seated Forward Bend (Paschimotta', 'The seated forward bend stretches the hamstrings, lower back, and spine. It\'s a calming yoga pose that promotes relaxation and flexibility.', 'Flexibility', 'Lower Body', 'None', 'BEGINNER', '', '', '30 to 60 seconds', 'Sit on the floor with legs extended in front. Inhale and lengthen the spine, then exhale and hinge forward from the hips, reaching for the feet or shins. Hold the stretch without rounding the back.', 'https://cdn.yogajournal.com/wp-content/uploads/2021/12/Seated-Forward-Bend-Pose_Andrew-Clark_2400x1350.jpeg', 'https://www.youtube.com/embed/T8sgVyF4Ux4?si=yPGR4td343EZaQWQ', 'Muscle Gain', ''),
(100, 'Standing Quad Stretch', 'The standing quad stretch targets the quadriceps and hip flexors. It\'s a simple stretch that can be done anywhere to alleviate tightness in the front of the thighs.', 'Flexibility', 'Upper Body', 'None', 'BEGINNER', '', '', '30 to 60 seconds per leg', 'Stand tall with feet hip-width apart. Bend one knee and bring the heel towards the glutes, grabbing the ankle or foot with the corresponding hand. Keep the knees close together and gently press the hips forward to deepen the stretch. Hold for the desired duration, then switch to the other leg.', 'https://www.verywellfit.com/thmb/ZhebQCbptSAeqWEms7TEzve85dY=/1500x0/filters:no_upscale():max_bytes(150000):strip_icc()/Verywell-30-2696366-StandingStretch-2106-5993552eb501e800127d38d3.jpg', 'https://www.youtube.com/embed/ob1tvmQUQZ0?si=liBs13ThnuJIN0mR', 'Muscle Gain', ''),
(101, 'Standing Quad Stretch', 'The standing quad stretch targets the quadriceps and hip flexors. It\'s a simple stretch that can be done anywhere to alleviate tightness in the front of the thighs.', 'Flexibility', 'Core', 'None', 'BEGINNER', '', '', '30 to 60 seconds per leg', 'Stand tall with feet hip-width apart. Bend one knee and bring the heel towards the glutes, grabbing the ankle or foot with the corresponding hand. Keep the knees close together and gently press the hips forward to deepen the stretch. Hold for the desired duration, then switch to the other leg.', 'https://www.verywellfit.com/thmb/ZhebQCbptSAeqWEms7TEzve85dY=/1500x0/filters:no_upscale():max_bytes(150000):strip_icc()/Verywell-30-2696366-StandingStretch-2106-5993552eb501e800127d38d3.jpg', 'https://www.youtube.com/embed/ob1tvmQUQZ0?si=liBs13ThnuJIN0mR', 'Muscle Gain', ''),
(102, 'Child\'s Pose (Balasana)', 'Child\'s Pose is a resting yoga pose that stretches the hips, thighs, and lower back while promoting relaxation and stress relief.', 'Flexibility', 'Legs', 'None', 'BEGINNER', '', '', '30 to 60 seconds', 'Start on hands and knees, then sit back on the heels with knees wide apart. Lower the chest towards the thighs and extend the arms forward, resting the forehead on the floor. Keep the arms active and breathe deeply into the back.', 'https://cdn.yogajournal.com/wp-content/uploads/2021/10/Childs-Pose_Andrew-Clark_1.jpg', 'https://www.youtube.com/embed/2MJGg-dUKh0?si=SBUPtuLu4bpTUjGj', 'Maintain Weight', 'Shoulder & Back Intermediate'),
(103, 'Child\'s Pose (Balasana)', 'Child\'s Pose is a resting yoga pose that stretches the hips, thighs, and lower back while promoting relaxation and stress relief.', 'Flexibility', 'Lower Body', 'None', 'BEGINNER', '', '', '30 to 60 seconds', 'Start on hands and knees, then sit back on the heels with knees wide apart. Lower the chest towards the thighs and extend the arms forward, resting the forehead on the floor. Keep the arms active and breathe deeply into the back.', 'https://cdn.yogajournal.com/wp-content/uploads/2021/10/Childs-Pose_Andrew-Clark_1.jpg', 'https://www.youtube.com/embed/2MJGg-dUKh0?si=SBUPtuLu4bpTUjGj', 'Maintain Weight', ''),
(104, 'Seated Spinal Twist (Ardha Matsy', 'The seated spinal twist stretches the spine, shoulders, and hips while improving spinal mobility and digestion.', 'Flexibility', 'Upper Body', 'None', 'BEGINNER', '', '', '30 to 60 seconds per side', 'Sit tall with legs extended. Bend one knee and cross the foot over the opposite leg, placing the foot flat on the floor outside the opposite knee. Inhale to lengthen the spine, then exhale and twist towards the bent knee, placing the opposite elbow outside the knee. Hold the twist and breathe deeply, then switch to the other side.', 'https://www.bikramnl.com/wp-content/uploads/2018/04/spine-twist-pose-1-495x400.jpg', 'https://www.youtube.com/embed/kxgKSFI5cvg?si=9BeVL7ULgLdsjQCx', 'Maintain Weight', ''),
(105, 'Seated Spinal Twist (Ardha Matsy', 'The seated spinal twist stretches the spine, shoulders, and hips while improving spinal mobility and digestion.', 'Flexibility', 'Core', 'None', 'BEGINNER', '', '', '30 to 60 seconds per side', 'Sit tall with legs extended. Bend one knee and cross the foot over the opposite leg, placing the foot flat on the floor outside the opposite knee. Inhale to lengthen the spine, then exhale and twist towards the bent knee, placing the opposite elbow outside the knee. Hold the twist and breathe deeply, then switch to the other side.', 'https://www.bikramnl.com/wp-content/uploads/2018/04/spine-twist-pose-1-495x400.jpg', 'https://www.youtube.com/embed/kxgKSFI5cvg?si=9BeVL7ULgLdsjQCx', 'Maintain Weight', ''),
(106, 'Seated Spinal Twist (Ardha Matsy', 'The seated spinal twist stretches the spine, shoulders, and hips while improving spinal mobility and digestion.', 'Flexibility', 'Lower Body', 'None', 'BEGINNER', '', '', '30 to 60 seconds per side', 'Sit tall with legs extended. Bend one knee and cross the foot over the opposite leg, placing the foot flat on the floor outside the opposite knee. Inhale to lengthen the spine, then exhale and twist towards the bent knee, placing the opposite elbow outside the knee. Hold the twist and breathe deeply, then switch to the other side.', 'https://www.bikramnl.com/wp-content/uploads/2018/04/spine-twist-pose-1-495x400.jpg', 'https://www.youtube.com/embed/kxgKSFI5cvg?si=9BeVL7ULgLdsjQCx', 'Maintain Weight', ''),
(107, 'Standing Forward Bend (Uttanasan', 'Standing Forward Bend stretches the hamstrings, calves, and spine while calming the mind and relieving stress.', 'Flexibility', 'Legs', 'None', 'BEGINNER', '', '', '30 to 60 seconds', 'Stand with feet hip-width apart and hinge forward from the hips, reaching towards the floor with hands or fingertips. Keep the spine long and knees slightly bent to protect the lower back. Relax the head and neck, and breathe deeply into the stretch.', 'https://cdn.yogajournal.com/wp-content/uploads/2021/11/Uttanasana-Pose_Andrew-Clark_2400x1350.jpeg', 'https://www.youtube.com/embed/WklJNYaayP8?si=8jJYOoZaH_E98_df', 'Maintain Weight', ''),
(108, 'Standing Forward Bend (Uttanasan', 'Standing Forward Bend stretches the hamstrings, calves, and spine while calming the mind and relieving stress.', 'Flexibility', 'Core', 'None', 'BEGINNER', '', '', '30 to 60 seconds', 'Stand with feet hip-width apart and hinge forward from the hips, reaching towards the floor with hands or fingertips. Keep the spine long and knees slightly bent to protect the lower back. Relax the head and neck, and breathe deeply into the stretch.', 'https://cdn.yogajournal.com/wp-content/uploads/2021/11/Uttanasana-Pose_Andrew-Clark_2400x1350.jpeg', 'https://www.youtube.com/embed/WklJNYaayP8?si=8jJYOoZaH_E98_df', 'Maintain Weight', ''),
