(110, 'Seated Butterfly Stretch', 'The seated butterfly stretch targets the inner thighs, groin, and hips. It\'s a simple stretch that improves flexibility and mobility in the lower body.', 'Flexibility', 'Legs', 'None', 'BEGINNER', '', '', '30 to 60 seconds ', 'Sit on the floor with the soles of the feet together and knees bent out to the sides. Hold onto the feet or ankles and gently press the knees towards the floor using the elbows. Keep the spine straight and breathe deeply into the stretch.', 'https://www.verywellfit.com/thmb/my_BC7_gxkQUcbo09KkppRP48bg=/1500x0/filters:no_upscale():max_bytes(150000):strip_icc()/87-3120294-ButterflyStretches0263-49db496667e54ab0b6528e7dee2d329c.jpg', 'https://www.youtube.com/embed/QehQaZvvquA?si=JIxUO-g8HPW7glyM', 'Maintain Weight', ''),
(111, 'Leg Raises', 'Leg raises target the lower abdominals and hip flexors, helping to strengthen the core and improve stability. This exercise can be performed lying on the floor or using a pull-up bar for added intensity.', 'Core', 'Legs', 'Pull-Up Bar', 'INTERMEDIATE', '3 to 4 sets', '10 to 12 per set', '30 to 60 seconds per set', 'Lie on the floor with legs extended and hands placed palms down under the glutes for support. Lift the legs upward towards the ceiling, keeping them straight, then lower them back down without touching the floor.', 'https://hips.hearstapps.com/hmg-prod/images/img-3681-jpg-1633540378.jpg', 'https://www.youtube.com/embed/S2QVHl6DoNo?si=LifGBNQ0vW-YqjYR', 'Muscle Gain', 'Abs Beginner'),
(112, 'Leg Raises', 'Leg raises target the lower abdominals and hip flexors, helping to strengthen the core and improve stability. This exercise can be performed lying on the floor or using a pull-up bar for added intensity.', 'Core', 'Core', 'Pull-Up Bar', 'INTERMEDIATE', '3 to 4 sets', '10 to 12 per set', '30 to 60 seconds per set', 'Lie on the floor with legs extended and hands placed palms down under the glutes for support. Lift the legs upward towards the ceiling, keeping them straight, then lower them back down without touching the floor.', 'https://hips.hearstapps.com/hmg-prod/images/img-3681-jpg-1633540378.jpg', 'https://www.youtube.com/embed/S2QVHl6DoNo?si=LifGBNQ0vW-YqjYR', 'Weight Loss', 'Abs Intermediate'),
(113, 'Dead Bug', 'The dead bug exercise strengthens the core muscles while improving coordination and stability. It\'s a beginner-friendly exercise that can help prevent lower back pain and improve posture.', 'Core', 'Legs', 'None', 'BEGINNER', '2 to 3 sets', '8 to 10 per side', '30 to 45 seconds per set', 'Lie on your back with arms extended towards the ceiling and legs bent at a 90-degree angle, knees over hips. Lower one arm and the opposite leg towards the floor while keeping the lower back pressed into the mat. Return to the starting position and repeat on the other side.', 'https://images.squarespace-cdn.com/content/v1/5a620a85d55b41e7233c5243/b040dc80-c288-4018-8e4d-141101489e12/thumbnail%2Bframe%2B2.png', 'https://www.youtube.com/embed/jbWmbhElf3Q?si=OtwNwVjU5CFXbfjv', 'Maintain Weight', ''),
(114, 'Dead Bug', 'The dead bug exercise strengthens the core muscles while improving coordination and stability. It\'s a beginner-friendly exercise that can help prevent lower back pain and improve posture.', 'Core', 'Lower Body', 'None', 'BEGINNER', '2 to 3 sets', '8 to 10 per side', '30 to 45 seconds per set', 'Lie on your back with arms extended towards the ceiling and legs bent at a 90-degree angle, knees over hips. Lower one arm and the opposite leg towards the floor while keeping the lower back pressed into the mat. Return to the starting position and repeat on the other side.', 'https://images.squarespace-cdn.com/content/v1/5a620a85d55b41e7233c5243/b040dc80-c288-4018-8e4d-141101489e12/thumbnail%2Bframe%2B2.png', 'https://www.youtube.com/embed/jbWmbhElf3Q?si=OtwNwVjU5CFXbfjv', 'Maintain Weight', ''),
(115, 'Bird Dog', 'The bird dog exercise strengthens the core muscles, lower back, and glutes while improving balance and stability. It\'s a beginner-friendly exercise that can help alleviate lower back pain and improve posture.', 'Core', 'Core', 'None', 'BEGINNER', '2 to 3 sets', '8 to 10 per side', '30 to 45 seconds per set', 'Start on your hands and knees with wrists under shoulders and knees under hips. Engage your core and extend your right arm forward and your left leg backward, keeping them straight and parallel to the ground. Hold briefly, then return to the starting position and switch sides, extending the left arm and right leg. Repeat for the desired number of reps, focusing on maintaining stability and balance throughout the movement.', 'https://images.squarespace-cdn.com/content/v1/5f5e8592d2b0854b18af6975/22f7f673-c838-4907-8587-26f0c9ac4dbc/Bird+Dog.jpg', 'https://www.youtube.com/embed/-LRjkbEy-qU?si=qeDuIzRG--WQFctr', 'Muscle Gain', ''),
(116, 'Bird Dog', 'The bird dog exercise strengthens the core muscles, lower back, and glutes while improving balance and stability. It\'s a beginner-friendly exercise that can help alleviate lower back pain and improve posture.', 'Core', 'Lower Body', 'None', 'BEGINNER', '2 to 3 sets', '8 to 10 per side', '30 to 45 seconds per set', 'Start on your hands and knees with wrists under shoulders and knees under hips. Engage your core and extend your right arm forward and your left leg backward, keeping them straight and parallel to the ground. Hold briefly, then return to the starting position and switch sides, extending the left arm and right leg. Repeat for the desired number of reps, focusing on maintaining stability and balance throughout the movement.', 'https://images.squarespace-cdn.com/content/v1/5f5e8592d2b0854b18af6975/22f7f673-c838-4907-8587-26f0c9ac4dbc/Bird+Dog.jpg', 'https://www.youtube.com/embed/-LRjkbEy-qU?si=qeDuIzRG--WQFctr', 'Muscle Gain', ''),
(117, 'Bird Dog', 'The bird dog exercise strengthens the core muscles, lower back, and glutes while improving balance and stability. It\'s a beginner-friendly exercise that can help alleviate lower back pain and improve posture.', 'Core', 'Legs', 'None', 'BEGINNER', '2 to 3 sets', '8 to 10 per side', '30 to 45 seconds per set', 'Start on your hands and knees with wrists under shoulders and knees under hips. Engage your core and extend your right arm forward and your left leg backward, keeping them straight and parallel to the ground. Hold briefly, then return to the starting position and switch sides, extending the left arm and right leg. Repeat for the desired number of reps, focusing on maintaining stability and balance throughout the movement.', 'https://images.squarespace-cdn.com/content/v1/5f5e8592d2b0854b18af6975/22f7f673-c838-4907-8587-26f0c9ac4dbc/Bird+Dog.jpg', 'https://www.youtube.com/embed/-LRjkbEy-qU?si=qeDuIzRG--WQFctr', 'Muscle Gain', ''),
(118, 'Plank with Arm Lift', 'The plank with arm lift is an advanced variation of the traditional plank exercise, adding an element of instability and requiring greater core engagement and shoulder stability.', 'Core', 'Legs', 'None', 'ADVANCE', '3 to 4 sets', '8 to 10 per side', '30 to 45 seconds per set', 'The plank with arm lift is an advanced variation of the traditional plank exercise, adding an element of instability and requiring greater core engagement and shoulder stability.', 'https://bodybuilding-wizard.com/wp-content/uploads/2018/10/plank-with-arm-lift-702x336.jpg', 'https://www.youtube.com/embed/TyiujJcZHVY?si=4P4sm9tupn_QjrPf', 'Muscle Gain', ''),
(119, 'Plank with Arm Lift', 'The plank with arm lift is an advanced variation of the traditional plank exercise, adding an element of instability and requiring greater core engagement and shoulder stability.', 'Core', 'Upper Body', 'None', 'ADVANCE', '3 to 4 sets', '8 to 10 per side', '30 to 45 seconds per set', 'The plank with arm lift is an advanced variation of the traditional plank exercise, adding an element of instability and requiring greater core engagement and shoulder stability.', 'https://bodybuilding-wizard.com/wp-content/uploads/2018/10/plank-with-arm-lift-702x336.jpg', 'https://www.youtube.com/embed/TyiujJcZHVY?si=4P4sm9tupn_QjrPf', 'Muscle Gain', 'Abs Beginner'),
(120, 'Side Plank with Leg Lift', 'The side plank with leg lift targets the obliques, hips, and glutes, while also challenging balance and stability. It\'s an intermediate-level exercise that strengthens the entire core.', 'Core', 'Core', 'None', 'INTERMEDIATE', '3 to 4 sets', '8 to 10 per side', '30 to 45 seconds per set', 'Start in a side plank position with elbow directly beneath the shoulder and body forming a straight line. Lift the top leg upward while maintaining balance and stability through the core. Hold briefly, then lower the leg and repeat on the opposite side.', 'https://i.ytimg.com/vi/JupYk_YSPJs/maxresdefault.jpg', 'https://www.youtube.com/embed/JupYk_YSPJs?si=3AMh3FMPey4hRcli', 'Maintain Weight', ''),
(121, 'Side Plank with Leg Lift', 'The side plank with leg lift targets the obliques, hips, and glutes, while also challenging balance and stability. It\'s an intermediate-level exercise that strengthens the entire core.', 'Core', 'Legs', 'None', 'INTERMEDIATE', '3 to 4 sets', '8 to 10 per side', '30 to 45 seconds per set', 'Start in a side plank position with elbow directly beneath the shoulder and body forming a straight line. Lift the top leg upward while maintaining balance and stability through the core. Hold briefly, then lower the leg and repeat on the opposite side.', 'https://i.ytimg.com/vi/JupYk_YSPJs/maxresdefault.jpg', 'https://www.youtube.com/embed/JupYk_YSPJs?si=3AMh3FMPey4hRcli', 'Maintain Weight', ''),
(122, 'Side Plank with Leg Lift', 'The side plank with leg lift targets the obliques, hips, and glutes, while also challenging balance and stability. It\'s an intermediate-level exercise that strengthens the entire core.', 'Core', 'Upper Body', 'None', 'INTERMEDIATE', '3 to 4 sets', '8 to 10 per side', '30 to 45 seconds per set', 'Start in a side plank position with elbow directly beneath the shoulder and body forming a straight line. Lift the top leg upward while maintaining balance and stability through the core. Hold briefly, then lower the leg and repeat on the opposite side.', 'https://i.ytimg.com/vi/JupYk_YSPJs/maxresdefault.jpg', 'https://www.youtube.com/embed/JupYk_YSPJs?si=3AMh3FMPey4hRcli', 'Maintain Weight', ''),
(123, 'Boxing', 'Boxing is a dynamic cardiovascular workout that engages the entire body. It involves punching, footwork, and defensive movements, providing both aerobic and anaerobic benefits.', 'Cardiovascular', 'Cardio', 'Boxing Gloves, Punching Bag or Partner', 'BEGINNER', '', '', '20 to 30 minutes', 'Shadowbox or hit a punching bag, incorporating a variety of punches (jabs, crosses, hooks, uppercuts) and defensive movements (slips, rolls, blocks).', 'https://www.shape.com/thmb/juZ1SfooOdjIq6zvXgmsoYRp8Rc=/1500x0/filters:no_upscale():max_bytes(150000):strip_icc()/boxing-8fa6221ec7ad4a80ba1e730eb9d1c507.jpg', 'https://www.youtube.com/embed/kKDHdsVN0b8?si=_mk2ie-0-BFgYBE', 'Muscle Gain', ''),
(124, 'Hollow Body Hold', 'The hollow body hold is an isometric core exercise that targets the entire abdominal region. It\'s commonly used in gymnastics and calisthenics to build core strength and stability.', 'Core', 'Lower Body', 'None', 'INTERMEDIATE', '3 to 4 sets', '20 to 30 seconds ', '30 to 60 seconds per set', 'Lie on your back with arms extended overhead and legs straight out. Lift the arms, shoulders, and legs off the floor, creating a \"hollow\" position with the lower back pressed into the ground. Hold the position while engaging the core muscles.', 'https://i.ytimg.com/vi/nvfFexqyo4Q/hqdefault.jpg', 'https://www.youtube.com/embed/nvfFexqyo4Q?si=I5zGiZqOvZkXNnXz', 'Muscle Gain', ''),
