INSERT INTO `exercises` (`ExerciseID`, `ExerciseName`, `Description`, `CategoryID`, `PartOfBody`, `EquipmentID`, `Difficulty`, `set`, `reps`, `duration`, `Instructions`, `ImageURL`, `VideoURL`, `Goal`, `Workoutset`) VALUES
(126, 'Russian Twist with Medicine Ball', 'The Russian twist with a medicine ball targets the obliques, abdominals, and hip flexors, while also improving rotational strength and stability.', 'Core', 'Legs', 'Medicine Ball ', 'INTERMEDIATE', '3 to 4 sets', '12 to 15 per side', '30 to 45 seconds per set', 'Sit on the floor with knees bent and heels on the ground, holding a medicine ball in front of the chest. Lean back slightly and lift the feet off the ground, balancing on the glutes. Rotate the torso to the right, tapping the medicine ball on the floor beside the hip, then rotate to the left. Continue alternating sides in a controlled motion.', 'https://i.ytimg.com/vi/YXhO1LpfEtk/maxresdefault.jpg', 'https://www.youtube.com/embed/YXhO1LpfEtk?si=Tjqb3TFZJbtP49LO', 'Muscle Gain', 'Abs Beginner'),
(127, 'Russian Twist with Medicine Ball', 'The Russian twist with a medicine ball targets the obliques, abdominals, and hip flexors, while also improving rotational strength and stability.', 'Core', 'Core', 'Medicine Ball ', 'INTERMEDIATE', '3 to 4 sets', '12 to 15 per side', '30 to 45 seconds per set', 'Sit on the floor with knees bent and heels on the ground, holding a medicine ball in front of the chest. Lean back slightly and lift the feet off the ground, balancing on the glutes. Rotate the torso to the right, tapping the medicine ball on the floor beside the hip, then rotate to the left. Continue alternating sides in a controlled motion.', 'https://i.ytimg.com/vi/YXhO1LpfEtk/maxresdefault.jpg', 'https://www.youtube.com/embed/YXhO1LpfEtk?si=Tjqb3TFZJbtP49LO', 'Muscle Gain', 'Abs Beginner'),
(128, 'Russian Twist with Medicine Ball', 'The Russian twist with a medicine ball targets the obliques, abdominals, and hip flexors, while also improving rotational strength and stability.', 'Core', 'Lower Body', 'Medicine Ball ', 'INTERMEDIATE', '3 to 4 sets', '12 to 15 per side', '30 to 45 seconds per set', 'Sit on the floor with knees bent and heels on the ground, holding a medicine ball in front of the chest. Lean back slightly and lift the feet off the ground, balancing on the glutes. Rotate the torso to the right, tapping the medicine ball on the floor beside the hip, then rotate to the left. Continue alternating sides in a controlled motion.', 'https://i.ytimg.com/vi/YXhO1LpfEtk/maxresdefault.jpg', 'https://www.youtube.com/embed/YXhO1LpfEtk?si=Tjqb3TFZJbtP49LO', 'Muscle Gain', 'Abs Beginner'),
(129, 'Mountain Climbers', 'Mountain climbers are a dynamic core exercise that also elevates heart rate, making it a cardiovascular workout. It targets the abdominals, hip flexors, and shoulders.', 'Core', 'Lower Body', 'None', 'INTERMEDIATE', '3 to 4 sets', '10 to 15 per leg', '30 to 45 seonds per set', 'Start in a plank position with hands directly under shoulders and body in a straight line. Drive one knee towards the chest, then quickly switch legs, alternating in a running motion while maintaining core engagement.', 'https://hips.hearstapps.com/hmg-prod/images/mountainclimbers12-1566412039.jpg', 'https://www.youtube.com/embed/cnyTQDSE884?si=48IysK51SNCqhPTb', 'Weight Loss', 'Abs Beginner'),
(130, 'Mountain Climbers', 'Mountain climbers are a dynamic core exercise that also elevates heart rate, making it a cardiovascular workout. It targets the abdominals, hip flexors, and shoulders.', 'Core', 'Legs', 'None', 'INTERMEDIATE', '3 to 4 sets', '10 to 15 per leg', '30 to 45 seonds per set', 'Start in a plank position with hands directly under shoulders and body in a straight line. Drive one knee towards the chest, then quickly switch legs, alternating in a running motion while maintaining core engagement.', 'https://hips.hearstapps.com/hmg-prod/images/mountainclimbers12-1566412039.jpg', 'https://www.youtube.com/embed/cnyTQDSE884?si=48IysK51SNCqhPTb', 'Weight Loss', 'Abs Intermediate'),
(131, 'Mountain Climbers', 'Mountain climbers are a dynamic core exercise that also elevates heart rate, making it a cardiovascular workout. It targets the abdominals, hip flexors, and shoulders.', 'Core', 'Core', 'None', 'INTERMEDIATE', '3 to 4 sets', '10 to 15 per leg', '30 to 45 seonds per set', 'Start in a plank position with hands directly under shoulders and body in a straight line. Drive one knee towards the chest, then quickly switch legs, alternating in a running motion while maintaining core engagement.', 'https://hips.hearstapps.com/hmg-prod/images/mountainclimbers12-1566412039.jpg', 'https://www.youtube.com/embed/cnyTQDSE884?si=48IysK51SNCqhPTb', 'Weight Loss', 'Abs Advanced'),
(132, 'Single-Leg Deadlift', 'The single-leg deadlift challenges balance and stability while targeting the hamstrings, glutes, and lower back. It\'s performed by hinging at the hips and extending one leg behind while lowering the torso towards the ground.', 'Balance', 'Legs', 'Dumbbells or Kettlebells', 'INTERMEDIATE', '3 to 4 sets', '8 to 10 per leg', '30 to 60 seconds per set', 'Stand on one leg with a slight bend in the knee and hold a dumbbell or kettlebell in the opposite hand. Hinge at the hips and lower the weight towards the ground while simultaneously lifting the non-weight-bearing leg behind. Keep the back straight and core engaged, then return to the starting position.', 'https://hips.hearstapps.com/hmg-prod/images/2019-menshealth-formcheck-ep38-singlelegdeadlift-ms-mo-edit-v1-00-00-20-15-still007-1568827173.jpg', 'https://www.youtube.com/embed/b9bHy3ojQWA?si=i6z3-OERKB3cD_ga', 'Muscle Gain', ''),
(133, 'Single-Leg Deadlift', 'The single-leg deadlift challenges balance and stability while targeting the hamstrings, glutes, and lower back. It\'s performed by hinging at the hips and extending one leg behind while lowering the torso towards the ground.', 'Balance', 'Core', 'Dumbbells or Kettlebells', 'INTERMEDIATE', '3 to 4 sets', '8 to 10 per leg', '30 to 60 seconds per set', 'Stand on one leg with a slight bend in the knee and hold a dumbbell or kettlebell in the opposite hand. Hinge at the hips and lower the weight towards the ground while simultaneously lifting the non-weight-bearing leg behind. Keep the back straight and core engaged, then return to the starting position.', 'https://hips.hearstapps.com/hmg-prod/images/2019-menshealth-formcheck-ep38-singlelegdeadlift-ms-mo-edit-v1-00-00-20-15-still007-1568827173.jpg', 'https://www.youtube.com/embed/b9bHy3ojQWA?si=i6z3-OERKB3cD_ga', 'Muscle Gain', ''),
(134, 'Single-Leg Deadlift', 'The single-leg deadlift challenges balance and stability while targeting the hamstrings, glutes, and lower back. It\'s performed by hinging at the hips and extending one leg behind while lowering the torso towards the ground.', 'Balance', 'Lower Body', 'Dumbbells or Kettlebells', 'INTERMEDIATE', '3 to 4 sets', '8 to 10 per leg', '30 to 60 seconds per set', 'Stand on one leg with a slight bend in the knee and hold a dumbbell or kettlebell in the opposite hand. Hinge at the hips and lower the weight towards the ground while simultaneously lifting the non-weight-bearing leg behind. Keep the back straight and core engaged, then return to the starting position.', 'https://hips.hearstapps.com/hmg-prod/images/2019-menshealth-formcheck-ep38-singlelegdeadlift-ms-mo-edit-v1-00-00-20-15-still007-1568827173.jpg', 'https://www.youtube.com/embed/b9bHy3ojQWA?si=i6z3-OERKB3cD_ga', 'Muscle Gain', ''),
(135, 'Bosu Ball Balance', 'Balancing on a Bosu ball improves proprioception, coordination, and stability by engaging the core and stabilizing muscles. This exercise can involve simply standing on the Bosu ball or incorporating dynamic movements for added challenge.', 'Balance', 'Core', 'Bosu Ball', 'BEGINNER', '', '', '1 to 2 minutes', 'Stand on the flat or domed side of the Bosu ball with feet hip-width apart. Engage the core and maintain balance for the desired duration. To increase difficulty, try lifting one foot off the Bosu ball or performing exercises such as squats or lunges.', 'https://ik.imagekit.io/02fmeo4exvw/expert-articles/2016/02/2016-02-03-bosu-6.jpg', 'https://www.youtube.com/embed/9Hzn4aohiDc?si=dEyW4HOs4Xe5jHhX', 'Maintain Weight', ''),
(136, 'Single-Leg Balance Reach', 'The single-leg balance reach exercise improves balance, proprioception, and hip stability. It involves standing on one leg while reaching the opposite arm towards the floor or an elevated surface.', 'Balance', 'Core', 'None', 'BEGINNER', '3 to 4 sets', '8 to 10 per leg', '30 to 60 seconds per leg', 'Stand on one leg with a slight bend in the knee. Reach the opposite arm towards the floor or an elevated surface while maintaining balance. Keep the torso stable and avoid rotating the hips. Return to the starting position and repeat on the opposite side.', 'https://media1.popsugar-assets.com/files/thumbor/vjd1Sxuqls_oD0-5_Lucuz-EAYE=/fit-in/2900x1915/top/filters:format_auto():extract_cover():upscale()/2013/12/28/267/n/1922729/bef9098c1b5d88d5_reach-edit.jpg', 'https://www.youtube.com/embed/hWotWdcKGpo?si=74aZYFbgXW0YXHhS', 'Maintain Weight', ''),
(137, 'Single-Leg Balance Reach', 'The single-leg balance reach exercise improves balance, proprioception, and hip stability. It involves standing on one leg while reaching the opposite arm towards the floor or an elevated surface.', 'Balance', 'Legs', 'None', 'BEGINNER', '3 to 4 sets', '8 to 10 per leg', '30 to 60 seconds per leg', 'Stand on one leg with a slight bend in the knee. Reach the opposite arm towards the floor or an elevated surface while maintaining balance. Keep the torso stable and avoid rotating the hips. Return to the starting position and repeat on the opposite side.', 'https://media1.popsugar-assets.com/files/thumbor/vjd1Sxuqls_oD0-5_Lucuz-EAYE=/fit-in/2900x1915/top/filters:format_auto():extract_cover():upscale()/2013/12/28/267/n/1922729/bef9098c1b5d88d5_reach-edit.jpg', 'https://www.youtube.com/embed/hWotWdcKGpo?si=74aZYFbgXW0YXHhS', 'Maintain Weight', ''),
(138, 'Stork Stand', 'The stork stand is a simple balance exercise that involves standing on one leg while keeping the other foot lifted off the ground. It\'s an effective way to improve balance and ankle stability.', 'Balance', 'Core', 'None', 'BEGINNER', '', '', '30 to 60 seconds per leg', 'Stand tall with feet hip-width apart. Shift your weight onto one leg and lift the other foot off the ground, either bending the knee and holding it in front or extending it behind for a more challenging variation. Keep the core engaged and maintain balance for the desired duration.', 'https://i.ytimg.com/vi/7muXmaMvdGI/maxresdefault.jpg', 'https://www.youtube.com/embed/7muXmaMvdGI?si=E2nNVFTAjElRfCei', 'Maintain Weight', ''),
(139, 'Bosu Ball Squat with Stability B', 'Combining a Bosu ball with a stability ball adds an extra challenge to the squat exercise, enhancing balance, stability, and core engagement. It targets the lower body muscles while improving overall balance.', 'Balance', 'Legs', 'Bosu Ball, Stability Ball', 'INTERMEDIATE', '3 to 4 sets', '10 to 12 per set', '30 to 60 seconds per set', 'Place a stability ball between the lower back and the wall. Stand on the Bosu ball with feet shoulder-width apart and hold dumbbells at the sides. Perform squats while maintaining balance on the Bosu ball and stability ball.', 'https://i.pinimg.com/originals/64/61/86/6461862fe06823508ef17c143ad90718.jpg', 'https://www.youtube.com/embed/IjCS8j_7vLk?si=Llg831BVi2gtmoW0', 'Muscle Gain', ''),
(140, 'Bosu Ball Squat with Stability B', 'Combining a Bosu ball with a stability ball adds an extra challenge to the squat exercise, enhancing balance, stability, and core engagement. It targets the lower body muscles while improving overall balance.', 'Balance', 'Core', 'Bosu Ball, Stability Ball', 'INTERMEDIATE', '3 to 4 sets', '10 to 12 per set', '30 to 60 seconds per set', 'Place a stability ball between the lower back and the wall. Stand on the Bosu ball with feet shoulder-width apart and hold dumbbells at the sides. Perform squats while maintaining balance on the Bosu ball and stability ball.', 'https://i.pinimg.com/originals/64/61/86/6461862fe06823508ef17c143ad90718.jpg', 'https://www.youtube.com/embed/IjCS8j_7vLk?si=Llg831BVi2gtmoW0', 'Maintain Weight', ''),
(141, 'Side Plank with Leg Lift', 'Side plank with leg lift adds a dynamic component to the traditional side plank exercise, challenging balance and stability while targeting the core and hip abductors.', 'Balance', 'Core', 'None', 'INTERMEDIATE', '3 to 4 sets', '8 to 10 per side', '30 to 60 seconds per set', 'Begin in a side plank position with elbow under shoulder and body in a straight line. Lift the top leg towards the ceiling while maintaining stability in the plank position. Lower the leg with control and repeat on the same side before switching to the other side.', 'https://i.ytimg.com/vi/JupYk_YSPJs/maxresdefault.jpg', 'https://www.youtube.com/embed/JupYk_YSPJs?si=6YpyIi5xilrPPSo5', 'Maintain Weight', ''),
(142, 'Heel Touch', 'The heel touch exercise targets the obliques and improves balance and stability. It involves lying on the back and reaching towards the heels while keeping the feet and shoulders elevated.', 'Balance', 'Legs', 'None', 'BEGINNER', '3 to 4 sets', '10 to 12 per set', '30 to 60 seconds per set', 'Lie on your back with knees bent and feet flat on the floor. Lift the shoulders off the ground and extend the arms towards the heels. Twist the torso to touch the right heel with the right hand, then return to the center and repeat on the left side.', 'https://i.ytimg.com/vi/9bR-elyolBQ/maxresdefault.jpg', 'https://www.youtube.com/embed/9bR-elyolBQ?si=kNqQT2FirHyZIpqR', 'Maintain Weight', 'Abs Beginner'),
(143, 'Heel Touch', 'The heel touch exercise targets the obliques and improves balance and stability. It involves lying on the back and reaching towards the heels while keeping the feet and shoulders elevated.', 'Balance', 'Core', 'None', 'BEGINNER', '3 to 4 sets', '10 to 12 per set', '30 to 60 seconds per set', 'Lie on your back with knees bent and feet flat on the floor. Lift the shoulders off the ground and extend the arms towards the heels. Twist the torso to touch the right heel with the right hand, then return to the center and repeat on the left side.', 'https://i.ytimg.com/vi/9bR-elyolBQ/maxresdefault.jpg', 'https://www.youtube.com/embed/9bR-elyolBQ?si=kNqQT2FirHyZIpqR', 'Maintain Weight', 'Abs Intermediate'),
(144, 'Spine Lumbar Twist Stretch (Righ', 'The spine lumbar twist stretch targets the lower back, hips, and spinal muscles. It helps improve spinal mobility and relieve tension in the lower back.', 'Flexibility', 'Lower Body', 'None', 'BEGINNER', '', '', '30 to 60 seconds per side', 'Lie on your back with knees bent and feet flat on the floor. Extend the arms out to the sides in a T position. Lower both knees to one side while keeping the shoulders grounded, feeling a gentle stretch in the lower back and hips. Hold for the desired duration, then switch sides.', 'https://i.ytimg.com/vi/BzYBkAvdCJY/maxresdefault.jpg', 'https://www.youtube.com/embed/BzYBkAvdCJY?si=rnxT58_ub4fH3EMI', 'Maintain Weight', 'Abs Beginner'),
(145, 'Spine Lumbar Twist Stretch (Righ', 'The spine lumbar twist stretch targets the lower back, hips, and spinal muscles. It helps improve spinal mobility and relieve tension in the lower back.', 'Flexibility', 'Legs', 'None', 'BEGINNER', '', '', '30 to 60 seconds per side', 'Lie on your back with knees bent and feet flat on the floor. Extend the arms out to the sides in a T position. Lower both knees to one side while keeping the shoulders grounded, feeling a gentle stretch in the lower back and hips. Hold for the desired duration, then switch sides.', 'https://i.ytimg.com/vi/BzYBkAvdCJY/maxresdefault.jpg', 'https://www.youtube.com/embed/BzYBkAvdCJY?si=rnxT58_ub4fH3EMI', 'Maintain Weight', 'Abs Intermediate'),
(146, 'Spine Lumbar Twist Stretch (Left', 'This is the same stretch as above but performed on the opposite side to ensure balanced flexibility in the spine and lower back.', 'Flexibility', 'Lower Body', 'None', 'BEGINNER', '', '', '30 to 60 seconds per side', 'Repeat the instructions mentioned above, but this time lower both knees to the opposite side, feeling the stretch in the lower back, hips, and spinal muscles. Hold for the desired duration.', 'https://i.ytimg.com/vi/BzYBkAvdCJY/maxresdefault.jpg', 'https://www.youtube.com/embed/BzYBkAvdCJY?si=rnxT58_ub4fH3EMI', 'Maintain Weight', 'Abs Beginner'),
(147, 'Spine Lumbar Twist Stretch (Left', 'This is the same stretch as above but performed on the opposite side to ensure balanced flexibility in the spine and lower back.', 'Flexibility', 'Core', 'None', 'BEGINNER', '', '', '30 to 60 seconds per side', 'Repeat the instructions mentioned above, but this time lower both knees to the opposite side, feeling the stretch in the lower back, hips, and spinal muscles. Hold for the desired duration.', 'https://i.ytimg.com/vi/BzYBkAvdCJY/maxresdefault.jpg', 'https://www.youtube.com/embed/BzYBkAvdCJY?si=rnxT58_ub4fH3EMI', 'Maintain Weight', 'Abs Intermediate'),
(148, 'Abdominal Crunches', 'Abdominal crunches target the rectus abdominis, commonly known as the \"six-pack\" muscles, and also engage the obliques. This exercise helps strengthen the core and improve abdominal muscle definition.', '1', 'Legs', 'None', 'BEGINNER', '3 to 4 sets', '12 to 15 per set', '30 to 60 seconds per set', 'To perform a proper abdominal crunch, lie on your back with knees bent and feet flat on the floor, hip-width apart. Place your hands lightly behind your head or cross them over your chest. Engage your core muscles and lift your shoulder blades off the floor, curling your upper body towards your knees. Exhale as you crunch up, keeping your lower back pressed into the floor. Hold for a moment at the top of the movement, then slowly lower back down with control. Avoid pulling on your neck or using momentum to lift your upper body; instead, focus on using your abdominal muscles to perform the movement.', 'https://i.ytimg.com/vi/RUNrHkbP4Pc/maxresdefault.jpg', 'https://www.youtube.com/embed/RUNrHkbP4Pc?si=xGiv1v-IgVh-Dw_L', 'Muscle Gain', 'Abs Beginner'),
(149, 'Cobra Stretch', 'The cobra stretch involves lying face down on the floor and lifting the chest while keeping the hips and lower body grounded. This movement resembles the raised hood of a cobra, hence the name.', 'Flexibility', 'Lower Body', 'None', 'BEGINNER', '', '', '30 to 60 seconds', 'Lie face down on the floor with legs extended and feet hip-width apart. Place palms on the floor under shoulders. Inhale and lift chest and head off the floor, keeping hips grounded. Keep shoulders relaxed, lengthen spine, and engage core. Hold for 15-30 seconds, breathing deeply. Exhale and lower chest and head back down to the floor.', 'https://cdn.yogajournal.com/wp-content/uploads/2022/06/Upward-Facing-Dog-Mod-1_Andrew-Clark-e1670972827524.jpg', 'https://www.youtube.com/embed/Nd3j6Avtv6Q?si=tVt4ZtaqieQ2gtbs', 'Weight Loss', 'Abs Beginner'),
(150, 'Wide Arm Push-Ups', 'Wide arm push-ups are a variation of the classic push-up that targets the chest, shoulders, and triceps. The wider hand placement increases the involvement of the chest muscles.', 'Strength', 'Upper Chest', 'None', 'BEGINNER', '3 to 4 sets', '8 to 12 per set', ' Perform each rep with controlled movements', 'Begin in a plank position with hands wider than shoulder-width apart. Keep core engaged and body in a straight line from head to heels. Lower chest towards the floor while keeping elbows at a 45-degree angle. Push back up to starting position, fully extending arms. Repeat for desired number of repetitions.', 'https://i.ytimg.com/vi/pQUsUHvyoI0/maxresdefault.jpg', 'https://www.youtube.com/embed/pQUsUHvyoI0?si=XcXLiXtcty-LPz7f', 'Weight Loss', 'Chest Intermediate'),
(151, 'Wide Arm Push-Ups', 'Wide arm push-ups are a variation of the classic push-up that targets the chest, shoulders, and triceps. The wider hand placement increases the involvement of the chest muscles.', 'Strength', 'Lower Body', 'None', 'BEGINNER', '3 to 4 sets', '8 to 12 per set', '10 to 15 minutes', 'Begin in a plank position with hands wider than shoulder-width apart. Keep core engaged and body in a straight line from head to heels. Lower chest towards the floor while keeping elbows at a 45-degree angle. Push back up to starting position, fully extending arms. Repeat for desired number of repetitions.', 'https://i.ytimg.com/vi/pQUsUHvyoI0/maxresdefault.jpg', 'https://www.youtube.com/embed/pQUsUHvyoI0?si=XcXLiXtcty-LPz7f', 'Maintain Weight', 'Chest Beginner'),
(152, 'Wide Arm Push-Ups', 'Wide arm push-ups are a variation of the classic push-up that targets the chest, shoulders, and triceps. The wider hand placement increases the involvement of the chest muscles.', 'Strength', 'Core', 'None', 'BEGINNER', '3 to 4 sets', '8 to 12 per set', '10 to 15 minutes', 'Begin in a plank position with hands wider than shoulder-width apart. Keep core engaged and body in a straight line from head to heels. Lower chest towards the floor while keeping elbows at a 45-degree angle. Push back up to starting position, fully extending arms. Repeat for desired number of repetitions.', 'https://i.ytimg.com/vi/pQUsUHvyoI0/maxresdefault.jpg', 'https://www.youtube.com/embed/pQUsUHvyoI0?si=XcXLiXtcty-LPz7f', 'Weight Loss', ''),
(153, 'Knee Push-Ups', 'Knee push-ups are a modified version of the traditional push-up exercise that reduces the load on the upper body by placing the knees on the ground. This variation is suitable for beginners or individuals working on building upper body strength.', 'Strength', 'Upper Body', 'None', 'BEGINNER', '3 to 4 sets', '8 to 12 per set', '10 to 15 minutes', 'Start on your knees and hands, hands wider than shoulder-width. Lower your chest towards the ground, bending elbows until chest nearly touches the floor. Push back up, fully extending arms. Keep body straight, engage core. Do 8-12 reps for 3-4 sets, resting 30-60 seconds between sets.', 'https://i.ytimg.com/vi/jWxvty2KROs/maxresdefault.jpg', 'https://www.youtube.com/embed/jWxvty2KROs?si=ESPaGT9JQNlGqd2v', 'Muscle Gain', 'Chest Beginner'),
(154, 'Knee Push-Ups', 'Knee push-ups are a modified version of the traditional push-up exercise that reduces the load on the upper body by placing the knees on the ground. This variation is suitable for beginners or individuals working on building upper body strength.', 'Strength', 'Lower Body', 'None', 'BEGINNER', '3 to 4 sets', '8 to 12 per set', '10 to 15 minutes', 'Start on your knees and hands, hands wider than shoulder-width. Lower your chest towards the ground, bending elbows until chest nearly touches the floor. Push back up, fully extending arms. Keep body straight, engage core. Do 8-12 reps for 3-4 sets, resting 30-60 seconds between sets.', 'https://i.ytimg.com/vi/jWxvty2KROs/maxresdefault.jpg', 'https://www.youtube.com/embed/jWxvty2KROs?si=ESPaGT9JQNlGqd2v', 'Weight Loss', 'Shoulder & Back Beginner'),
(155, 'Knee Push-Ups', 'Knee push-ups are a modified version of the traditional push-up exercise that reduces the load on the upper body by placing the knees on the ground. This variation is suitable for beginners or individuals working on building upper body strength.', 'Strength', 'Legs', 'None', 'BEGINNER', '3 to 4 sets', '8 to 12 per set', '10 to 15 minutes', 'Start on your knees and hands, hands wider than shoulder-width. Lower your chest towards the ground, bending elbows until chest nearly touches the floor. Push back up, fully extending arms. Keep body straight, engage core. Do 8-12 reps for 3-4 sets, resting 30-60 seconds between sets.', 'https://i.ytimg.com/vi/jWxvty2KROs/maxresdefault.jpg', 'https://www.youtube.com/embed/jWxvty2KROs?si=ESPaGT9JQNlGqd2v', 'Muscle Gain', 'Chest Intermediate'),
(156, 'Knee Push-Ups', 'Knee push-ups are a modified version of the traditional push-up exercise that reduces the load on the upper body by placing the knees on the ground. This variation is suitable for beginners or individuals working on building upper body strength.', 'Strength', 'Core', 'None', 'BEGINNER', '3 to 4 sets', '8 to 12 per set', '10 to 15 minutes', 'Start on your knees and hands, hands wider than shoulder-width. Lower your chest towards the ground, bending elbows until chest nearly touches the floor. Push back up, fully extending arms. Keep body straight, engage core. Do 8-12 reps for 3-4 sets, resting 30-60 seconds between sets.', 'https://i.ytimg.com/vi/jWxvty2KROs/maxresdefault.jpg', 'https://www.youtube.com/embed/jWxvty2KROs?si=ESPaGT9JQNlGqd2v', 'Weight Loss', 'Chest Intermediate'),
(157, 'Arm Circles Clockwise', 'Arm circles clockwise is an upper body exercise that targets the shoulder muscles. It involves making circular motions with the arms in a clockwise direction to improve shoulder mobility and flexibility.', 'Flexibility', 'Upper Body', 'None', 'BEGINNER', '', '', '30 to 60 seconds', 'Arm circles clockwise is a flexibility exercise targeting the shoulders. Stand with arms extended sideways. Make small circles with your arms, gradually increasing size. Do it for 30 seconds to 1 minute. Focus on shoulder engagement and steady breathing. Reverse to counterclockwise for balance. No equipment needed, suitable for all levels.', 'https://i.ytimg.com/vi/140RTNMciH8/maxresdefault.jpg', 'https://www.youtube.com/embed/140RTNMciH8?si=gS-c1lppYtXPflrK', 'Maintain Weight', 'Arm Beginner'),
(158, 'Arm Circles Clockwise', 'Arm circles clockwise is an upper body exercise that targets the shoulder muscles. It involves making circular motions with the arms in a clockwise direction to improve shoulder mobility and flexibility.', 'Flexibility', 'Lower Body', 'None', 'BEGINNER', '', '', '30 to 60 seconds', 'Arm circles clockwise is a flexibility exercise targeting the shoulders. Stand with arms extended sideways. Make small circles with your arms, gradually increasing size. Do it for 30 seconds to 1 minute. Focus on shoulder engagement and steady breathing. Reverse to counterclockwise for balance. No equipment needed, suitable for all levels.', 'https://i.ytimg.com/vi/140RTNMciH8/maxresdefault.jpg', 'https://www.youtube.com/embed/140RTNMciH8?si=gS-c1lppYtXPflrK', 'Maintain Weight', 'Arm Intermediate'),
(159, 'Arm Circles Counterclockwise', 'Arm circles clockwise is a dynamic stretching exercise that targets the shoulder joints and surrounding muscles. It involves making circular motions with the arms while standing', 'Flexibility', 'Core', 'None', 'BEGINNER', '', '', '30 to 60 seconds', 'Arm circles clockwise is a flexibility exercise targeting the shoulders. Stand with arms extended sideways. Make small circles with your arms, gradually increasing size. Do it for 30 seconds to 1 minute. Focus on shoulder engagement and steady breathing. Reverse to counterclockwise for balance. No equipment needed, suitable for all levels.', 'https://i.ytimg.com/vi/140RTNMciH8/maxresdefault.jpg', 'https://www.youtube.com/embed/140RTNMciH8?si=gS-c1lppYtXPflrK', 'Maintain Weight', 'Chest Advanced'),
(160, 'Chest Stretch', 'A simple warm-up exercise for the chest muscles.', 'Flexibility', 'Upper Body', 'None', 'BEGINNER', '', '', '30 to 60 seconds', 'Stand tall with feet hip-width apart. Interlace your fingers behind your back, palms facing inwards. Straighten your arms and gently lift them behind you, opening up your chest. Keep your shoulders relaxed and down. Hold the stretch for 15-30 seconds, feeling a gentle stretch across your chest and shoulders. Avoid arching your back excessively. Release the stretch and repeat as needed.', 'https://insyncphysio.com/wp-content/uploads/2018/10/Behind-Back-Neck-Stretch.jpg', 'https://www.youtube.com/embed/ESviEdZSfII?si=0z63AD1H-ZVEGEB4', 'Maintain Weight', 'Chest Intermediate'),
(161, 'Incline Push-Ups', 'Incline push-ups are a modified version of traditional push-ups performed with hands elevated on a surface, such as a bench or step. This variation reduces the intensity by placing less weight on the upper body.', 'Strength', 'Upper Body', 'Elevated Surface', 'BEGINNER', '3 to 4 sets', '8 to 12 per set', '10 to 15 minutes', 'Place your hands shoulder-width apart on the elevated surface with arms fully extended. Keep your body in a straight line from head to heels. Lower your chest towards the surface by bending your elbows, keeping them at a 45-degree angle to your body. Stop when your chest is close to the surface, then push back up to the starting position. Keep your core engaged and back straight throughout the movement. Repeat for the desired number of repetitions.', 'https://mindbodygreen-res.cloudinary.com/image/upload/w_480,q_auto,f_auto,fl_lossy/org/echznzk53kksoeqn5.jpg', 'https://www.youtube.com/embed/Me9bHFAxnCs?si=ILNGAVP6fiwp1QfU', 'Weight Loss', 'Chest Beginner'),
(162, 'Chest Stretch', 'A simple warm-up exercise for the chest muscles.', 'Flexibility', 'Core', 'None', 'BEGINNER', '', '', '30 to 60 seconds', 'Stand tall with feet hip-width apart. Interlace your fingers behind your back, palms facing inwards. Straighten your arms and gently lift them behind you, opening up your chest. Keep your shoulders relaxed and down. Hold the stretch for 15-30 seconds, feeling a gentle stretch across your chest and shoulders. Avoid arching your back excessively. Release the stretch and repeat as needed.', 'https://insyncphysio.com/wp-content/uploads/2018/10/Behind-Back-Neck-Stretch.jpg', 'https://www.youtube.com/embed/ESviEdZSfII?si=0z63AD1H-ZVEGEB4', 'Maintain Weight', 'Chest Beginner'),
(163, 'Incline Push-Ups', 'Incline push-ups are a modified version of traditional push-ups performed with hands elevated on a surface, such as a bench or step. This variation reduces the intensity by placing less weight on the upper body.', 'Strength', 'Core', 'Elevated Surface', 'BEGINNER', '3 to 4 sets', '8 to 12 per set', '10 to 15 minutes', 'Place your hands shoulder-width apart on the elevated surface with arms fully extended. Keep your body in a straight line from head to heels. Lower your chest towards the surface by bending your elbows, keeping them at a 45-degree angle to your body. Stop when your chest is close to the surface, then push back up to the starting position. Keep your core engaged and back straight throughout the movement. Repeat for the desired number of repetitions.', 'https://mindbodygreen-res.cloudinary.com/image/upload/w_480,q_auto,f_auto,fl_lossy/org/echznzk53kksoeqn5.jpg', 'https://www.youtube.com/embed/Me9bHFAxnCs?si=ILNGAVP6fiwp1QfU', 'Weight Loss', 'Shoulder & Back Beginner'),
(164, 'Incline Push-Ups', 'Incline push-ups are a modified version of traditional push-ups performed with hands elevated on a surface, such as a bench or step. This variation reduces the intensity by placing less weight on the upper body.', 'Strength', 'Lower Body', 'Elevated Surface', 'BEGINNER', '3 to 4 sets', '8 to 12 per set', '10 to 15 minutes', 'Place your hands shoulder-width apart on the elevated surface with arms fully extended. Keep your body in a straight line from head to heels. Lower your chest towards the surface by bending your elbows, keeping them at a 45-degree angle to your body. Stop when your chest is close to the surface, then push back up to the starting position. Keep your core engaged and back straight throughout the movement. Repeat for the desired number of repetitions.', 'https://mindbodygreen-res.cloudinary.com/image/upload/w_480,q_auto,f_auto,fl_lossy/org/echznzk53kksoeqn5.jpg', 'https://www.youtube.com/embed/Me9bHFAxnCs?si=ILNGAVP6fiwp1QfU', 'Muscle Gain', 'Shoulder & Back Intermediate'),
(165, 'Wall Push-Ups', 'Wall push-ups are a beginner-friendly variation of the traditional push-up exercise performed against a wall. This variation reduces the intensity by allowing you to control the amount of body weight you push.', 'Strength', 'Upper Body', 'Wall ', 'BEGINNER', '3 to 4 sets', '8 to 12 per set', '10 to 15 minutes', 'Stand facing a wall with your feet shoulder-width apart. Place your palms on the wall at shoulder height and slightly wider than shoulder-width apart. Keep your body in a straight line from head to heels. Lean forward towards the wall, bending your elbows to lower your chest towards the wall. Stop when your chest is close to the wall, then push back to the starting position. Keep your core engaged and back straight throughout the movement. Repeat for the desired number of repetitions.', 'https://melioguide.com/wp-content/uploads/2016/04/wall-pushup-01.jpg', 'https://www.youtube.com/embed/EOf3cGIQpA4?si=udiM49pna8wJLELR', 'Weight Loss', 'Arm Beginner'),
(166, 'Wall Push-Ups', 'Wall push-ups are a beginner-friendly variation of the traditional push-up exercise performed against a wall. This variation reduces the intensity by allowing you to control the amount of body weight you push.', 'Strength', 'Lower Body', 'Wall ', 'BEGINNER', '3 to 4 sets', '8 to 12 per set', '10 to 15 minutes', 'Stand facing a wall with your feet shoulder-width apart. Place your palms on the wall at shoulder height and slightly wider than shoulder-width apart. Keep your body in a straight line from head to heels. Lean forward towards the wall, bending your elbows to lower your chest towards the wall. Stop when your chest is close to the wall, then push back to the starting position. Keep your core engaged and back straight throughout the movement. Repeat for the desired number of repetitions.', 'https://melioguide.com/wp-content/uploads/2016/04/wall-pushup-01.jpg', 'https://www.youtube.com/embed/EOf3cGIQpA4?si=udiM49pna8wJLELR', 'Muscle Gain', ''),
(167, 'Wall Push-Ups', 'Wall push-ups are a beginner-friendly variation of the traditional push-up exercise performed against a wall. This variation reduces the intensity by allowing you to control the amount of body weight you push.', 'Strength', 'Core', 'Wall ', 'BEGINNER', '3 to 4 sets', '8 to 12 per set', '10 to 15 minutes', 'Stand facing a wall with your feet shoulder-width apart. Place your palms on the wall at shoulder height and slightly wider than shoulder-width apart. Keep your body in a straight line from head to heels. Lean forward towards the wall, bending your elbows to lower your chest towards the wall. Stop when your chest is close to the wall, then push back to the starting position. Keep your core engaged and back straight throughout the movement. Repeat for the desired number of repetitions.', 'https://melioguide.com/wp-content/uploads/2016/04/wall-pushup-01.jpg', 'https://www.youtube.com/embed/EOf3cGIQpA4?si=udiM49pna8wJLELR', 'Weight Loss', ''),
(168, 'Triceps Stretch (Left Side)', 'The triceps stretch targets the muscles at the back of the upper arm. This stretch can help improve flexibility and range of motion in the triceps.', 'Flexibility', 'Upper Body', 'None', 'BEGINNER', '', '', '15 to 30 seconds', 'Stand or sit tall with your spine straight. Reach your left arm overhead and bend your elbow, bringing your left hand down towards the center of your upper back. Use your right hand to gently press down on the left elbow, increasing the stretch in the left triceps. Hold the stretch for 15-30 seconds, feeling a gentle pull along the back of your left arm. Repeat on the opposite side if desired.', 'https://i.ytimg.com/vi/zzvDO56B0HE/maxresdefault.jpg', 'https://www.youtube.com/embed/zzvDO56B0HE?si=65J6G3uaaoCPATIe', 'Maintain Weight', 'Arm Beginner'),
(169, 'Triceps Stretch (Right Side)', 'The triceps stretch targets the muscles at the back of the upper arm. This stretch can help improve flexibility and range of motion in the triceps.', 'Flexibility', 'Core', 'None', 'BEGINNER', '', '', '15 to 30 seconds', 'Stand or sit tall with your spine straight. Reach your right arm overhead and bend your elbow, bringing your right hand down towards the center of your upper back. Use your left hand to gently press down on the right elbow, increasing the stretch in the right triceps. Hold the stretch for 15-30 seconds, feeling a gentle pull along the back of your right arm. Repeat on the opposite side if desired.', 'https://i.ytimg.com/vi/zzvDO56B0HE/maxresdefault.jpg', 'https://www.youtube.com/embed/zzvDO56B0HE?si=65J6G3uaaoCPATIe', 'Maintain Weight', 'Arm Intermediate'),
(170, 'Standing Biceps Stretch (Left Si', 'The standing biceps stretch targets the muscles at the front of the upper arm. This stretch helps improve flexibility and range of motion in the biceps.', 'Flexibility', 'Upper Body', 'None', 'BEGINNER', '', '', '15 to 30 seconds', 'Stand tall with your feet shoulder-width apart and your spine straight. Extend your left arm straight out in front of you, palm facing up. Use your right hand to gently pull back on the fingers of your left hand, bending the left wrist backward. You should feel a stretch along the front of your left arm. Hold the stretch for 15-30 seconds, then release. Repeat on the opposite side if desired.', 'https://i.ytimg.com/vi/jw8EXo5h0ec/maxresdefault.jpg', 'https://www.youtube.com/embed/jw8EXo5h0ec?si=SSyAJa5Bx4J4bvxr', 'Maintain Weight', 'Arm Beginner'),
(171, 'Standing Biceps Stretch (Right S', 'The standing biceps stretch targets the muscles at the front of the upper arm. This stretch helps improve flexibility and range of motion in the biceps.', 'Flexibility', 'Core', 'None', 'BEGINNER', '', '', '15 to 30 seconds', 'Stand tall with your feet shoulder-width apart and your spine straight. Extend your right arm straight out in front of you, palm facing up. Use your left hand to gently pull back on the fingers of your right hand, bending the right wrist backward. You should feel a stretch along the front of your right arm. Hold the stretch for 15-30 seconds, then release. Repeat on the opposite side if desired.', 'https://i.ytimg.com/vi/jw8EXo5h0ec/maxresdefault.jpg', 'https://www.youtube.com/embed/jw8EXo5h0ec?si=SSyAJa5Bx4J4bvxr', 'Maintain Weight', 'Arm Beginner'),
(172, 'Diamond Push-Ups', 'Diamond push-ups are a variation of the traditional push-up exercise where the hands are placed close together in a diamond shape beneath the chest. This variation targets the triceps and chest muscles more intensely.', 'Strength', 'Upper Body', 'None', 'BEGINNER', '3 To 4 sets', '8 to 12 per set', '10 to 15 minutes', 'Start in a high plank position with hands close together, thumbs and index fingers forming a diamond shape on the floor. Keep your body in a straight line from head to heels. Lower your chest towards the ground by bending your elbows while keeping them close to your sides. Lower until your chest nearly touches your hands. Push back up to the starting position, fully extending your arms. Keep your core engaged throughout the movement. Repeat for the desired number of repetitions.', 'https://i.ytimg.com/vi/jaxbEHLC4qU/maxresdefault.jpg', 'https://www.youtube.com/embed/jaxbEHLC4qU?si=MTwCDigyq0VF8spn', 'Weight Loss', 'Arm Beginner'),
(173, 'Diamond Push-Ups', 'Diamond push-ups are a variation of the traditional push-up exercise where the hands are placed close together in a diamond shape beneath the chest. This variation targets the triceps and chest muscles more intensely.', 'Strength', 'Lower Body', 'None', 'BEGINNER', '3 To 4 sets', '8 to 12 per set', '10 to 15 minutes', 'Start in a high plank position with hands close together, thumbs and index fingers forming a diamond shape on the floor. Keep your body in a straight line from head to heels. Lower your chest towards the ground by bending your elbows while keeping them close to your sides. Lower until your chest nearly touches your hands. Push back up to the starting position, fully extending your arms. Keep your core engaged throughout the movement. Repeat for the desired number of repetitions.', 'https://i.ytimg.com/vi/jaxbEHLC4qU/maxresdefault.jpg', 'https://www.youtube.com/embed/jaxbEHLC4qU?si=MTwCDigyq0VF8spn', 'Muscle Gain', 'Arm Beginner'),
(174, 'Kickboxing', 'Kickboxing is a high-intensity workout that combines elements of boxing, martial arts, and cardiovascular exercises. It involves punching, kicking, knee strikes, and elbow strikes performed in combination with aerobic movements to improve cardiovascular fitness, muscle strength, endurance, and coordination.', 'Cardiovascular', 'Cardio', 'Boxing Gloves, Punching Bag or Partner', 'ADVANCE', '', '', '30 to 60 minutes per session', 'Start with a dynamic warm-up to prepare your body for the workout, including jogging in place, jumping jacks, arm circles, and leg swings. Begin the kickboxing workout with basic punches and kicks, such as jabs, crosses, front kicks, and roundhouse kicks, focusing on proper technique and form. Gradually increase the intensity and speed of your movements as you become more comfortable with the techniques. Incorporate combinations of punches and kicks, as well as defensive moves such as blocks and evasions, to simulate a real kickboxing match. Use a punching bag or focus pads for striking practice, or partner up with a training buddy for pad work and sparring drills. Cool down with static stretches to improve flexibility and prevent muscle soreness.', 'https://i.ytimg.com/vi/4fao_RUnPXk/maxresdefault.jpg', 'https://www.youtube.com/embed/4fao_RUnPXk?si=k3w9uFox6kD7JS2R', 'Weight Loss', ''),
(175, 'Diamond Push-Ups', 'Diamond push-ups are a variation of the traditional push-up exercise where the hands are placed close together in a diamond shape beneath the chest. This variation targets the triceps and chest muscles more intensely.', 'Strength', 'Core', 'None', 'BEGINNER', '3 To 4 sets', '8 to 12 per set', '10 to 15 minutes', 'Start in a high plank position with hands close together, thumbs and index fingers forming a diamond shape on the floor. Keep your body in a straight line from head to heels. Lower your chest towards the ground by bending your elbows while keeping them close to your sides. Lower until your chest nearly touches your hands. Push back up to the starting position, fully extending your arms. Keep your core engaged throughout the movement. Repeat for the desired number of repetitions.', 'https://i.ytimg.com/vi/jaxbEHLC4qU/maxresdefault.jpg', 'https://www.youtube.com/embed/jaxbEHLC4qU?si=MTwCDigyq0VF8spn', 'Muscle Gain', 'Arm Beginner'),
(176, 'Chest Press Pulse', 'The chest press pulse is a variation of the traditional chest press exercise that involves pulsing movements at the bottom or top of the range of motion. This variation increases time under tension in the chest muscles.', 'Strength', 'Upper Body', 'Dumbells ', 'BEGINNER', '3 To 4 sets', '8 to 12 per set', '10 to 15 minutes', 'Lie on a bench or stability ball with a dumbbell in each hand, positioned at chest level. Press the dumbbells upward until your arms are fully extended, palms facing away from you. Lower the dumbbells down towards your chest, but instead of fully extending your arms, perform small pulses at the bottom of the movement (a few inches above your chest). Pulse for 10-15 repetitions before fully extending your arms again. Keep your core engaged and back flat throughout the movement. Repeat for the desired number of sets and reps.', 'https://i.ytimg.com/vi/6ULGD08jR5M/maxresdefault.jpg', 'https://www.youtube.com/embed/MvygTd9ki38?si=0uZj3wPrNp98M34x', 'Muscle Gain', 'Arm Advanced'),
(177, 'Chest Press Pulse', 'The chest press pulse is a variation of the traditional chest press exercise that involves pulsing movements at the bottom or top of the range of motion. This variation increases time under tension in the chest muscles.', 'Strength', 'Core', 'Dumbells ', 'BEGINNER', '3 To 4 sets', '8 to 12 per set', '10 to 15 minutes', 'Lie on a bench or stability ball with a dumbbell in each hand, positioned at chest level. Press the dumbbells upward until your arms are fully extended, palms facing away from you. Lower the dumbbells down towards your chest, but instead of fully extending your arms, perform small pulses at the bottom of the movement (a few inches above your chest). Pulse for 10-15 repetitions before fully extending your arms again. Keep your core engaged and back flat throughout the movement. Repeat for the desired number of sets and reps.', 'https://i.ytimg.com/vi/6ULGD08jR5M/maxresdefault.jpg', 'https://www.youtube.com/embed/MvygTd9ki38?si=0uZj3wPrNp98M34x', 'Maintain Weight', 'Arm Beginner'),
(178, 'Chest Press Pulse', 'The chest press pulse is a variation of the traditional chest press exercise that involves pulsing movements at the bottom or top of the range of motion. This variation increases time under tension in the chest muscles.', 'Strength', 'Lower Body', 'Dumbells ', 'BEGINNER', '3 To 4 sets', '8 to 12 per set', '10 to 15 minutes', 'Lie on a bench or stability ball with a dumbbell in each hand, positioned at chest level. Press the dumbbells upward until your arms are fully extended, palms facing away from you. Lower the dumbbells down towards your chest, but instead of fully extending your arms, perform small pulses at the bottom of the movement (a few inches above your chest). Pulse for 10-15 repetitions before fully extending your arms again. Keep your core engaged and back flat throughout the movement. Repeat for the desired number of sets and reps.', 'https://i.ytimg.com/vi/6ULGD08jR5M/maxresdefault.jpg', 'https://www.youtube.com/embed/MvygTd9ki38?si=0uZj3wPrNp98M34x', 'Muscle Gain', 'Arm Intermediate'),
(179, 'Leg Barbell Curl (Left Side)', 'The Leg Barbell Curl exercise targets the hamstrings and glutes. This variation involves lying face down on a bench or mat and curling both legs simultaneously', 'Strength', 'Legs', 'None', 'BEGINNER', '3 To 4 sets', '8 to 12 per set', '10 to 15 minutes', 'Lie face down on a bench or mat with your legs extended. Flex your left knee to bring your left heel towards your glutes, contracting your left hamstring. Hold the contraction briefly, then slowly lower your left leg back to the starting position. Repeat for the desired number of repetitions.', 'https://i.ytimg.com/vi/3kZS8HVFquk/maxresdefault.jpg', 'https://www.youtube.com/embed/3kZS8HVFquk?si=XQjZZzGx7LMXMt7a', 'Muscle Gain', 'Arm Intermediate'),
(180, 'Leg Barbell Curl (Left Side)', 'The Leg Barbell Curl exercise targets the hamstrings and glutes. This variation involves lying face down on a bench or mat and curling both legs simultaneously', 'Strength', 'Lower Body', 'None', 'BEGINNER', '3 To 4 sets', '8 to 12 per set', '10 to 15 minutes', 'Lie face down on a bench or mat with your legs extended. Flex your left knee to bring your left heel towards your glutes, contracting your left hamstring. Hold the contraction briefly, then slowly lower your left leg back to the starting position. Repeat for the desired number of repetitions.', 'https://i.ytimg.com/vi/3kZS8HVFquk/maxresdefault.jpg', 'https://www.youtube.com/embed/3kZS8HVFquk?si=XQjZZzGx7LMXMt7a', 'Maintain Weight', 'Arm Beginner'),
(181, 'Leg Barbell Curl (Right Leg)', 'The Leg Barbell Curl exercise targets the right hamstring and glute muscles.', 'Strength', 'Core', 'None', 'BEGINNER', '3 To 4 sets', '8 to 12 per set', '10 to 15 minutes', 'Lie face down on a bench or mat with your legs extended. Flex your right knee to bring your right heel towards your glutes, contracting your right hamstring. Hold the contraction briefly, then slowly lower your right leg back to the starting position. Repeat for the desired number of repetitions.', 'https://i.ytimg.com/vi/3kZS8HVFquk/maxresdefault.jpg', 'https://www.youtube.com/embed/3kZS8HVFquk?si=XQjZZzGx7LMXMt7a', 'Muscle Gain', 'Arm Intermediate'),
(182, 'Agility Ladder Drills', 'Agility ladder drills are a series of exercises performed using a ladder-shaped agility ladder to improve footwork, coordination, agility, and speed. These drills involve various movements such as side steps, high knees, shuffles, and hops, performed while stepping in and out of the ladder rungs in a specific pattern.', 'Cardiovascular', 'Cardio', 'Agility Ladder', 'BEGINNER', '', '', '10 to 20 minutes per session', 'Lay the agility ladder flat on the ground in a clear space. Stand at one end of the ladder with your feet together and your arms relaxed by your sides. Begin with a light warm-up to prepare your muscles and joints for the drills. Start with basic drills such as forward runs, lateral shuffles, and high knees, gradually increasing the intensity and complexity as you become more proficient. Focus on maintaining proper form, staying light on your feet, and moving quickly and efficiently through the ladder rungs. Keep your eyes forward and your core engaged to stabilize your body. Perform each drill for 20-30 seconds, then rest for 10-20 seconds before moving on to the next drill. Repeat for several rounds or until you complete the desired duration of the workout.', 'https://i.ytimg.com/vi/7NeGJABh_yM/maxresdefault.jpg', 'https://www.youtube.com/embed/4WJhhSJCg9Q?si=qQc1Oc6CdjLWilC4', 'Weight Loss', ''),
(183, 'Diagonal Plank', 'The diagonal plank is a variation of the traditional plank exercise that engages the core, shoulders, and obliques. This variation involves lifting one arm and the opposite leg diagonally from the body while maintaining a plank position.', 'Core', 'Core', 'None', 'BEGINNER', '3 To 4 sets', '8 to 12 per set', '10 to 15 minutes', 'Start in a plank position with your forearms on the ground and your body in a straight line from head to heels. Engage your core and keep your hips level. Lift your right arm and left leg diagonally away from your body, reaching them towards opposite corners of the room. Hold for a few seconds, then return to the starting position. Repeat on the opposite side, lifting your left arm and right leg diagonally. Continue alternating sides for the desired number of repetitions.', 'https://i.ytimg.com/vi/OGfFtF-dhrk/maxresdefault.jpg', 'https://www.youtube.com/embed/OGfFtF-dhrk?si=-dbzb3gF25zI6JUl', 'Muscle Gain', 'Arm Beginner');
INSERT INTO `exercises` (`ExerciseID`, `ExerciseName`, `Description`, `CategoryID`, `PartOfBody`, `EquipmentID`, `Difficulty`, `set`, `reps`, `duration`, `Instructions`, `ImageURL`, `VideoURL`, `Goal`, `Workoutset`) VALUES
(184, 'Diagonal Plank', 'The diagonal plank is a variation of the traditional plank exercise that engages the core, shoulders, and obliques. This variation involves lifting one arm and the opposite leg diagonally from the body while maintaining a plank position.', 'Core', 'Upper Body', 'None', 'BEGINNER', '3 To 4 sets', '8 to 12 per set', '10 to 15 minutes', 'Start in a plank position with your forearms on the ground and your body in a straight line from head to heels. Engage your core and keep your hips level. Lift your right arm and left leg diagonally away from your body, reaching them towards opposite corners of the room. Hold for a few seconds, then return to the starting position. Repeat on the opposite side, lifting your left arm and right leg diagonally. Continue alternating sides for the desired number of repetitions.', 'https://i.ytimg.com/vi/OGfFtF-dhrk/maxresdefault.jpg', 'https://www.youtube.com/embed/OGfFtF-dhrk?si=-dbzb3gF25zI6JUl', 'Muscle Gain', 'Arm Beginner'),
(185, 'Diagonal Plank', 'The diagonal plank is a variation of the traditional plank exercise that engages the core, shoulders, and obliques. This variation involves lifting one arm and the opposite leg diagonally from the body while maintaining a plank position.', 'Balance', 'Lower Body', 'None', 'BEGINNER', '3 To 4 sets', '8 to 12 per set', '10 to 15 minutes', 'Start in a plank position with your forearms on the ground and your body in a straight line from head to heels. Engage your core and keep your hips level. Lift your right arm and left leg diagonally away from your body, reaching them towards opposite corners of the room. Hold for a few seconds, then return to the starting position. Repeat on the opposite side, lifting your left arm and right leg diagonally. Continue alternating sides for the desired number of repetitions.', 'https://i.ytimg.com/vi/OGfFtF-dhrk/maxresdefault.jpg', 'https://www.youtube.com/embed/OGfFtF-dhrk?si=-dbzb3gF25zI6JUl', 'Muscle Gain', 'Arm Beginner'),
(186, 'Side Hop', 'Side hops are a plyometric exercise that targets the lower body, including the quadriceps, hamstrings, glutes, and calves. This dynamic movement also improves agility, coordination, and cardiovascular fitness.', 'Cardiovascular', 'Cardio', 'None', 'BEGINNER', '3 To 4 sets', '20 to 30 seconds ', '10 to 15 minutes', 'tart by standing with your feet together and arms at your sides. Bend your knees slightly and jump to the right, landing softly on your right foot with a slight bend in the knee. Immediately jump back to the left, landing softly on your left foot. Continue hopping from side to side in a rhythmic motion, keeping your movements controlled and your core engaged. Aim to land softly and maintain your balance throughout the exercise. Perform for 20-30 seconds (or as many reps as possible) before resting.', 'https://i.ytimg.com/vi/nYmUEJIBj3c/maxresdefault.jpg', 'https://www.youtube.com/embed/nYmUEJIBj3c?si=MPSn_-OYYoJah4Nk', 'Weight Loss', 'Leg Beginner'),
(187, 'Side Hop', 'Side hops are a plyometric exercise that targets the lower body, including the quadriceps, hamstrings, glutes, and calves. This dynamic movement also improves agility, coordination, and cardiovascular fitness.', 'Cardiovascular', 'Legs', 'None', 'BEGINNER', '3 To 4 sets', '20 to 30 seconds ', '10 to 15 minutes', 'tart by standing with your feet together and arms at your sides. Bend your knees slightly and jump to the right, landing softly on your right foot with a slight bend in the knee. Immediately jump back to the left, landing softly on your left foot. Continue hopping from side to side in a rhythmic motion, keeping your movements controlled and your core engaged. Aim to land softly and maintain your balance throughout the exercise. Perform for 20-30 seconds (or as many reps as possible) before resting.', 'https://i.ytimg.com/vi/nYmUEJIBj3c/maxresdefault.jpg', 'https://www.youtube.com/embed/nYmUEJIBj3c?si=MPSn_-OYYoJah4Nk', 'Weight Loss', 'Leg Beginner'),
(188, 'Side Hop', 'Side hops are a plyometric exercise that targets the lower body, including the quadriceps, hamstrings, glutes, and calves. This dynamic movement also improves agility, coordination, and cardiovascular fitness.', 'Cardiovascular', 'Lower Body', 'None', 'BEGINNER', '3 To 4 sets', '20 to 30 seconds ', '10 to 15 minutes', 'tart by standing with your feet together and arms at your sides. Bend your knees slightly and jump to the right, landing softly on your right foot with a slight bend in the knee. Immediately jump back to the left, landing softly on your left foot. Continue hopping from side to side in a rhythmic motion, keeping your movements controlled and your core engaged. Aim to land softly and maintain your balance throughout the exercise. Perform for 20-30 seconds (or as many reps as possible) before resting.', 'https://i.ytimg.com/vi/nYmUEJIBj3c/maxresdefault.jpg', 'https://www.youtube.com/embed/nYmUEJIBj3c?si=MPSn_-OYYoJah4Nk', 'Weight Loss', 'Leg Beginner'),
(189, 'Squat', 'Squats are a fundamental compound exercise that targets the lower body muscles, including the quadriceps, hamstrings, glutes, and calves. This versatile movement also engages the core and stabilizing muscles, making it an excellent choice for building overall lower body strength and functional fitness.', 'Strength', 'Legs', 'None', 'BEGINNER', '3 To 4 sets', '8 to 12 per set', '10 to 15 minutes', 'Stand with your feet shoulder-width apart, toes pointing slightly outward. Keep your chest up, shoulders back, and core engaged throughout the movement. Lower your body by bending your knees and pushing your hips back as if you\'re sitting back into a chair. Keep your weight on your heels and lower yourself until your thighs are parallel to the ground, or as low as comfortable while maintaining proper form. Ensure your knees stay in line with your toes and do not extend beyond your toes. Push through your heels to return to the starting position, squeezing your glutes at the top of the movement. Repeat for the desired number of repetitions.', 'https://www.villagegym.co.uk/media/3458/squat-jumps-960x540.jpg', 'https://www.youtube.com/embed/42bFodPahBU?si=UD1fUaAJk65xSYtf', 'Weight Loss', 'Leg Intermediate'),
(190, 'Squat', 'Squats are a fundamental compound exercise that targets the lower body muscles, including the quadriceps, hamstrings, glutes, and calves. This versatile movement also engages the core and stabilizing muscles, making it an excellent choice for building overall lower body strength and functional fitness.', 'Strength', 'Lower Body', 'None', 'BEGINNER', '3 To 4 sets', '8 to 12 per set', '10 to 15 minutes', 'Stand with your feet shoulder-width apart, toes pointing slightly outward. Keep your chest up, shoulders back, and core engaged throughout the movement. Lower your body by bending your knees and pushing your hips back as if you\'re sitting back into a chair. Keep your weight on your heels and lower yourself until your thighs are parallel to the ground, or as low as comfortable while maintaining proper form. Ensure your knees stay in line with your toes and do not extend beyond your toes. Push through your heels to return to the starting position, squeezing your glutes at the top of the movement. Repeat for the desired number of repetitions.', 'https://www.villagegym.co.uk/media/3458/squat-jumps-960x540.jpg', 'https://www.youtube.com/embed/42bFodPahBU?si=UD1fUaAJk65xSYtf', 'Muscle Gain', 'Leg Advanced'),
(191, 'Squat', 'Squats are a fundamental compound exercise that targets the lower body muscles, including the quadriceps, hamstrings, glutes, and calves. This versatile movement also engages the core and stabilizing muscles, making it an excellent choice for building overall lower body strength and functional fitness.', 'Strength', 'Core', 'None', 'BEGINNER', '3 To 4 sets', '8 to 12 per set', '10 to 15 minutes', 'Stand with your feet shoulder-width apart, toes pointing slightly outward. Keep your chest up, shoulders back, and core engaged throughout the movement. Lower your body by bending your knees and pushing your hips back as if you\'re sitting back into a chair. Keep your weight on your heels and lower yourself until your thighs are parallel to the ground, or as low as comfortable while maintaining proper form. Ensure your knees stay in line with your toes and do not extend beyond your toes. Push through your heels to return to the starting position, squeezing your glutes at the top of the movement. Repeat for the desired number of repetitions.', 'https://www.villagegym.co.uk/media/3458/squat-jumps-960x540.jpg', 'https://www.youtube.com/embed/42bFodPahBU?si=UD1fUaAJk65xSYtf', 'Weight Loss', 'Leg Beginner'),
(192, 'Side Lying Leg Lift (Left Side)', 'The side lying leg lift targets the abductor muscles of the hip, primarily the gluteus medius and minimus. This exercise helps to strengthen the muscles on the side of the hip, improving hip stability and preventing injuries.', 'Strength', 'Legs', 'None', 'BEGINNER', '3 To 4 sets', '10 to 15 reps', '10 to 15 minutes', 'Lie on your left side with your legs extended and stacked on top of each other. Rest your head on your left arm or use a pillow for support. Engage your core muscles to stabilize your torso. Lift your right leg upward as high as you comfortably can while keeping it straight. Pause briefly at the top of the movement, then lower your right leg back down to the starting position with control. Avoid rolling your hips backward or forward during the movement. Repeat for the desired number of repetitions.', 'https://i.ytimg.com/vi/jgh6sGwtTwk/maxresdefault.jpg', 'https://www.youtube.com/embed/jgh6sGwtTwk?si=wrxZwMJgisZ4JL3m', 'Muscle Gain', 'Shoulder & Back Beginner'),
(193, 'Side Lying Leg Lift (Right Side)', 'The side lying leg lift targets the abductor muscles of the hip, primarily the gluteus medius and minimus. This exercise helps to strengthen the muscles on the side of the hip, improving hip stability and preventing injuries.', 'Strength', 'Lower Body', 'None', 'BEGINNER', '3 To 4 sets', '10 to 15 reps', '10 to 15 minutes', 'Lie on your right side with your legs extended and stacked on top of each other. Rest your head on your right arm or use a pillow for support. Engage your core muscles to stabilize your torso. Lift your left leg upward as high as you comfortably can while keeping it straight. Pause briefly at the top of the movement, then lower your left leg back down to the starting position with control. Avoid rolling your hips backward or forward during the movement. Repeat for the desired number of repetitions.', 'https://i.ytimg.com/vi/jgh6sGwtTwk/maxresdefault.jpg', 'https://www.youtube.com/embed/jgh6sGwtTwk?si=wrxZwMJgisZ4JL3m', 'Muscle Gain', 'Leg Beginner'),
(194, 'Backward Lunge', 'The backward lunge is a lower body exercise that targets the quadriceps, hamstrings, glutes, and calves. This dynamic movement also engages the core for stability and balance.', 'Strength', 'Lower Body', 'None', 'BEGINNER', '3 To 4 sets', '8 to 12 per leg', '10 to 15 minutes', 'Stand tall with your feet hip-width apart and your hands on your hips or by your sides. Take a step backward with your right foot, landing on the ball of your right foot and bending both knees to lower your body towards the ground. Lower yourself until your left thigh is parallel to the ground or your left knee forms a 90-degree angle. Keep your torso upright, chest lifted, and shoulders back throughout the movement. Push through your left heel to return to the starting position. Repeat the movement on the opposite leg. Alternate legs for the desired number of repetitions.', 'https://i.ytimg.com/vi/_LGpDtENZ5U/maxresdefault.jpg', 'https://www.youtube.com/embed/_LGpDtENZ5U?si=kfROXb58Guc7vZQP', 'Weight Loss', 'Leg Beginner'),
(195, 'Donkey Kicks (Left Side)', 'Donkey kicks target the glutes and hamstrings, helping to strengthen and tone the muscles of the posterior chain. This exercise also engages the core for stability.', 'Strength', 'Legs', 'None', 'BEGINNER', '3 To 4 sets', '10 to 15 reps', '10-15 minutes', 'Start on your hands and knees in a tabletop position, with your wrists aligned under your shoulders and your knees under your hips. Engage your core to stabilize your spine. Keeping your left knee bent at a 90-degree angle, flex your left foot and lift your left heel towards the ceiling, driving the sole of your foot towards the sky. Squeeze your left glute at the top of the movement. Lower your left leg back down to the starting position with control. Repeat for the desired number of repetitions on the left side.', 'https://bod-blog-assets.prod.cd.beachbodyondemand.com/bod-blog/wp-content/uploads/2022/08/01205324/donkey-kicks-600-straight-leg.png', 'https://www.youtube.com/embed/SJ1Xuz9D-ZQ?si=Ew3LJ3yTVgjKyKLS', 'Muscle Gain', 'Leg Beginner'),
(196, 'Donkey Kicks (Right Side)', 'Donkey kicks target the glutes and hamstrings, helping to strengthen and tone the muscles of the posterior chain. This exercise also engages the core for stability.', 'Strength', 'Lower Body', 'None', 'BEGINNER', '3 To 4 sets', '10 to 15 reps', '10-15 minutes', 'Start on your hands and knees in a tabletop position, with your wrists aligned under your shoulders and your knees under your hips. Engage your core to stabilize your spine. Keeping your right knee bent at a 90-degree angle, flex your right foot and lift your right heel towards the ceiling, driving the sole of your foot towards the sky. Squeeze your right glute at the top of the movement. Lower your right leg back down to the starting position with control. Repeat for the desired number of repetitions on the right side.', 'https://bod-blog-assets.prod.cd.beachbodyondemand.com/bod-blog/wp-content/uploads/2022/08/01205324/donkey-kicks-600-straight-leg.png', 'https://www.youtube.com/embed/SJ1Xuz9D-ZQ?si=Ew3LJ3yTVgjKyKLS', 'Muscle Gain', 'Leg Beginner'),
(197, 'Left Quad Stretch with Wall', 'The left quad stretch with a wall targets the quadriceps muscles, aiding in flexibility and mobility. This stretch can help alleviate tightness in the front of the thigh.', 'Flexibility', 'Upper Body', 'Wall ', 'BEGINNER', '1 to 2 per side', '20 to 30 seconds ', '5 to 10 minutes', 'Stand facing a wall, with your feet hip-width apart. Place your left hand on the wall for support. Bend your left knee and bring your left foot towards your glutes. Reach back with your right hand and grasp your left ankle or foot. Gently pull your left foot towards your glutes until you feel a stretch along the front of your left thigh. Keep your torso upright and avoid arching your lower back excessively. Hold the stretch for 20-30 seconds, then release and switch sides.', 'https://i.ytimg.com/vi/TfcRyYf7WLg/maxresdefault.jpg', 'https://www.youtube.com/embed/TfcRyYf7WLg?si=XDx4BN880JRA-wpf', 'Maintain Weight', 'Leg Beginner'),
(198, 'Right Quad Stretch with Wall', 'The right quad stretch with a wall targets the quadriceps muscles, aiding in flexibility and mobility. This stretch can help alleviate tightness in the front of the thigh.', 'Flexibility', 'Core', 'Wall ', 'BEGINNER', '1 to 2 per side', '20 to 30 seconds ', '5 to 10 minutes', 'Stand facing a wall, with your feet hip-width apart. Place your right hand on the wall for support. Bend your right knee and bring your right foot towards your glutes. Reach back with your left hand and grasp your right ankle or foot. Gently pull your right foot towards your glutes until you feel a stretch along the front of your right thigh. Keep your torso upright and avoid arching your lower back excessively. Hold the stretch for 20-30 seconds, then release and switch sides.', 'https://i.ytimg.com/vi/TfcRyYf7WLg/maxresdefault.jpg', 'https://www.youtube.com/embed/TfcRyYf7WLg?si=XDx4BN880JRA-wpf', 'Maintain Weight', 'Leg Beginner'),
(199, 'Knee to Chest Stretch (Left Side', 'The knee to chest stretch targets the lower back, glutes, and hips, helping to relieve tension and improve flexibility in these areas.', 'Flexibility', 'Core', 'None', 'BEGINNER', '1 to 2 per side', '20 to 30 seconds ', '5 to 10 minutes', 'Lie on your back with your legs extended and your arms by your sides. Bend your left knee and bring it towards your chest. Interlace your fingers around your left shin or knee and gently pull your left knee towards your chest until you feel a stretch in your left glute and lower back. Keep your right leg extended or bend it slightly if more comfortable. Hold the stretch for 20-30 seconds, breathing deeply and relaxing into the stretch. Release and switch sides.', 'https://i.ytimg.com/vi/7xy99ZgARVA/maxresdefault.jpg', 'https://www.youtube.com/embed/7xy99ZgARVA?si=FU7DeVTqGAaHnGl', 'Maintain Weight', 'Leg Beginner'),
(200, 'Knee to Chest Stretch (Right Sid', 'The knee to chest stretch targets the lower back, glutes, and hips, helping to relieve tension and improve flexibility in these areas.', 'Flexibility', 'Lower Body', 'None', 'BEGINNER', '1 to 2 per side', '20 to 30 seconds ', '5 to 10 minutes', 'Lie on your back with your legs extended and your arms by your sides. Bend your right knee and bring it towards your chest. Interlace your fingers around your right shin or knee and gently pull your right knee towards your chest until you feel a stretch in your right glute and lower back. Keep your left leg extended or bend it slightly if more comfortable. Hold the stretch for 20-30 seconds, breathing deeply and relaxing into the stretch. Release and switch sides.', 'https://i.ytimg.com/vi/7xy99ZgARVA/maxresdefault.jpg', 'https://www.youtube.com/embed/7xy99ZgARVA?si=FU7DeVTqGAaHnGl', 'Maintain Weight', 'Leg Beginner'),
(201, 'Wall Calf Raises', 'Wall calf raises are a simple yet effective exercise for targeting the calf muscles. This exercise helps strengthen the calves and improve ankle stability and balance.', 'Strength', 'Legs', 'Wall ', 'BEGINNER', '3 to 4 sets', '12 to 15 reps', '10 to 15 minutes', 'Stand facing a wall with your hands resting against the wall at shoulder height for support. Place your feet hip-width apart and flat on the ground. Keeping your core engaged and your back straight, lift your heels off the ground as high as you can, rising onto the balls of your feet. Hold the raised position for a moment, then lower your heels back down to the starting position. Control the movement and avoid bouncing at the bottom. Repeat for the desired number of repetitions.', 'https://i.ytimg.com/vi/GQa_N7wft7M/maxresdefault.jpg', 'https://www.youtube.com/embed/GQa_N7wft7M?si=GyMLJZqBGJIzvaR0', 'Muscle Gain', 'Leg Beginner'),
(202, 'Sumo Squat Raises with Wall', 'Sumo squat raises with a wall target the quadriceps, hamstrings, glutes, and calves. This exercise also engages the core muscles for stability and balance. The wall provides support and helps maintain proper form throughout the movement.', 'Strength', 'Lower Body', 'Wall ', 'BEGINNER', '3 to 4 sets', '12 to 15 reps', '10 to 15 minutes', 'Stand with your back against a wall and your feet wider than shoulder-width apart, toes pointed slightly outward. Rest your hands on your hips or by your sides for balance. Lower your body into a sumo squat position by bending your knees and pushing your hips back, keeping your back flat against the wall. Ensure your knees track in line with your toes and do not extend past your toes. Press through your heels to return to the starting position, simultaneously raising your heels off the ground to come onto the balls of your feet. Hold the raised position for a moment, then lower your heels back down as you descend into the next squat. Repeat for the desired number of repetitions.', 'https://i.ytimg.com/vi/Hcy81KUTIZ8/maxresdefault.jpg', 'https://www.youtube.com/embed/Hcy81KUTIZ8?si=-Q3iJVyP-elGflYa', 'Muscle Gain', 'Leg Beginner'),
(203, 'Calf Stretch (Left Side)', 'The calf stretch targets the calf muscles, specifically the gastrocnemius and soleus. This stretch helps improve flexibility and range of motion in the calf muscles.', 'Flexibility', 'Legs', 'None', 'BEGINNER', '1 to 2 per side', '20 to 30 seconds ', '5 to 10 minutes', 'Begin by standing facing a wall with your left foot positioned a step behind your right foot. Keep both feet flat on the ground and ensure your left heel is in contact with the floor. Lean forward, placing your hands against the wall for support. Keep your left leg straight and your left foot planted, while bending your right knee slightly. You should feel a stretch along the back of your left calf. Hold the stretch for 20-30 seconds, then release. Switch sides to stretch the right calf.', 'https://i.ytimg.com/vi/f1HzSAuB-Vw/maxresdefault.jpg', 'https://www.youtube.com/embed/f1HzSAuB-Vw?si=uArtg1r_u9lJW-uk', 'Maintain Weight', 'Leg Beginner'),
(204, 'Calf Stretch (Right Side)', 'The calf stretch targets the calf muscles, specifically the gastrocnemius and soleus. This stretch helps improve flexibility and range of motion in the calf muscles.', 'Flexibility', 'Lower Body', 'None', 'BEGINNER', '1 to 2 per side', '20 to 30 seconds ', '5 to 10 minutes', 'Begin by standing facing a wall with your right foot positioned a step behind your left foot. Keep both feet flat on the ground and ensure your right heel is in contact with the floor. Lean forward, placing your hands against the wall for support. Keep your right leg straight and your right foot planted, while bending your left knee slightly. You should feel a stretch along the back of your right calf. Hold the stretch for 20-30 seconds, then release. Switch sides to stretch the left calf.', 'https://i.ytimg.com/vi/f1HzSAuB-Vw/maxresdefault.jpg', 'https://www.youtube.com/embed/f1HzSAuB-Vw?si=uArtg1r_u9lJW-uk', 'Maintain Weight', 'Leg Beginner'),
(205, 'Rhomboid Pulls', 'Rhomboid pulls target the rhomboid muscles located between the shoulder blades. This exercise helps improve upper back strength and posture.', 'Strength', 'Upper Body', 'Ressistance Band', 'BEGINNER', '10 to 15 reps', '10 to 15 minutes', '10 to 15 minutes', 'Start by standing tall with your feet hip-width apart and holding the resistance band or handles of the cable machine in front of you with both hands, palms facing inward. Keep your arms extended at shoulder height with a slight bend in your elbows. Retract your shoulder blades and squeeze your shoulder blades together as you pull the band or handles towards your chest. Keep your elbows close to your sides throughout the movement. Pause briefly at the fully contracted position, then slowly return to the starting position with control. Repeat for the desired number of repetitions.', 'https://images.squarespace-cdn.com/content/v1/5f5e8592d2b0854b18af6975/a0e85462-4b3f-422a-81c1-942ee387630d/banded+pull+apart.jpg', 'https://www.youtube.com/embed/DEyDbzSudEU?si=XssMCFNGgBP_-ouL', 'Muscle Gain', 'Shoulder & Back Beginner'),
(206, 'Side Lying Floor Stretch (Left S', 'The side lying floor stretch targets the muscles along the side of the body, including the obliques, lats, and intercostal muscles. This stretch helps improve flexibility and mobility in the torso.', 'Flexibility', 'Lower Body', 'None', 'BEGINNER', '1 to 2 per side', '20 to 30 seconds ', '5 to 10 minutes', 'Lie on your left side with your legs extended and your head supported by your left arm. Bend your knees slightly for stability. Place your right hand on the floor in front of you for support. Keep your hips stacked and your torso aligned. Press through your right hand to gently lift your upper body, allowing your left arm to extend overhead and your torso to arch sideways. You should feel a stretch along the left side of your body. Hold the stretch for 20-30 seconds, breathing deeply and relaxing into the stretch. Repeat on the opposite side.', 'https://i.ytimg.com/vi/DMlSdmsHEeI/maxresdefault.jpg', 'https://www.youtube.com/embed/DMlSdmsHEeI?si=h6Bkggg8maO6-naq', 'Maintain Weight', 'Leg Beginner'),
(207, 'Side Lying Floor Stretch (Right ', 'The side lying floor stretch targets the muscles along the side of the body, including the obliques, lats, and intercostal muscles. This stretch helps improve flexibility and mobility in the torso.', 'Flexibility', 'Core', 'None', 'BEGINNER', '1 to 2 per side', '20 to 30 seconds ', '5 to 10 minutes', 'Lie on your right side with your legs extended and your head supported by your right arm. Bend your knees slightly for stability. Place your left hand on the floor in front of you for support. Keep your hips stacked and your torso aligned. Press through your left hand to gently lift your upper body, allowing your right arm to extend overhead and your torso to arch sideways. You should feel a stretch along the right side of your body. Hold the stretch for 20-30 seconds, breathing deeply and relaxing into the stretch. Repeat on the opposite side.', 'https://i.ytimg.com/vi/DMlSdmsHEeI/maxresdefault.jpg', 'https://www.youtube.com/embed/DMlSdmsHEeI?si=h6Bkggg8maO6-naq', 'Maintain Weight', 'Leg Beginner'),
(208, 'Arm Scissors', 'Arm scissors is a dynamic stretching exercise that targets the shoulder muscles and improves flexibility in the arms and shoulders.', 'Flexibility', 'Upper Body', 'None', 'BEGINNER', '1 to 2 sets 10 to 15 reps', '', '5 to 10 minutes', 'Stand with your feet shoulder-width apart and your arms extended straight out to the sides at shoulder height. Keep your palms facing down. Begin by crossing your right arm over your left arm, bringing your right palm to touch your left palm. Then, quickly uncross your arms and cross your left arm over your right arm, bringing your left palm to touch your right palm. Continue alternating between crossing your arms back and forth in a scissor-like motion, moving quickly but maintaining control. Focus on stretching your arms out as far as comfortable with each movement.', 'https://i.ytimg.com/vi/pFrJQ-MyL10/maxresdefault.jpg', 'https://www.youtube.com/embed/pFrJQ-MyL10?si=bxb6BbnATsU-pGNC', 'Weight Loss', 'Shoulder & Back Beginner'),
(209, 'Arm Scissors', 'Arm scissors is a dynamic stretching exercise that targets the shoulder muscles and improves flexibility in the arms and shoulders.', 'Flexibility', 'Core', 'None', 'BEGINNER', '1 to 2 sets 10 to 15 reps', '', '5 to 10 minutes', 'Stand with your feet shoulder-width apart and your arms extended straight out to the sides at shoulder height. Keep your palms facing down. Begin by crossing your right arm over your left arm, bringing your right palm to touch your left palm. Then, quickly uncross your arms and cross your left arm over your right arm, bringing your left palm to touch your right palm. Continue alternating between crossing your arms back and forth in a scissor-like motion, moving quickly but maintaining control. Focus on stretching your arms out as far as comfortable with each movement.', 'https://i.ytimg.com/vi/pFrJQ-MyL10/maxresdefault.jpg', 'https://www.youtube.com/embed/pFrJQ-MyL10?si=bxb6BbnATsU-pGNC', 'Weight Loss', 'Arm Intermediate'),
(210, 'Cat-Cow Pose', 'The cat-cow pose is a dynamic yoga pose that gently stretches and mobilizes the spine, improving flexibility and relieving tension in the back.', 'Flexibility', 'Upper Body', 'None', 'BEGINNER', '1 to 2 sets 10 to 15 reps', 'Flowing movement', '5 to 10 minutes', 'Start on your hands and knees in a tabletop position, with your wrists aligned under your shoulders and your knees under your hips. Inhale as you arch your back and lift your chest and tailbone towards the ceiling, allowing your belly to sink towards the floor. This is the cow pose. Exhale as you round your back towards the ceiling, tucking your chin towards your chest and drawing your belly button towards your spine. This is the cat pose. Flow smoothly between cow and cat poses, synchronizing your breath with each movement. Repeat for several cycles, moving at a pace that feels comfortable for you.', 'https://www.verywellfit.com/thmb/fs76ElRyXEifvR6wLcdmKS6MEgs=/1500x0/filters:no_upscale():max_bytes(150000):strip_icc()/About-A3-CatCow-019-570d44f83df78c7d9e3c571e.jpg', 'https://www.youtube.com/embed/w_UKcI1Ftn8?si=OXZcpsOpLAuSj1FG', 'Maintain Weight', 'Shoulder & Back Intermediate'),
(211, 'Cat-Cow Pose', 'The cat-cow pose is a dynamic yoga pose that gently stretches and mobilizes the spine, improving flexibility and relieving tension in the back.', 'Flexibility', 'Core', 'None', 'BEGINNER', '1 to 2 sets 10 to 15 reps', 'Flowing movement', '5 to 10 minutes', 'Start on your hands and knees in a tabletop position, with your wrists aligned under your shoulders and your knees under your hips. Inhale as you arch your back and lift your chest and tailbone towards the ceiling, allowing your belly to sink towards the floor. This is the cow pose. Exhale as you round your back towards the ceiling, tucking your chin towards your chest and drawing your belly button towards your spine. This is the cat pose. Flow smoothly between cow and cat poses, synchronizing your breath with each movement. Repeat for several cycles, moving at a pace that feels comfortable for you.', 'https://www.verywellfit.com/thmb/fs76ElRyXEifvR6wLcdmKS6MEgs=/1500x0/filters:no_upscale():max_bytes(150000):strip_icc()/About-A3-CatCow-019-570d44f83df78c7d9e3c571e.jpg', 'https://www.youtube.com/embed/w_UKcI1Ftn8?si=OXZcpsOpLAuSj1FG', 'Maintain Weight', 'Shoulder & Back Beginner'),
(212, 'Prone Triceps Push-Ups', 'Prone triceps push-ups target the triceps muscles, helping to strengthen and tone the back of the arms. This exercise also engages the core muscles for stability.', 'Strength', 'Upper Body', 'None', 'BEGINNER', '3 to 4 sets', '8 to 12 reps', '10 to 15 minutes', 'Start by lying face down on the floor with your hands positioned directly under your shoulders, palms facing down and fingers pointing forward. Engage your core muscles to stabilize your spine. Press through your palms to lift your upper body off the floor, extending your arms fully. Keep your elbows close to your sides and pointing backward as you lower your body towards the floor, bending your elbows. Lower yourself until your chest almost touches the floor, then press back up to the starting position by straightening your arms. Repeat for the desired number of repetitions, focusing on engaging your triceps throughout the movement.', 'https://i.ytimg.com/vi/Rr43jMaoJ9g/maxresdefault.jpg', 'https://www.youtube.com/embed/Rr43jMaoJ9g?si=A97rZM17PRRs4Nmd', 'Weight Loss', 'Shoulder & Back Beginner'),
(213, 'Prone Triceps Push-Ups', 'Prone triceps push-ups target the triceps muscles, helping to strengthen and tone the back of the arms. This exercise also engages the core muscles for stability.', 'Strength', 'Core', 'None', 'BEGINNER', '3 to 4 sets', '8 to 12 reps', '10 to 15 minutes', 'Start by lying face down on the floor with your hands positioned directly under your shoulders, palms facing down and fingers pointing forward. Engage your core muscles to stabilize your spine. Press through your palms to lift your upper body off the floor, extending your arms fully. Keep your elbows close to your sides and pointing backward as you lower your body towards the floor, bending your elbows. Lower yourself until your chest almost touches the floor, then press back up to the starting position by straightening your arms. Repeat for the desired number of repetitions, focusing on engaging your triceps throughout the movement.', 'https://i.ytimg.com/vi/Rr43jMaoJ9g/maxresdefault.jpg', 'https://www.youtube.com/embed/Rr43jMaoJ9g?si=A97rZM17PRRs4Nmd', 'Muscle Gain', 'Shoulder & Back Beginner'),
(214, 'Reclined Rhomboid Squeezes', 'Reclined rhomboid squeezes target the rhomboid muscles located between the shoulder blades. This exercise helps improve upper back strength and posture.', 'Strength', 'Upper Body', 'None', 'BEGINNER', '3 to 4 sets', '10 to 15 reps', '10 to 15 minutes', 'Start by lying on your back on an exercise mat or comfortable surface with your knees bent and feet flat on the floor. Extend your arms straight out to the sides at shoulder height, palms facing down. Engage your core muscles to stabilize your spine. Squeeze your shoulder blades together as you draw your elbows towards your ribcage, aiming to touch your shoulder blades together. Hold the squeeze for a moment, then slowly release and extend your arms back out to the starting position. Repeat for the desired number of repetitions, focusing on maintaining proper form and feeling the contraction in your rhomboid muscles.', 'https://i.ytimg.com/vi/olv2Sv9DwmA/maxresdefault.jpg', 'https://www.youtube.com/embed/olv2Sv9DwmA?si=sEGEHzj83LrvMuw5', 'Muscle Gain', 'Shoulder & Back Beginner'),
(215, 'Child\'s Pose', 'Child\'s Pose, also known as Balasana in yoga, is a relaxing and restorative yoga pose that stretches the spine, hips, thighs, and ankles. It also helps to calm the mind and relieve stress.', 'Flexibility', 'Upper Body', 'None', 'BEGINNER', '1 to 2 sets 10 to 15 reps', '30 to 60 seconds', '5 to 10 minutes', 'Start by kneeling on the floor with your big toes touching and knees apart, slightly wider than hip-width apart. Sit back on your heels, then slowly lower your torso forward, bringing your forehead to rest on the floor in front of your knees. Extend your arms straight out in front of you or alongside your body, palms facing up. Relax your forehead on the mat and allow your entire body to soften into the pose. Breathe deeply and focus on releasing tension with each exhale. Hold the pose for 30-60 seconds or longer, depending on your comfort level.', 'https://i.ytimg.com/vi/DMwRPGMPB10/maxresdefault.jpg', 'https://www.youtube.com/embed/DMwRPGMPB10?si=dJYG_OpJiyxd-7eS', 'Maintain Weight', 'Shoulder & Back Beginner'),
(216, 'Child\'s Pose', 'Child\'s Pose, also known as Balasana in yoga, is a relaxing and restorative yoga pose that stretches the spine, hips, thighs, and ankles. It also helps to calm the mind and relieve stress.', 'Flexibility', 'Legs', 'None', 'BEGINNER', '1 to 2 sets 10 to 15 reps', '30 to 60 seconds', '5 to 10 minutes', 'Start by kneeling on the floor with your big toes touching and knees apart, slightly wider than hip-width apart. Sit back on your heels, then slowly lower your torso forward, bringing your forehead to rest on the floor in front of your knees. Extend your arms straight out in front of you or alongside your body, palms facing up. Relax your forehead on the mat and allow your entire body to soften into the pose. Breathe deeply and focus on releasing tension with each exhale. Hold the pose for 30-60 seconds or longer, depending on your comfort level.', 'https://i.ytimg.com/vi/DMwRPGMPB10/maxresdefault.jpg', 'https://www.youtube.com/embed/DMwRPGMPB10?si=dJYG_OpJiyxd-7eS', 'Maintain Weight', ''),
(217, 'Child\'s Pose', 'Child\'s Pose, also known as Balasana in yoga, is a relaxing and restorative yoga pose that stretches the spine, hips, thighs, and ankles. It also helps to calm the mind and relieve stress.', 'Flexibility', 'Core', 'None', 'BEGINNER', '1 to 2 sets 10 to 15 reps', '30 to 60 seconds', '5 to 10 minutes', 'Start by kneeling on the floor with your big toes touching and knees apart, slightly wider than hip-width apart. Sit back on your heels, then slowly lower your torso forward, bringing your forehead to rest on the floor in front of your knees. Extend your arms straight out in front of you or alongside your body, palms facing up. Relax your forehead on the mat and allow your entire body to soften into the pose. Breathe deeply and focus on releasing tension with each exhale. Hold the pose for 30-60 seconds or longer, depending on your comfort level.', 'https://i.ytimg.com/vi/DMwRPGMPB10/maxresdefault.jpg', 'https://www.youtube.com/embed/DMwRPGMPB10?si=dJYG_OpJiyxd-7eS', 'Maintain Weight', ''),
(218, 'Side Bridges (Left)', 'Side bridges are a core-strengthening exercise that primarily targets the muscles of the obliques, hips, and shoulders. This variation is performed on the left side of the body.', 'Core', 'Legs', 'None', 'ADVANCE', '2 to 3 sets', '20 to 30 seconds ', '5 to 10 minutes', 'Start by lying on your left side with your legs extended and stacked on top of each other. Prop yourself up on your left elbow directly beneath your shoulder, forearm perpendicular to your body. Engage your core and lift your hips off the ground, creating a straight line from your head to your heels. Keep your body in a straight line without letting your hips sag or rise too high. Hold the position for 20-30 seconds, breathing deeply and focusing on stability. Lower your hips back down to the starting position with control. Repeat for the desired number of repetitions or hold for the prescribed duration.', 'https://i.ytimg.com/vi/7ytbYd4CK3o/sddefault.jpg', 'https://www.youtube.com/embed/7ytbYd4CK3o?si=v9Gy11XtC2YUaBlW', 'Muscle Gain', 'Abs Intermediate'),
(219, 'Side Bridges (Left)', 'Side bridges are a core-strengthening exercise that primarily targets the muscles of the obliques, hips, and shoulders. This variation is performed on the left side of the body.', 'Strength', 'Core', 'None', 'ADVANCE', '2 to 3 sets', '20 to 30 seconds ', '5 to 10 minutes', 'Start by lying on your left side with your legs extended and stacked on top of each other. Prop yourself up on your left elbow directly beneath your shoulder, forearm perpendicular to your body. Engage your core and lift your hips off the ground, creating a straight line from your head to your heels. Keep your body in a straight line without letting your hips sag or rise too high. Hold the position for 20-30 seconds, breathing deeply and focusing on stability. Lower your hips back down to the starting position with control. Repeat for the desired number of repetitions or hold for the prescribed duration.', 'https://i.ytimg.com/vi/7ytbYd4CK3o/sddefault.jpg', 'https://www.youtube.com/embed/7ytbYd4CK3o?si=v9Gy11XtC2YUaBlW', 'Muscle Gain', 'Abs Advanced'),
(220, 'Side Bridge (Right Side)', 'The side bridge, also known as the side plank, targets the obliques, core muscles, shoulders, and hips. This exercise helps improve core stability, strength, and endurance on the right side of the body.', 'Strength', 'Upper Body', 'None', 'ADVANCE', '2 to 3 sets', '20 to 30 seconds ', '5 to 10 minutes', 'Start by lying on your left side with your legs extended and stacked on top of each other. Prop yourself up on your left elbow directly beneath your shoulder, forearm perpendicular to your body. Engage your core and lift your hips off the ground, creating a straight line from your head to your heels. Keep your body in a straight line without letting your hips sag or rise too high. Hold the position for 20-30 seconds, breathing deeply and focusing on stability. Lower your hips back down to the starting position with control. Repeat for the desired number of repetitions or hold for the prescribed duration.', 'https://i.ytimg.com/vi/7ytbYd4CK3o/sddefault.jpg', 'https://www.youtube.com/embed/7ytbYd4CK3o?si=v9Gy11XtC2YUaBlW', 'Maintain Weight', 'Abs Advanced'),
(221, 'Side Bridge (Right Side)', 'The side bridge, also known as the side plank, targets the obliques, core muscles, shoulders, and hips. This exercise helps improve core stability, strength, and endurance on the right side of the body.', 'Strength', 'Upper Body', 'None', 'ADVANCE', '2 to 3 sets', '20 to 30 seconds ', '5 to 10 minutes', 'Start by lying on your left side with your legs extended and stacked on top of each other. Prop yourself up on your left elbow directly beneath your shoulder, forearm perpendicular to your body. Engage your core and lift your hips off the ground, creating a straight line from your head to your heels. Keep your body in a straight line without letting your hips sag or rise too high. Hold the position for 20-30 seconds, breathing deeply and focusing on stability. Lower your hips back down to the starting position with control. Repeat for the desired number of repetitions or hold for the prescribed duration.', 'https://i.ytimg.com/vi/7ytbYd4CK3o/sddefault.jpg', 'https://www.youtube.com/embed/7ytbYd4CK3o?si=v9Gy11XtC2YUaBlW', 'Maintain Weight', 'Abs Intermediate'),
(222, 'Side Shuffle', 'Side shuffle, also known as lateral shuffle or side-to-side shuffle, is a lateral movement exercise that improves agility, coordination, and lower body strength. It involves shuffling laterally from side to side while maintaining a low stance and quick footwork.', 'Cardiovascular', 'Cardio', 'None', 'INTERMEDIATE', '', '', '20 to 30 minutes', 'Start in an athletic stance with your feet shoulder-width apart and your knees slightly bent. Keep your chest up, shoulders back, and core engaged throughout the exercise. Begin the movement by stepping laterally to one side, leading with your outside foot. Push off forcefully with the outside foot and bring the inside foot in to meet it, shuffling across the floor in a controlled manner. Stay light on your feet and maintain a low stance to maximize agility and speed. Keep your hips square and facing forward throughout the shuffle, avoiding excessive rotation of the torso. Continue shuffling laterally from side to side for the desired duration or distance. Focus on maintaining proper form and a steady rhythm throughout the exercise.', 'https://i.ytimg.com/vi/DwHiXO5ps_I/maxresdefault.jpg', 'https://www.youtube.com/embed/DwHiXO5ps_I?si=8d7YVcqtlgKst8E_', 'Weight Loss', ''),
(223, 'Skaters', 'Skaters, also known as lateral jumps or side-to-side jumps, are a plyometric exercise that targets the lower body and improves agility, balance, and explosive power. It involves jumping laterally from side to side, landing on one foot while swinging the opposite leg behind, mimicking the movement of a speed skater.', 'Cardiovascular', 'Cardio', 'None', 'INTERMEDIATE', '', '', '20 to 30 minutes', 'Start in a standing position with your feet hip-width apart and your knees slightly bent. Keep your chest up, shoulders back, and core engaged throughout the exercise. Begin the movement by jumping laterally to one side, pushing off forcefully with both feet. Land softly on the outside foot, bending the knee to absorb the impact and keeping the opposite leg extended behind you for balance. Swing your arms across your body to help generate momentum and maintain balance. Immediately push off with the outside foot and jump laterally to the opposite side, landing softly on the other foot and swinging the opposite leg behind. Continue alternating sides in a fluid motion, jumping as far and as quickly as possible while maintaining control and balance. Focus on landing softly and absorbing the impact with each jump to reduce stress on the joints.', 'https://i.ytimg.com/vi/4RuxhVJ4-pg/maxresdefault.jpg', 'https://www.youtube.com/embed/4RuxhVJ4-pg?si=Z2wewaPkRcYj5GzD', 'Weight Loss', ''),
(224, 'Bicycle Crunches', 'Bicycle crunches are a dynamic core exercise that targets the rectus abdominis, obliques, and hip flexors. This exercise helps strengthen and tone the abdominal muscles while also engaging the lower body.', 'Core', 'Legs', 'None', 'ADVANCE', '3 to 4 sets', '12 to 15 per side', '5 to 10 minutes', 'Start by lying on your back on an exercise mat with your hands placed lightly behind your head, elbows pointing out to the sides. Lift your legs off the ground and bend your knees to a 90-degree angle, with your calves parallel to the floor. Engage your core muscles to lift your shoulder blades off the mat, bringing your right elbow towards your left knee while simultaneously straightening your right leg and rotating your torso to the left. Then, switch sides by bringing your left elbow towards your right knee while straightening your left leg and rotating your torso to the right. Continue alternating sides in a pedaling motion, keeping your movements controlled and your core engaged throughout.', 'https://i.ytimg.com/vi/-nJkAJpQemI/maxresdefault.jpg', 'https://www.youtube.com/embed/-nJkAJpQemI?si=eeVDxqVGEL8D-OzM', 'Muscle Gain', 'Abs Intermediate'),
(225, 'Bicycle Crunches', 'Bicycle crunches are a dynamic core exercise that targets the rectus abdominis, obliques, and hip flexors. This exercise helps strengthen and tone the abdominal muscles while also engaging the lower body.', 'Core', 'Lower Body', 'None', 'ADVANCE', '3 to 4 sets', '12 to 15 per side', '5 to 10 minutes', 'Start by lying on your back on an exercise mat with your hands placed lightly behind your head, elbows pointing out to the sides. Lift your legs off the ground and bend your knees to a 90-degree angle, with your calves parallel to the floor. Engage your core muscles to lift your shoulder blades off the mat, bringing your right elbow towards your left knee while simultaneously straightening your right leg and rotating your torso to the left. Then, switch sides by bringing your left elbow towards your right knee while straightening your left leg and rotating your torso to the right. Continue alternating sides in a pedaling motion, keeping your movements controlled and your core engaged throughout.', 'https://i.ytimg.com/vi/-nJkAJpQemI/maxresdefault.jpg', 'https://www.youtube.com/embed/-nJkAJpQemI?si=eeVDxqVGEL8D-OzM', 'Muscle Gain', 'Abs Advanced'),
(226, 'Side Plank (Right Side)', 'The side plank is a static core exercise that primarily targets the obliques, but also engages the entire core, shoulders, and hips. This exercise helps improve core strength, stability, and endurance on the right side of the body.', 'Core', 'Upper Body', 'None', 'ADVANCE', '2 to 3 sets', 'Hold for desired duration,', '20 to 30 seconds', 'Start by lying on your right side with your legs extended and stacked on top of each other. Place your right elbow directly beneath your shoulder, forearm perpendicular to your body. Engage your core muscles and lift your hips off the ground, creating a straight line from your head to your heels. Keep your body in a straight line without letting your hips sag or rise too high. Hold the position for 20-30 seconds, or longer if you can maintain proper form. Focus on breathing deeply and maintaining stability throughout the exercise. Lower your hips back down to the starting position with control. Repeat for the desired number of sets.', 'https://i.ytimg.com/vi/2W96p2PIoPg/maxresdefault.jpg', 'https://www.youtube.com/embed/2W96p2PIoPg?si=1gSQopE6spl2yOMD', 'Muscle Gain', ''),
