(229, 'Side Plank (Left Side)', 'The side plank is a static core exercise that primarily targets the obliques, but also engages the entire core, shoulders, and hips. This exercise helps improve core strength, stability, and endurance on the left side of the body.', 'Core', 'Lower Body', 'None', 'ADVANCE', '2 to 3 sets', 'Hold for desired duration,', '20 to 30 seconds', 'tart by lying on your left side with your legs extended and stacked on top of each other. Place your left elbow directly beneath your shoulder, forearm perpendicular to your body. Engage your core muscles and lift your hips off the ground, creating a straight line from your head to your heels. Keep your body in a straight line without letting your hips sag or rise too high. Hold the position for 20-30 seconds, or longer if you can maintain proper form. Focus on breathing deeply and maintaining stability throughout the exercise. Lower your hips back down to the starting position with control. Repeat for the desired number of sets.', 'https://i.ytimg.com/vi/2W96p2PIoPg/maxresdefault.jpg', 'https://www.youtube.com/embed/2W96p2PIoPg?si=1gSQopE6spl2yOMD', 'Muscle Gain', 'Abs Intermediate');
INSERT INTO `exercises` (`ExerciseID`, `ExerciseName`, `Description`, `CategoryID`, `PartOfBody`, `EquipmentID`, `Difficulty`, `set`, `reps`, `duration`, `Instructions`, `ImageURL`, `VideoURL`, `Goal`, `Workoutset`) VALUES
(230, 'V-Up', 'The V-up is a dynamic core exercise that targets the rectus abdominis and hip flexors. This exercise helps strengthen the abdominal muscles and improve overall core stability.', 'Core', 'Legs', 'None', 'ADVANCE', '3 to 4 sets', '10 to 15 reps', '5 to 10 minutes', 'Start by lying on your back on an exercise mat with your legs extended and arms stretched overhead. Engage your core muscles and lift your legs and upper body simultaneously, reaching your hands towards your toes to form a V shape with your body. Keep your legs as straight as possible and avoid bending your knees. Hold the contraction for a moment at the top of the movement, then slowly lower your legs and upper body back down to the starting position with control. Avoid letting your lower back arch off the ground during the exercise. Repeat for the desired number of repetitions, maintaining a controlled motion throughout.', 'https://i.ytimg.com/vi/5kvKmRGADlQ/maxresdefault.jpg', 'https://www.youtube.com/embed/5kvKmRGADlQ?si=BvLWcF9KgO4NacJH', 'Maintain Weight', 'Abs Intermediate'),
(231, 'V-Up', 'The V-up is a dynamic core exercise that targets the rectus abdominis and hip flexors. This exercise helps strengthen the abdominal muscles and improve overall core stability.', 'Core', 'Lower Body', 'None', 'ADVANCE', '3 to 4 sets', '10 to 15 reps', '5 to 10 minutes', 'Start by lying on your back on an exercise mat with your legs extended and arms stretched overhead. Engage your core muscles and lift your legs and upper body simultaneously, reaching your hands towards your toes to form a V shape with your body. Keep your legs as straight as possible and avoid bending your knees. Hold the contraction for a moment at the top of the movement, then slowly lower your legs and upper body back down to the starting position with control. Avoid letting your lower back arch off the ground during the exercise. Repeat for the desired number of repetitions, maintaining a controlled motion throughout.', 'https://i.ytimg.com/vi/5kvKmRGADlQ/maxresdefault.jpg', 'https://www.youtube.com/embed/5kvKmRGADlQ?si=BvLWcF9KgO4NacJH', 'Muscle Gain', 'Abs Advanced'),
(232, 'Push-Up & Rotation', 'The push-up & rotation is a compound exercise that targets the chest, shoulders, triceps, and core muscles. This exercise combines the traditional push-up movement with a rotational component to engage the obliques and increase overall core stability.', 'Strength', 'Upper Body', 'None', 'ADVANCE', '3 to 4 sets', '8 to 12 each side', '5 to 10 minutes', 'Start in a high plank position with your hands slightly wider than shoulder-width apart and your body forming a straight line from head to heels. Perform a push-up by bending your elbows and lowering your chest towards the ground while keeping your core engaged and spine neutral. Press back up to the starting position, then rotate your body to the left side, extending your left arm towards the ceiling and stacking your feet on top of each other. Hold the side plank position for a moment, then return to the high plank position. Repeat the push-up, then rotate to the right side and hold the side plank position. Continue alternating sides with each repetition, focusing on maintaining proper form and control throughout the movement.', 'https://i.ytimg.com/vi/Plv5CIclPtQ/maxresdefault.jpg', 'https://www.youtube.com/embed/Plv5CIclPtQ?si=TN6oUcpiwjdfDwxL', 'Weight Loss', 'Chest Intermediate'),
(233, 'Push-Up & Rotation', 'The push-up & rotation is a compound exercise that targets the chest, shoulders, triceps, and core muscles. This exercise combines the traditional push-up movement with a rotational component to engage the obliques and increase overall core stability.', 'Strength', 'Lower Body', 'None', 'ADVANCE', '3 to 4 sets', '8 to 12 each side', '5 to 10 minutes', 'Start in a high plank position with your hands slightly wider than shoulder-width apart and your body forming a straight line from head to heels. Perform a push-up by bending your elbows and lowering your chest towards the ground while keeping your core engaged and spine neutral. Press back up to the starting position, then rotate your body to the left side, extending your left arm towards the ceiling and stacking your feet on top of each other. Hold the side plank position for a moment, then return to the high plank position. Repeat the push-up, then rotate to the right side and hold the side plank position. Continue alternating sides with each repetition, focusing on maintaining proper form and control throughout the movement.', 'https://i.ytimg.com/vi/Plv5CIclPtQ/maxresdefault.jpg', 'https://www.youtube.com/embed/Plv5CIclPtQ?si=TN6oUcpiwjdfDwxL', 'Muscle Gain', 'Arm Beginner'),
(234, 'Butt Kicks', 'Butt kicks are a dynamic warm-up exercise that targets the muscles of the legs, particularly the quadriceps and hamstrings. This exercise involves bringing the heels up towards the glutes in a rapid and continuous motion, similar to running in place, while focusing on quick footwork and maintaining an upright posture.', 'Cardiovascular', 'Cardio', 'None', 'BEGINNER', '', '', '20 to 30 minutes', 'Start in a standing position with your feet hip-width apart and your arms relaxed by your sides. Engage your core muscles to stabilize your spine and maintain good posture throughout the exercise. Begin the movement by jogging in place, lifting your heels up towards your glutes with each step. Focus on bringing your heels as close to your buttocks as possible while maintaining a brisk and rhythmic pace. Keep your knees pointing downwards and your hips stable throughout the exercise. Swing your arms naturally in coordination with your leg movements to enhance the cardiovascular benefits. Continue to jog in place with butt kicks for the desired duration, breathing steadily and focusing on maintaining a consistent pace.', 'https://i.ytimg.com/vi/vXVPvY1UbJI/sddefault.jpg', 'https://www.youtube.com/embed/vXVPvY1UbJI?si=bo17ta7ybAuaHIwM', 'Weight Loss', ''),
(235, 'Push-Up & Rotation', 'The push-up & rotation is a compound exercise that targets the chest, shoulders, triceps, and core muscles. This exercise combines the traditional push-up movement with a rotational component to engage the obliques and increase overall core stability.', 'Strength', 'Core', 'None', 'ADVANCE', '3 to 4 sets', '8 to 12 each side', '5 to 10 minutes', 'Start in a high plank position with your hands slightly wider than shoulder-width apart and your body forming a straight line from head to heels. Perform a push-up by bending your elbows and lowering your chest towards the ground while keeping your core engaged and spine neutral. Press back up to the starting position, then rotate your body to the left side, extending your left arm towards the ceiling and stacking your feet on top of each other. Hold the side plank position for a moment, then return to the high plank position. Repeat the push-up, then rotate to the right side and hold the side plank position. Continue alternating sides with each repetition, focusing on maintaining proper form and control throughout the movement.', 'https://i.ytimg.com/vi/Plv5CIclPtQ/maxresdefault.jpg', 'https://www.youtube.com/embed/Plv5CIclPtQ?si=TN6oUcpiwjdfDwxL', 'Muscle Gain', 'Abs Advanced'),
(236, 'Butt Bridge', 'The butt bridge, also known as the hip bridge, targets the glutes, hamstrings, and lower back. This exercise helps strengthen the posterior chain and improve hip stability.', 'Strength', 'Legs', 'None', 'ADVANCE', '3 to 4 sets', '12 to 15 reps', '5 to 10 minutes', 'Start by lying on your back on an exercise mat with your knees bent and feet flat on the floor, hip-width apart. Place your arms by your sides with palms facing down. Engage your core muscles and press through your heels to lift your hips towards the ceiling, squeezing your glutes at the top of the movement. Your body should form a straight line from your shoulders to your knees. Avoid arching your lower back excessively. Hold the bridge position for a moment, then slowly lower your hips back down to the starting position with control. Repeat for the desired number of repetitions, focusing on engaging the glutes throughout the movement.', 'https://i.ytimg.com/vi/9qo48CYN06w/mqdefault.jpg', 'https://www.youtube.com/embed/9qo48CYN06w?si=K_Peg16bIUphxveS', 'Maintain Weight', 'Abs Intermediate'),
(237, 'Butt Bridge', 'The butt bridge, also known as the hip bridge, targets the glutes, hamstrings, and lower back. This exercise helps strengthen the posterior chain and improve hip stability.', 'Strength', 'Lower Body', 'None', 'ADVANCE', '3 to 4 sets', '12 to 15 reps', '5 to 10 minutes', 'Start by lying on your back on an exercise mat with your knees bent and feet flat on the floor, hip-width apart. Place your arms by your sides with palms facing down. Engage your core muscles and press through your heels to lift your hips towards the ceiling, squeezing your glutes at the top of the movement. Your body should form a straight line from your shoulders to your knees. Avoid arching your lower back excessively. Hold the bridge position for a moment, then slowly lower your hips back down to the starting position with control. Repeat for the desired number of repetitions, focusing on engaging the glutes throughout the movement.', 'https://i.ytimg.com/vi/9qo48CYN06w/mqdefault.jpg', 'https://www.youtube.com/embed/9qo48CYN06w?si=K_Peg16bIUphxveS', 'Maintain Weight', 'Abs Advanced'),
(238, 'High Knees', 'High knees are a dynamic warm-up exercise that targets the muscles of the lower body, including the quadriceps, hamstrings, and hip flexors. This exercise involves lifting the knees up towards the chest in a rapid and alternating motion while jogging in place, focusing on quick footwork and maintaining an upright posture.', 'Cardiovascular', 'Cardio', 'None', 'BEGINNER', '', '', '20 to 30 minutes', 'Start in a standing position with your feet hip-width apart and your arms relaxed by your sides. Engage your core muscles to stabilize your spine and maintain good posture throughout the exercise. Begin the movement by jogging in place, lifting your knees up towards your chest with each step. Focus on bringing your knees as high as possible while maintaining a brisk and rhythmic pace. Keep your torso upright and avoid leaning back or hunching forward. Swing your arms naturally in coordination with your leg movements to enhance the cardiovascular benefits. Continue to jog in place with high knees for the desired duration, breathing steadily and focusing on maintaining a consistent pace.', 'https://i.ytimg.com/vi/tx5rgpDAJRI/maxresdefault.jpg', 'https://www.youtube.com/embed/tx5rgpDAJRI?si=d936eVg43XYyUx9m', 'Weight Loss', ''),
(239, 'Crossover Crunch', 'The crossover crunch is a dynamic core exercise that targets the obliques and rectus abdominis. This exercise helps strengthen the abdominal muscles and improve core stability.', 'Core', 'Legs', 'None', 'ADVANCE', '3 to 4 sets', '12 to 15 each side', '5 to 10 minutes', 'tart by lying on your back on an exercise mat with your knees bent and feet flat on the floor. Place your hands behind your head, elbows pointing out to the sides. Engage your core muscles and lift your shoulder blades off the mat, bringing your right elbow towards your left knee while simultaneously straightening your right leg and rotating your torso to the left. Keep your left elbow pointing out to the side and avoid pulling on your neck with your hands. Return to the starting position and repeat on the other side by bringing your left elbow towards your right knee while straightening your left leg and rotating your torso to the right. Continue alternating sides in a controlled motion, focusing on contracting the obliques with each repetition.', 'https://i.ytimg.com/vi/q2_KHKE5CDE/maxresdefault.jpg', 'https://www.youtube.com/embed/q2_KHKE5CDE?si=ohT6TxZKDny9iVWo', 'Maintain Weight', 'Abs Intermediate'),
(240, 'Crossover Crunch', 'The crossover crunch is a dynamic core exercise that targets the obliques and rectus abdominis. This exercise helps strengthen the abdominal muscles and improve core stability.', 'Core', 'Lower Body', 'None', 'ADVANCE', '3 to 4 sets', '12 to 15 each side', '5 to 10 minutes', 'tart by lying on your back on an exercise mat with your knees bent and feet flat on the floor. Place your hands behind your head, elbows pointing out to the sides. Engage your core muscles and lift your shoulder blades off the mat, bringing your right elbow towards your left knee while simultaneously straightening your right leg and rotating your torso to the left. Keep your left elbow pointing out to the side and avoid pulling on your neck with your hands. Return to the starting position and repeat on the other side by bringing your left elbow towards your right knee while straightening your left leg and rotating your torso to the right. Continue alternating sides in a controlled motion, focusing on contracting the obliques with each repetition.', 'https://i.ytimg.com/vi/q2_KHKE5CDE/maxresdefault.jpg', 'https://www.youtube.com/embed/q2_KHKE5CDE?si=ohT6TxZKDny9iVWo', 'Muscle Gain', 'Arm Intermediate'),
(241, 'Burpees', 'Burpees are a full-body, plyometric exercise that combines a squat, push-up, and jump. This exercise targets multiple muscle groups and provides cardiovascular benefits, making it an efficient and effective total-body workout.', 'Full Body', 'Legs', 'None', 'ADVANCE', '3 to 4 sets', '8 to 12 reps', '10 to 15 minutes', 'Start by standing with your feet hip-width apart. Lower into a squat position, placing your hands on the floor in front of you. Kick your feet back into a plank position, keeping your body in a straight line from head to heels. Perform a push-up by lowering your chest towards the ground and then pushing back up to the plank position. Jump your feet forward towards your hands, returning to the squat position. Explosively jump up into the air, reaching your arms overhead. Land softly and immediately lower back into the squat position to begin the next repetition. Focus on maintaining proper form and performing each movement with control and explosiveness.', 'https://i.ytimg.com/vi/818SkLAPyKY/maxresdefault.jpg', 'https://www.youtube.com/embed/818SkLAPyKY?si=RCS3bRrsDaWKB7Xf', 'Muscle Gain', 'Chest Intermediate'),
(242, 'Burpees', 'Burpees are a full-body, plyometric exercise that combines a squat, push-up, and jump. This exercise targets multiple muscle groups and provides cardiovascular benefits, making it an efficient and effective total-body workout.', 'Full Body', 'Core', 'None', 'ADVANCE', '3 to 4 sets', '8 to 12 reps', '10 to 15 minutes', 'Start by standing with your feet hip-width apart. Lower into a squat position, placing your hands on the floor in front of you. Kick your feet back into a plank position, keeping your body in a straight line from head to heels. Perform a push-up by lowering your chest towards the ground and then pushing back up to the plank position. Jump your feet forward towards your hands, returning to the squat position. Explosively jump up into the air, reaching your arms overhead. Land softly and immediately lower back into the squat position to begin the next repetition. Focus on maintaining proper form and performing each movement with control and explosiveness.', 'https://i.ytimg.com/vi/818SkLAPyKY/maxresdefault.jpg', 'https://www.youtube.com/embed/818SkLAPyKY?si=RCS3bRrsDaWKB7Xf', 'Weight Loss', 'Chest Beginner'),
