(244, 'Burpees', 'Burpees are a full-body, plyometric exercise that combines a squat, push-up, and jump. This exercise targets multiple muscle groups and provides cardiovascular benefits, making it an efficient and effective total-body workout.', 'Full Body', 'Lower Body', 'None', 'ADVANCE', '3 to 4 sets', '8 to 12 reps', '10 to 15 minutes', 'Start by standing with your feet hip-width apart. Lower into a squat position, placing your hands on the floor in front of you. Kick your feet back into a plank position, keeping your body in a straight line from head to heels. Perform a push-up by lowering your chest towards the ground and then pushing back up to the plank position. Jump your feet forward towards your hands, returning to the squat position. Explosively jump up into the air, reaching your arms overhead. Land softly and immediately lower back into the squat position to begin the next repetition. Focus on maintaining proper form and performing each movement with control and explosiveness.', 'https://i.ytimg.com/vi/818SkLAPyKY/maxresdefault.jpg', 'https://www.youtube.com/embed/818SkLAPyKY?si=RCS3bRrsDaWKB7Xf', 'Maintain Weight', 'Chest Intermediate'),
(245, 'Staggered Push-Ups', 'Staggered push-ups are a variation of the traditional push-up that shifts the focus onto one side of the chest and triceps at a time. This exercise helps improve unilateral strength and stability while still engaging the entire upper body.', 'Strength', 'Upper Body', 'None', 'ADVANCE', '3 to 4 sets', '8 to 12 reps', '5 to 10 minutes', 'tart in a high plank position with your hands slightly wider than shoulder-width apart, wrists aligned under your shoulders, and body forming a straight line from head to heels. Stagger your hands by placing one hand slightly forward and the other slightly back, shifting the weight onto one side. Keep your core engaged and lower your body towards the floor by bending your elbows, keeping them close to your sides. Lower until your chest is just above the ground, then push back up to the starting position, straightening your arms. Repeat for the desired number of repetitions on one side, then switch the hand positions and repeat on the other side. Focus on maintaining proper form and control throughout the exercise.', 'https://i.ytimg.com/vi/JWNTTiAQMhc/sddefault.jpg', 'https://www.youtube.com/embed/JWNTTiAQMhc?si=tO6RtkYyyGYX_4zJ', 'Weight Loss', 'Arm Advanced'),
(246, 'Staggered Push-Ups', 'Staggered push-ups are a variation of the traditional push-up that shifts the focus onto one side of the chest and triceps at a time. This exercise helps improve unilateral strength and stability while still engaging the entire upper body.', 'Strength', 'Core', 'None', 'ADVANCE', '3 to 4 sets', '8 to 12 reps', '5 to 10 minutes', 'tart in a high plank position with your hands slightly wider than shoulder-width apart, wrists aligned under your shoulders, and body forming a straight line from head to heels. Stagger your hands by placing one hand slightly forward and the other slightly back, shifting the weight onto one side. Keep your core engaged and lower your body towards the floor by bending your elbows, keeping them close to your sides. Lower until your chest is just above the ground, then push back up to the starting position, straightening your arms. Repeat for the desired number of repetitions on one side, then switch the hand positions and repeat on the other side. Focus on maintaining proper form and control throughout the exercise.', 'https://i.ytimg.com/vi/JWNTTiAQMhc/sddefault.jpg', 'https://www.youtube.com/embed/JWNTTiAQMhc?si=tO6RtkYyyGYX_4zJ', 'Muscle Gain', 'Chest Advanced'),
(247, 'Staggered Push-Ups', 'Staggered push-ups are a variation of the traditional push-up that shifts the focus onto one side of the chest and triceps at a time. This exercise helps improve unilateral strength and stability while still engaging the entire upper body.', 'Strength', 'Cardio', 'None', 'ADVANCE', '3 to 4 sets', '8 to 12 reps', '5 to 10 minutes', 'tart in a high plank position with your hands slightly wider than shoulder-width apart, wrists aligned under your shoulders, and body forming a straight line from head to heels. Stagger your hands by placing one hand slightly forward and the other slightly back, shifting the weight onto one side. Keep your core engaged and lower your body towards the floor by bending your elbows, keeping them close to your sides. Lower until your chest is just above the ground, then push back up to the starting position, straightening your arms. Repeat for the desired number of repetitions on one side, then switch the hand positions and repeat on the other side. Focus on maintaining proper form and control throughout the exercise.', 'https://i.ytimg.com/vi/JWNTTiAQMhc/sddefault.jpg', 'https://www.youtube.com/embed/JWNTTiAQMhc?si=tO6RtkYyyGYX_4zJ', 'Muscle Gain', 'Shoulder & Back Advanced'),
(248, 'Hindu Push-Ups', 'Hindu push-ups, also known as dands or Hanuman push-ups, are a dynamic bodyweight exercise that combines elements of yoga and traditional push-ups. This exercise targets the chest, shoulders, triceps, and core while also improving flexibility and mobility.', 'Strength', 'Cardio', 'None', 'ADVANCE', '3 to 4 sets', '8 to 12 reps', '5 to 10 minutes', 'Start in a downward-facing dog yoga position with your hands and feet shoulder-width apart, hips raised towards the ceiling, and heels pressing towards the floor. As you inhale, shift your weight forward, lowering your hips towards the ground while keeping your arms straight. Simultaneously, bend your elbows and lower your chest towards the ground in a swooping motion, similar to a dive bomber push-up. Keep your head up and look forward as you transition into an upward-facing dog position, arching your back and extending your arms fully. Exhale as you press back into the downward-facing dog position, raising your hips towards the ceiling and straightening your arms. Repeat the movement in a fluid, continuous motion, flowing between downward-facing dog and upward-facing dog positions. Focus on engaging your core and maintaining proper form throughout the exercise.', 'https://i.ytimg.com/vi/HE0ijmUc6Og/maxresdefault.jpg', 'https://www.youtube.com/embed/HE0ijmUc6Og?si=5eE6HWEzAKxCUcqi', 'Weight Loss', 'Chest Intermediate'),
(249, 'Hindu Push-Ups', 'Hindu push-ups, also known as dands or Hanuman push-ups, are a dynamic bodyweight exercise that combines elements of yoga and traditional push-ups. This exercise targets the chest, shoulders, triceps, and core while also improving flexibility and mobility.', 'Strength', 'Upper Body', 'None', 'ADVANCE', '3 to 4 sets', '8 to 12 reps', '5 to 10 minutes', 'Start in a downward-facing dog yoga position with your hands and feet shoulder-width apart, hips raised towards the ceiling, and heels pressing towards the floor. As you inhale, shift your weight forward, lowering your hips towards the ground while keeping your arms straight. Simultaneously, bend your elbows and lower your chest towards the ground in a swooping motion, similar to a dive bomber push-up. Keep your head up and look forward as you transition into an upward-facing dog position, arching your back and extending your arms fully. Exhale as you press back into the downward-facing dog position, raising your hips towards the ceiling and straightening your arms. Repeat the movement in a fluid, continuous motion, flowing between downward-facing dog and upward-facing dog positions. Focus on engaging your core and maintaining proper form throughout the exercise.', 'https://i.ytimg.com/vi/HE0ijmUc6Og/maxresdefault.jpg', 'https://www.youtube.com/embed/HE0ijmUc6Og?si=5eE6HWEzAKxCUcqi', 'Weight Loss', 'CHEST Advanced'),
(250, 'Hindu Push-Ups', 'Hindu push-ups, also known as dands or Hanuman push-ups, are a dynamic bodyweight exercise that combines elements of yoga and traditional push-ups. This exercise targets the chest, shoulders, triceps, and core while also improving flexibility and mobility.', 'Strength', 'Core', 'None', 'ADVANCE', '3 to 4 sets', '8 to 12 reps', '5 to 10 minutes', 'Start in a downward-facing dog yoga position with your hands and feet shoulder-width apart, hips raised towards the ceiling, and heels pressing towards the floor. As you inhale, shift your weight forward, lowering your hips towards the ground while keeping your arms straight. Simultaneously, bend your elbows and lower your chest towards the ground in a swooping motion, similar to a dive bomber push-up. Keep your head up and look forward as you transition into an upward-facing dog position, arching your back and extending your arms fully. Exhale as you press back into the downward-facing dog position, raising your hips towards the ceiling and straightening your arms. Repeat the movement in a fluid, continuous motion, flowing between downward-facing dog and upward-facing dog positions. Focus on engaging your core and maintaining proper form throughout the exercise.', 'https://i.ytimg.com/vi/HE0ijmUc6Og/maxresdefault.jpg', 'https://www.youtube.com/embed/HE0ijmUc6Og?si=5eE6HWEzAKxCUcqi', 'Muscle Gain', 'Chest Advanced'),
(251, 'Diamond Push-Ups', 'Diamond push-ups are a variation of the traditional push-up that targets the triceps, chest, and shoulders. This exercise involves placing your hands close together in a diamond shape, which increases the emphasis on the triceps muscles.', 'Strength', 'Cardio', 'None', 'ADVANCE', '3 to 4 sets', '8 to 12 reps', '5 to 10 minutes', 'Start in a high plank position with your hands placed close together on the ground directly under your chest, forming a diamond shape with your thumbs and index fingers. Your body should form a straight line from head to heels. Engage your core muscles to keep your spine neutral and lower your body towards the ground by bending your elbows, keeping them close to your sides. Lower until your chest is just above the ground, then push back up to the starting position by straightening your arms. Keep your elbows close to your body throughout the movement and maintain a controlled motion. Focus on contracting your triceps as you push back up to the starting position. Repeat for the desired number of repetitions, focusing on maintaining proper form and control.', 'https://i.ytimg.com/vi/UCmqw3kKZ38/sddefault.jpg', 'https://www.youtube.com/embed/UCmqw3kKZ38?si=8Qy8ZHMOj4s4S-ZL', 'Muscle Gain', 'Chest Advanced'),
(252, 'Diamond Push-Ups', 'Diamond push-ups are a variation of the traditional push-up that targets the triceps, chest, and shoulders. This exercise involves placing your hands close together in a diamond shape, which increases the emphasis on the triceps muscles.', 'Strength', 'Upper Body', 'None', 'ADVANCE', '3 to 4 sets', '8 to 12 reps', '5 to 10 minutes', 'Start in a high plank position with your hands placed close together on the ground directly under your chest, forming a diamond shape with your thumbs and index fingers. Your body should form a straight line from head to heels. Engage your core muscles to keep your spine neutral and lower your body towards the ground by bending your elbows, keeping them close to your sides. Lower until your chest is just above the ground, then push back up to the starting position by straightening your arms. Keep your elbows close to your body throughout the movement and maintain a controlled motion. Focus on contracting your triceps as you push back up to the starting position. Repeat for the desired number of repetitions, focusing on maintaining proper form and control.', 'https://i.ytimg.com/vi/UCmqw3kKZ38/sddefault.jpg', 'https://www.youtube.com/embed/UCmqw3kKZ38?si=8Qy8ZHMOj4s4S-ZL', 'Weight Loss', 'Shoulder & Back Advanced'),
(253, 'Diamond Push-Ups', 'Diamond push-ups are a variation of the traditional push-up that targets the triceps, chest, and shoulders. This exercise involves placing your hands close together in a diamond shape, which increases the emphasis on the triceps muscles.', 'Strength', 'Core', 'None', 'ADVANCE', '3 to 4 sets', '8 to 12 reps', '5 to 10 minutes', 'Start in a high plank position with your hands placed close together on the ground directly under your chest, forming a diamond shape with your thumbs and index fingers. Your body should form a straight line from head to heels. Engage your core muscles to keep your spine neutral and lower your body towards the ground by bending your elbows, keeping them close to your sides. Lower until your chest is just above the ground, then push back up to the starting position by straightening your arms. Keep your elbows close to your body throughout the movement and maintain a controlled motion. Focus on contracting your triceps as you push back up to the starting position. Repeat for the desired number of repetitions, focusing on maintaining proper form and control.', 'https://i.ytimg.com/vi/UCmqw3kKZ38/sddefault.jpg', 'https://www.youtube.com/embed/UCmqw3kKZ38?si=8Qy8ZHMOj4s4S-ZL', 'Weight Loss', 'Shoulder & Back Advanced'),
(254, 'Box Push-Ups', 'Box push-ups are a modified version of the traditional push-up that utilizes an elevated surface, such as a box or bench, to decrease the difficulty level. This exercise is beneficial for beginners or those with limited upper body strength.', 'Strength', 'Core', 'Bench', 'ADVANCE', '3 to 4 sets', '8 to 12 reps', '5 to 10 minutes', 'Start by placing your hands shoulder-width apart on the elevated surface, such as a box or bench, with your fingers pointing forward. Extend your legs behind you and position yourself in a high plank position, ensuring your body forms a straight line from head to heels. Engage your core muscles to keep your spine neutral and lower your chest towards the elevated surface by bending your elbows, keeping them close to your sides. Lower until your chest gently touches the surface, then push back up to the starting position by straightening your arms. Keep your body in a straight line throughout the movement and maintain a controlled motion. Focus on contracting your chest and triceps as you push back up to the starting position. Repeat for the desired number of repetitions, focusing on maintaining proper form and control.', 'https://i.ytimg.com/vi/dcJVA2sBPqw/maxresdefault.jpg', 'https://www.youtube.com/embed/dcJVA2sBPqw?si=LisICs-uTkmgoHrv', 'Weight Loss', 'Shoulder & Back Advanced'),
(255, 'Box Push-Ups', 'Box push-ups are a modified version of the traditional push-up that utilizes an elevated surface, such as a box or bench, to decrease the difficulty level. This exercise is beneficial for beginners or those with limited upper body strength.', 'Strength', 'Cardio', 'Bench', 'ADVANCE', '3 to 4 sets', '8 to 12 reps', '5 to 10 minutes', 'Start by placing your hands shoulder-width apart on the elevated surface, such as a box or bench, with your fingers pointing forward. Extend your legs behind you and position yourself in a high plank position, ensuring your body forms a straight line from head to heels. Engage your core muscles to keep your spine neutral and lower your chest towards the elevated surface by bending your elbows, keeping them close to your sides. Lower until your chest gently touches the surface, then push back up to the starting position by straightening your arms. Keep your body in a straight line throughout the movement and maintain a controlled motion. Focus on contracting your chest and triceps as you push back up to the starting position. Repeat for the desired number of repetitions, focusing on maintaining proper form and control.', 'https://i.ytimg.com/vi/dcJVA2sBPqw/maxresdefault.jpg', 'https://www.youtube.com/embed/dcJVA2sBPqw?si=LisICs-uTkmgoHrv', 'Muscle Gain', 'Chest Advanced'),
(256, 'Box Push-Ups', 'Box push-ups are a modified version of the traditional push-up that utilizes an elevated surface, such as a box or bench, to decrease the difficulty level. This exercise is beneficial for beginners or those with limited upper body strength.', 'Strength', 'Upper Body', 'Bench', 'ADVANCE', '3 to 4 sets', '8 to 12 reps', '5 to 10 minutes', 'Start by placing your hands shoulder-width apart on the elevated surface, such as a box or bench, with your fingers pointing forward. Extend your legs behind you and position yourself in a high plank position, ensuring your body forms a straight line from head to heels. Engage your core muscles to keep your spine neutral and lower your chest towards the elevated surface by bending your elbows, keeping them close to your sides. Lower until your chest gently touches the surface, then push back up to the starting position by straightening your arms. Keep your body in a straight line throughout the movement and maintain a controlled motion. Focus on contracting your chest and triceps as you push back up to the starting position. Repeat for the desired number of repetitions, focusing on maintaining proper form and control.', 'https://i.ytimg.com/vi/dcJVA2sBPqw/maxresdefault.jpg', 'https://www.youtube.com/embed/dcJVA2sBPqw?si=LisICs-uTkmgoHrv', 'Maintain Weight', 'Chest Advanced'),
(257, 'Spiderman Push-Ups', 'Spiderman push-ups are a dynamic variation of the traditional push-up that targets the chest, shoulders, triceps, and core muscles. This exercise adds a rotational and unilateral component by bringing one knee towards the elbow as you lower into the push-up position.', 'Strength', 'Upper Body', 'None', 'ADVANCE', '3 to 4 sets', '8 to 12 reps', '5 to 10 minutes', 'Start in a high plank position with your hands shoulder-width apart on the ground and your body forming a straight line from head to heels. Engage your core muscles to keep your spine neutral throughout the movement. As you lower your body towards the ground by bending your elbows into the push-up position, simultaneously bring your right knee towards your right elbow in a controlled manner. Keep your right foot off the ground and aim to touch your knee to your elbow as you lower your chest towards the ground. Push back up to the starting position while simultaneously returning your right leg to the starting position. Repeat the movement on the opposite side by bringing your left knee towards your left elbow as you lower into the push-up position. Continue alternating sides with each repetition, focusing on maintaining proper form and control throughout the exercise.', 'https://i.ytimg.com/vi/YmonBKorAIw/maxresdefault.jpg', 'https://www.youtube.com/embed/YmonBKorAIw?si=rXMEvwoGGPmwewDh', 'Weight Loss', 'Shoulder & Back Advance'),
(258, 'Spiderman Push-Ups', 'Spiderman push-ups are a dynamic variation of the traditional push-up that targets the chest, shoulders, triceps, and core muscles. This exercise adds a rotational and unilateral component by bringing one knee towards the elbow as you lower into the push-up position.', 'Strength', 'Core', 'None', 'ADVANCE', '3 to 4 sets', '8 to 12 reps', '5 to 10 minutes', 'Start in a high plank position with your hands shoulder-width apart on the ground and your body forming a straight line from head to heels. Engage your core muscles to keep your spine neutral throughout the movement. As you lower your body towards the ground by bending your elbows into the push-up position, simultaneously bring your right knee towards your right elbow in a controlled manner. Keep your right foot off the ground and aim to touch your knee to your elbow as you lower your chest towards the ground. Push back up to the starting position while simultaneously returning your right leg to the starting position. Repeat the movement on the opposite side by bringing your left knee towards your left elbow as you lower into the push-up position. Continue alternating sides with each repetition, focusing on maintaining proper form and control throughout the exercise.', 'https://i.ytimg.com/vi/YmonBKorAIw/maxresdefault.jpg', 'https://www.youtube.com/embed/YmonBKorAIw?si=rXMEvwoGGPmwewDh', 'Muscle Gain', 'Chest Intermediate'),
(259, 'Decline Push-Ups', 'Decline push-ups are a challenging variation of the traditional push-up that targets the upper chest, shoulders, and triceps. By elevating your feet on an elevated surface, such as a bench or box, you increase the resistance on the upper body, making the exercise more difficult.', 'Strength', 'Core', 'Bench', 'ADVANCE', '3 to 4 sets', '8 to 12 reps', '5 to 10 minutes', 'Start by placing your hands slightly wider than shoulder-width apart on the ground and your feet elevated on a bench or box behind you. Your body should form a straight line from head to heels. Engage your core muscles to keep your spine neutral throughout the movement. Lower your body towards the ground by bending your elbows, keeping them close to your sides. Lower until your chest gently touches the ground, then push back up to the starting position by straightening your arms. Keep your body in a straight line throughout the movement and maintain a controlled motion. Focus on contracting your chest and triceps as you push back up to the starting position. Repeat for the desired number of repetitions, focusing on maintaining proper form and control.', 'https://i.ytimg.com/vi/OjPfLfLsw3c/maxresdefault.jpg', 'https://www.youtube.com/embed/OjPfLfLsw3c?si=qbyyIB0JURV-gPyh', 'Muscle Gain', 'Shoulder & Back Advanced'),
(260, 'Decline Push-Ups', 'Decline push-ups are a challenging variation of the traditional push-up that targets the upper chest, shoulders, and triceps. By elevating your feet on an elevated surface, such as a bench or box, you increase the resistance on the upper body, making the exercise more difficult.', 'Strength', 'Upper Body', 'Bench', 'ADVANCE', '3 to 4 sets', '8 to 12 reps', '5 to 10 minutes', 'Start by placing your hands slightly wider than shoulder-width apart on the ground and your feet elevated on a bench or box behind you. Your body should form a straight line from head to heels. Engage your core muscles to keep your spine neutral throughout the movement. Lower your body towards the ground by bending your elbows, keeping them close to your sides. Lower until your chest gently touches the ground, then push back up to the starting position by straightening your arms. Keep your body in a straight line throughout the movement and maintain a controlled motion. Focus on contracting your chest and triceps as you push back up to the starting position. Repeat for the desired number of repetitions, focusing on maintaining proper form and control.', 'https://i.ytimg.com/vi/OjPfLfLsw3c/maxresdefault.jpg', 'https://www.youtube.com/embed/OjPfLfLsw3c?si=qbyyIB0JURV-gPyh', 'Weight Loss', 'Chest Advanced'),
(261, 'Decline Push-Ups', 'Decline push-ups are a challenging variation of the traditional push-up that targets the upper chest, shoulders, and triceps. By elevating your feet on an elevated surface, such as a bench or box, you increase the resistance on the upper body, making the exercise more difficult.', 'Strength', 'Core', 'Bench', 'ADVANCE', '3 to 4 sets', '8 to 12 reps', '5 to 10 minutes', 'Start by placing your hands slightly wider than shoulder-width apart on the ground and your feet elevated on a bench or box behind you. Your body should form a straight line from head to heels. Engage your core muscles to keep your spine neutral throughout the movement. Lower your body towards the ground by bending your elbows, keeping them close to your sides. Lower until your chest gently touches the ground, then push back up to the starting position by straightening your arms. Keep your body in a straight line throughout the movement and maintain a controlled motion. Focus on contracting your chest and triceps as you push back up to the starting position. Repeat for the desired number of repetitions, focusing on maintaining proper form and control.', 'https://i.ytimg.com/vi/OjPfLfLsw3c/maxresdefault.jpg', 'https://www.youtube.com/embed/OjPfLfLsw3c?si=qbyyIB0JURV-gPyh', 'Weight Loss', 'Chest Advanced'),
(262, 'Chest Stretch', 'The chest stretch is a simple and effective stretch that targets the pectoral muscles (chest muscles) and the front of the shoulders. It helps improve flexibility and mobility in the chest and shoulder area, especially beneficial for individuals who spend long hours sitting or hunched over.', 'Flexibility', 'Upper Body', 'None', 'ADVANCE', '', '', '20 to 30 seconds', 'Start by standing tall with your feet hip-width apart and your arms relaxed at your sides. Bring your hands behind your back and clasp them together, interlocking your fingers. With your palms facing inward, gently straighten your arms and lift them away from your body, allowing your chest to open up and your shoulder blades to squeeze together. Keep your shoulders relaxed and down away from your ears. You should feel a gentle stretch across the front of your chest and shoulders. Hold this position for 20-30 seconds, breathing deeply and focusing on relaxing into the stretch. Release the stretch and repeat on the opposite side if desired.', 'https://i.ytimg.com/vi/NS64IgKUyeY/hqdefault.jpg', 'https://www.youtube.com/embed/NS64IgKUyeY?si=45u4pHhR7juuWvxB', 'Maintain Weight', 'Chest Advanced'),
(263, 'Chest Stretch', 'The chest stretch is a simple and effective stretch that targets the pectoral muscles (chest muscles) and the front of the shoulders. It helps improve flexibility and mobility in the chest and shoulder area, especially beneficial for individuals who spend long hours sitting or hunched over.', 'Flexibility', 'Core', 'None', 'ADVANCE', '', '', '20 to 30 seconds', 'Start by standing tall with your feet hip-width apart and your arms relaxed at your sides. Bring your hands behind your back and clasp them together, interlocking your fingers. With your palms facing inward, gently straighten your arms and lift them away from your body, allowing your chest to open up and your shoulder blades to squeeze together. Keep your shoulders relaxed and down away from your ears. You should feel a gentle stretch across the front of your chest and shoulders. Hold this position for 20-30 seconds, breathing deeply and focusing on relaxing into the stretch. Release the stretch and repeat on the opposite side if desired.', 'https://i.ytimg.com/vi/NS64IgKUyeY/hqdefault.jpg', 'https://www.youtube.com/embed/NS64IgKUyeY?si=45u4pHhR7juuWvxB', 'Maintain Weight', 'Shoulder & Back Advance'),
(264, 'Skipping Without Rope', 'kipping without a rope, also known as imaginary skipping or shadow skipping, mimics the motion of traditional skipping or jump rope without using an actual rope. It is a cardiovascular exercise that helps improve coordination, footwork, and endurance while burning calories.', 'Cardiovascular', 'Cardio', 'None', 'ADVANCE', '', '', '5 to 10 minutes', 'Start by standing with your feet shoulder-width apart and your arms by your sides. Imagine holding a skipping rope in your hands. Begin to simulate the motion of skipping rope by swinging your arms in small circles and hopping lightly on the balls of your feet. As you hop, alternate lifting your knees slightly towards your chest in a marching motion. Keep your movements light and controlled, landing softly on the balls of your feet with each hop. Continue to move at a steady pace, maintaining a consistent rhythm throughout the exercise. You can vary the intensity by increasing the speed of your movements or adding variations such as high knees, butt kicks, or double hops. Aim to perform the exercise for 5-10 minutes, gradually increasing the duration as your fitness level improves.', 'https://i.ytimg.com/vi/CYGeazlNbU4/maxresdefault.jpg', 'https://www.youtube.com/embed/CYGeazlNbU4?si=HYQEjZTK-yOx8wpa', 'Weight Loss', 'Arm Intermediate'),
(265, 'Skipping Without Rope', 'kipping without a rope, also known as imaginary skipping or shadow skipping, mimics the motion of traditional skipping or jump rope without using an actual rope. It is a cardiovascular exercise that helps improve coordination, footwork, and endurance while burning calories.', 'Cardiovascular', 'Upper Body', 'None', 'ADVANCE', '', '', '5 to 10 minutes', 'Start by standing with your feet shoulder-width apart and your arms by your sides. Imagine holding a skipping rope in your hands. Begin to simulate the motion of skipping rope by swinging your arms in small circles and hopping lightly on the balls of your feet. As you hop, alternate lifting your knees slightly towards your chest in a marching motion. Keep your movements light and controlled, landing softly on the balls of your feet with each hop. Continue to move at a steady pace, maintaining a consistent rhythm throughout the exercise. You can vary the intensity by increasing the speed of your movements or adding variations such as high knees, butt kicks, or double hops. Aim to perform the exercise for 5-10 minutes, gradually increasing the duration as your fitness level improves.', 'https://i.ytimg.com/vi/CYGeazlNbU4/maxresdefault.jpg', 'https://www.youtube.com/embed/CYGeazlNbU4?si=HYQEjZTK-yOx8wpa', 'Maintain Weight', 'Shoulder & Back Advanced'),
(266, 'Floor Triceps Dips', 'Floor triceps dips are a bodyweight exercise that targets the triceps, shoulders, and chest muscles. This exercise is performed using your own body weight and requires minimal equipment, making it an effective exercise for strengthening and toning the upper body.', 'Strength', 'Upper Body', 'None', 'ADVANCE', '3 to 4 sets', '8 to 12 reps', '5 to 10 minutes', 'tart by sitting on the floor with your knees bent and feet flat on the ground, hip-width apart. Place your hands behind your hips with your fingers pointing towards your feet and palms flat on the ground, shoulder-width apart. Press through your palms and lift your hips off the ground, straightening your arms. Your body should form a reverse tabletop position, with your hips lifted and knees bent at a 90-degree angle. Lower your body towards the ground by bending your elbows, keeping them close to your body. Lower until your elbows are bent at approximately 90 degrees, then press back up to the starting position by straightening your arms. Keep your core engaged and your back close to the ground throughout the movement. Repeat for the desired number of repetitions, focusing on maintaining proper form and control.', 'https://i.ytimg.com/vi/geNkbcZ6qDo/maxresdefault.jpg', 'https://www.youtube.com/embed/geNkbcZ6qDo?si=0xDAFoRjB-ktMV88', 'Muscle Gain', 'Arm Intermediate'),
(267, 'Floor Triceps Dips', 'Floor triceps dips are a bodyweight exercise that targets the triceps, shoulders, and chest muscles. This exercise is performed using your own body weight and requires minimal equipment, making it an effective exercise for strengthening and toning the upper body.', 'Strength', 'Core', 'None', 'ADVANCE', '3 to 4 sets', '8 to 12 reps', '5 to 10 minutes', 'tart by sitting on the floor with your knees bent and feet flat on the ground, hip-width apart. Place your hands behind your hips with your fingers pointing towards your feet and palms flat on the ground, shoulder-width apart. Press through your palms and lift your hips off the ground, straightening your arms. Your body should form a reverse tabletop position, with your hips lifted and knees bent at a 90-degree angle. Lower your body towards the ground by bending your elbows, keeping them close to your body. Lower until your elbows are bent at approximately 90 degrees, then press back up to the starting position by straightening your arms. Keep your core engaged and your back close to the ground throughout the movement. Repeat for the desired number of repetitions, focusing on maintaining proper form and control.', 'https://i.ytimg.com/vi/geNkbcZ6qDo/maxresdefault.jpg', 'https://www.youtube.com/embed/geNkbcZ6qDo?si=0xDAFoRjB-ktMV88', 'Maintain Weight', 'Shoulder & Back Beginner'),
(268, 'Floor Triceps Dips', 'Floor triceps dips are a bodyweight exercise that targets the triceps, shoulders, and chest muscles. This exercise is performed using your own body weight and requires minimal equipment, making it an effective exercise for strengthening and toning the upper body.', 'Strength', 'Lower Body', 'None', 'ADVANCE', '3 to 4 sets', '8 to 12 reps', '5 to 10 minutes', 'tart by sitting on the floor with your knees bent and feet flat on the ground, hip-width apart. Place your hands behind your hips with your fingers pointing towards your feet and palms flat on the ground, shoulder-width apart. Press through your palms and lift your hips off the ground, straightening your arms. Your body should form a reverse tabletop position, with your hips lifted and knees bent at a 90-degree angle. Lower your body towards the ground by bending your elbows, keeping them close to your body. Lower until your elbows are bent at approximately 90 degrees, then press back up to the starting position by straightening your arms. Keep your core engaged and your back close to the ground throughout the movement. Repeat for the desired number of repetitions, focusing on maintaining proper form and control.', 'https://i.ytimg.com/vi/geNkbcZ6qDo/maxresdefault.jpg', 'https://www.youtube.com/embed/geNkbcZ6qDo?si=0xDAFoRjB-ktMV88', 'Weight Loss', 'Shoulder & Back Advanced');
INSERT INTO `exercises` (`ExerciseID`, `ExerciseName`, `Description`, `CategoryID`, `PartOfBody`, `EquipmentID`, `Difficulty`, `set`, `reps`, `duration`, `Instructions`, `ImageURL`, `VideoURL`, `Goal`, `Workoutset`) VALUES
(269, 'Alternating Hooks', 'Alternating hooks are a dynamic boxing-inspired exercise that targets the muscles of the arms, shoulders, and core while also providing a cardiovascular workout. This exercise mimics the motion of throwing hooks in boxing, engaging the muscles of the upper body and promoting coordination and agility.', 'Cardiovascular', 'Upper Body', 'None', 'ADVANCE', '3 To 4 sets', '30 to 60 seconds', '5 to 10 minutes', 'Start by standing with your feet shoulder-width apart and knees slightly bent. Engage your core muscles and keep your fists up, elbows bent at approximately 90 degrees. Begin the exercise by throwing a hook with your right arm, rotating your torso and pivoting on your back foot to generate power. As you retract your right arm, immediately throw a hook with your left arm in a similar motion, rotating your torso in the opposite direction and pivoting on your back foot. Continue to alternate hooks between the right and left arms in a continuous, rhythmic motion. Keep your movements controlled and focus on engaging your core muscles to stabilize your body throughout the exercise. Aim to maintain a steady pace and breathe evenly as you perform the exercise.', 'https://i.ytimg.com/vi/wiyvVpEKOsc/maxresdefault.jpg', 'https://www.youtube.com/embed/wiyvVpEKOsc?si=7bbpLZgGUUExP_Vl', 'Weight Loss', 'Arm Intermediate'),
(270, 'Alternating Hooks', 'Alternating hooks are a dynamic boxing-inspired exercise that targets the muscles of the arms, shoulders, and core while also providing a cardiovascular workout. This exercise mimics the motion of throwing hooks in boxing, engaging the muscles of the upper body and promoting coordination and agility.', 'Cardiovascular', 'Core', 'None', 'ADVANCE', '3 To 4 sets', '30 to 60 seconds', '5 to 10 minutes', 'Start by standing with your feet shoulder-width apart and knees slightly bent. Engage your core muscles and keep your fists up, elbows bent at approximately 90 degrees. Begin the exercise by throwing a hook with your right arm, rotating your torso and pivoting on your back foot to generate power. As you retract your right arm, immediately throw a hook with your left arm in a similar motion, rotating your torso in the opposite direction and pivoting on your back foot. Continue to alternate hooks between the right and left arms in a continuous, rhythmic motion. Keep your movements controlled and focus on engaging your core muscles to stabilize your body throughout the exercise. Aim to maintain a steady pace and breathe evenly as you perform the exercise.', 'https://i.ytimg.com/vi/wiyvVpEKOsc/maxresdefault.jpg', 'https://www.youtube.com/embed/wiyvVpEKOsc?si=7bbpLZgGUUExP_Vl', 'Maintain Weight', 'Arm Advanced'),
(271, 'Alternating Hooks', 'Alternating hooks are a dynamic boxing-inspired exercise that targets the muscles of the arms, shoulders, and core while also providing a cardiovascular workout. This exercise mimics the motion of throwing hooks in boxing, engaging the muscles of the upper body and promoting coordination and agility.', 'Cardiovascular', 'Lower Body', 'None', 'ADVANCE', '3 To 4 sets', '30 to 60 seconds', '5 to 10 minutes', 'Start by standing with your feet shoulder-width apart and knees slightly bent. Engage your core muscles and keep your fists up, elbows bent at approximately 90 degrees. Begin the exercise by throwing a hook with your right arm, rotating your torso and pivoting on your back foot to generate power. As you retract your right arm, immediately throw a hook with your left arm in a similar motion, rotating your torso in the opposite direction and pivoting on your back foot. Continue to alternate hooks between the right and left arms in a continuous, rhythmic motion. Keep your movements controlled and focus on engaging your core muscles to stabilize your body throughout the exercise. Aim to maintain a steady pace and breathe evenly as you perform the exercise.', 'https://i.ytimg.com/vi/wiyvVpEKOsc/maxresdefault.jpg', 'https://www.youtube.com/embed/wiyvVpEKOsc?si=7bbpLZgGUUExP_Vl', 'Maintain Weight', 'Arm Advanced'),
(272, 'Military Push-Ups', 'Military push-ups, also known as narrow push-ups or close-grip push-ups, are a variation of the traditional push-up that targets the triceps, chest, and shoulders. This exercise involves placing your hands closer together, which increases the emphasis on the triceps muscles.', 'Strength', 'Cardio', 'None', 'ADVANCE', '3 To 4 sets', '30 to 60 seconds', '5 to 10 minutes', 'Start in a high plank position with your hands placed close together on the ground directly under your chest, forming a diamond shape with your thumbs and index fingers. Your body should form a straight line from head to heels. Engage your core muscles to keep your spine neutral throughout the movement. Lower your body towards the ground by bending your elbows, keeping them close to your sides. Lower until your chest gently touches the ground, then push back up to the starting position by straightening your arms. Keep your body in a straight line throughout the movement and maintain a controlled motion. Focus on contracting your triceps as you push back up to the starting position. Repeat for the desired number of repetitions, focusing on maintaining proper form and control.', 'https://i.ytimg.com/vi/H8LoGZ-ZN48/maxresdefault.jpg', 'https://www.youtube.com/embed/H8LoGZ-ZN48?si=yOKFp6Qcrd14b-Hs', 'Maintain Weight', 'Arm Intermediate'),
(273, 'Military Push-Ups', 'Military push-ups, also known as narrow push-ups or close-grip push-ups, are a variation of the traditional push-up that targets the triceps, chest, and shoulders. This exercise involves placing your hands closer together, which increases the emphasis on the triceps muscles.', 'Strength', 'Core', 'None', 'ADVANCE', '3 To 4 sets', '30 to 60 seconds', '5 to 10 minutes', 'Start in a high plank position with your hands placed close together on the ground directly under your chest, forming a diamond shape with your thumbs and index fingers. Your body should form a straight line from head to heels. Engage your core muscles to keep your spine neutral throughout the movement. Lower your body towards the ground by bending your elbows, keeping them close to your sides. Lower until your chest gently touches the ground, then push back up to the starting position by straightening your arms. Keep your body in a straight line throughout the movement and maintain a controlled motion. Focus on contracting your triceps as you push back up to the starting position. Repeat for the desired number of repetitions, focusing on maintaining proper form and control.', 'https://i.ytimg.com/vi/H8LoGZ-ZN48/maxresdefault.jpg', 'https://www.youtube.com/embed/H8LoGZ-ZN48?si=yOKFp6Qcrd14b-Hs', 'Muscle Gain', 'Chest Advanced'),
(274, 'Military Push-Ups', 'Military push-ups, also known as narrow push-ups or close-grip push-ups, are a variation of the traditional push-up that targets the triceps, chest, and shoulders. This exercise involves placing your hands closer together, which increases the emphasis on the triceps muscles.', 'Strength', 'Upper Body', 'None', 'ADVANCE', '3 To 4 sets', '30 to 60 seconds', '5 to 10 minutes', 'Start in a high plank position with your hands placed close together on the ground directly under your chest, forming a diamond shape with your thumbs and index fingers. Your body should form a straight line from head to heels. Engage your core muscles to keep your spine neutral throughout the movement. Lower your body towards the ground by bending your elbows, keeping them close to your sides. Lower until your chest gently touches the ground, then push back up to the starting position by straightening your arms. Keep your body in a straight line throughout the movement and maintain a controlled motion. Focus on contracting your triceps as you push back up to the starting position. Repeat for the desired number of repetitions, focusing on maintaining proper form and control.', 'https://i.ytimg.com/vi/H8LoGZ-ZN48/maxresdefault.jpg', 'https://www.youtube.com/embed/H8LoGZ-ZN48?si=yOKFp6Qcrd14b-Hs', 'Weight Loss', 'Shoulder & Back Advanced'),
(275, 'Shoulder Gators', 'Shoulder gators are a dynamic shoulder exercise that targets the deltoid muscles (specifically the lateral deltoids) and helps improve shoulder strength, stability, and mobility. This exercise involves raising the arms laterally while keeping tension on the muscles throughout the movement.', 'Strength', 'Upper Body', 'Dumbells ', 'ADVANCE', '3 To 4 sets', '30 to 60 seconds', '5 to 10 minutes', 'Start by standing with your feet hip-width apart and holding a dumbbell in each hand or gripping the ends of a resistance band. Keep your arms straight and your palms facing downward. Engage your core muscles to stabilize your body. Begin the exercise by raising your arms laterally to the sides until they reach shoulder height, keeping a slight bend in your elbows. Keep your shoulders down away from your ears and maintain tension in the lateral deltoids throughout the movement. Pause briefly at the top of the movement, then slowly lower your arms back to the starting position. Avoid swinging or using momentum to lift the weights. Focus on controlling the movement and keeping your core engaged. Repeat for the desired number of repetitions, focusing on maintaining proper form and control.', 'https://i.ytimg.com/vi/JWp8_LGkTR8/maxresdefault.jpg', 'https://www.youtube.com/embed/JWp8_LGkTR8?si=MylRrydVRU38Uflk', 'Maintain Weight', 'Shoulder & Back Advanced'),
(276, 'Shoulder Gators', 'Shoulder gators are a dynamic shoulder exercise that targets the deltoid muscles (specifically the lateral deltoids) and helps improve shoulder strength, stability, and mobility. This exercise involves raising the arms laterally while keeping tension on the muscles throughout the movement.', 'Strength', 'Core', 'Dumbells ', 'ADVANCE', '3 To 4 sets', '30 to 60 seconds', '5 to 10 minutes', 'Start by standing with your feet hip-width apart and holding a dumbbell in each hand or gripping the ends of a resistance band. Keep your arms straight and your palms facing downward. Engage your core muscles to stabilize your body. Begin the exercise by raising your arms laterally to the sides until they reach shoulder height, keeping a slight bend in your elbows. Keep your shoulders down away from your ears and maintain tension in the lateral deltoids throughout the movement. Pause briefly at the top of the movement, then slowly lower your arms back to the starting position. Avoid swinging or using momentum to lift the weights. Focus on controlling the movement and keeping your core engaged. Repeat for the desired number of repetitions, focusing on maintaining proper form and control.', 'https://i.ytimg.com/vi/JWp8_LGkTR8/maxresdefault.jpg', 'https://www.youtube.com/embed/JWp8_LGkTR8?si=MylRrydVRU38Uflk', 'Muscle Gain', 'Arm Advanced'),
(277, 'Doorway Curls (Left Arm)', 'Doorway curls are a variation of the traditional bicep curl exercise that utilizes a doorway to stabilize the body and isolate the bicep muscles. This exercise helps improve bicep strength and definition.', 'Strength', 'Core', 'Doorway', 'ADVANCE', '3 To 4 sets', '30 to 60 seconds', '5 to 10 minutes', 'Stand inside a doorway with your left side facing the door frame. Place your left forearm against the door frame with your elbow bent at a 90-degree angle and your palm facing upward. Your elbow should be positioned at shoulder height. Grasp the resistance band or dumbbell with your left hand, keeping your palm facing upward. Engage your core muscles to stabilize your body. Begin the exercise by contracting your bicep muscles and curling the resistance band or dumbbell towards your shoulder. Keep your upper arm stationary against the door frame throughout the movement. Pause briefly at the top of the movement, then slowly lower the resistance band or dumbbell back to the starting position. Avoid swinging or using momentum to lift the weight. Focus on controlling the movement and keeping tension on the bicep muscles. Repeat for the desired number of repetitions, focusing on maintaining proper form and control.', 'https://i.ytimg.com/vi/134v7cB-1W8/maxresdefault.jpg', 'https://www.youtube.com/embed/134v7cB-1W8?si=dwnfStgReVjwCAXb', 'Muscle Gain', 'Arm Advanced'),
(278, 'Doorway Curls (Left Arm)', 'Doorway curls are a variation of the traditional bicep curl exercise that utilizes a doorway to stabilize the body and isolate the bicep muscles. This exercise helps improve bicep strength and definition.', 'Strength', 'Upper Body', 'Doorway', 'ADVANCE', '3 To 4 sets', '30 to 60 seconds', '5 to 10 minutes', 'Stand inside a doorway with your left side facing the door frame. Place your left forearm against the door frame with your elbow bent at a 90-degree angle and your palm facing upward. Your elbow should be positioned at shoulder height. Grasp the resistance band or dumbbell with your left hand, keeping your palm facing upward. Engage your core muscles to stabilize your body. Begin the exercise by contracting your bicep muscles and curling the resistance band or dumbbell towards your shoulder. Keep your upper arm stationary against the door frame throughout the movement. Pause briefly at the top of the movement, then slowly lower the resistance band or dumbbell back to the starting position. Avoid swinging or using momentum to lift the weight. Focus on controlling the movement and keeping tension on the bicep muscles. Repeat for the desired number of repetitions, focusing on maintaining proper form and control.', 'https://i.ytimg.com/vi/134v7cB-1W8/maxresdefault.jpg', 'https://www.youtube.com/embed/134v7cB-1W8?si=dwnfStgReVjwCAXb', 'Weight Loss', ''),
(279, 'Doorway Curls (Right Arm)', 'Doorway curls are a variation of the traditional bicep curl exercise that utilizes a doorway to stabilize the body and isolate the bicep muscles. This exercise helps improve bicep strength and definition.', 'Strength', 'Lower Body', 'Doorway', 'ADVANCE', '3 To 4 sets', '30 to 60 seconds', '5 to 10 minutes', 'Stand inside a doorway with your right side facing the door frame. Place your right forearm against the door frame with your elbow bent at a 90-degree angle and your palm facing upward. Your elbow should be positioned at shoulder height. Grasp the resistance band or dumbbell with your right hand, keeping your palm facing upward. Engage your core muscles to stabilize your body. Begin the exercise by contracting your bicep muscles and curling the resistance band or dumbbell towards your shoulder. Keep your upper arm stationary against the door frame throughout the movement. Pause briefly at the top of the movement, then slowly lower the resistance band or dumbbell back to the starting position. Avoid swinging or using momentum to lift the weight. Focus on controlling the movement and keeping tension on the bicep muscles. Repeat for the desired number of repetitions, focusing on maintaining proper form and control.', 'https://i.ytimg.com/vi/134v7cB-1W8/maxresdefault.jpg', 'https://www.youtube.com/embed/134v7cB-1W8?si=dwnfStgReVjwCAXb', 'Muscle Gain', 'Arm Advanced'),
(280, 'Doorway Curls (Right Arm)', 'Doorway curls are a variation of the traditional bicep curl exercise that utilizes a doorway to stabilize the body and isolate the bicep muscles. This exercise helps improve bicep strength and definition.', 'Strength', 'Cardio', 'Doorway', 'ADVANCE', '3 To 4 sets', '30 to 60 seconds', '5 to 10 minutes', 'Stand inside a doorway with your right side facing the door frame. Place your right forearm against the door frame with your elbow bent at a 90-degree angle and your palm facing upward. Your elbow should be positioned at shoulder height. Grasp the resistance band or dumbbell with your right hand, keeping your palm facing upward. Engage your core muscles to stabilize your body. Begin the exercise by contracting your bicep muscles and curling the resistance band or dumbbell towards your shoulder. Keep your upper arm stationary against the door frame throughout the movement. Pause briefly at the top of the movement, then slowly lower the resistance band or dumbbell back to the starting position. Avoid swinging or using momentum to lift the weight. Focus on controlling the movement and keeping tension on the bicep muscles. Repeat for the desired number of repetitions, focusing on maintaining proper form and control.', 'https://i.ytimg.com/vi/134v7cB-1W8/maxresdefault.jpg', 'https://www.youtube.com/embed/134v7cB-1W8?si=dwnfStgReVjwCAXb', 'Weight Loss', ''),
(281, 'Modified Push-Up Low Hold', 'The modified push-up low hold is an isometric exercise that targets the muscles of the chest, shoulders, and triceps, as well as the core muscles. It involves holding the bottom position of a modified push-up, also known as a kneeling or incline push-up, to build strength and endurance in the upper body and core.', 'Strength', 'Cardio', 'None', 'ADVANCE', '3 To 4 sets', '', '20 to 30 seconds', 'Start by kneeling on the ground with your hands placed slightly wider than shoulder-width apart on the floor, fingers pointing forward. Extend your legs behind you so that your body forms a straight line from head to knees. Engage your core muscles to keep your spine neutral and lower your body towards the ground by bending your elbows. Lower until your chest is just above the ground, then hold this position, keeping your elbows bent at approximately 90 degrees. Maintain tension in your core and avoid sagging or arching your back. Keep your head in line with your spine and your gaze slightly forward. Hold the low position of the push-up for 20-30 seconds, focusing on maintaining proper form and breathing steadily. Once the time is up, push yourself back up to the starting position. Rest briefly between sets as needed.', 'https://i.ytimg.com/vi/fobiVgoeeZA/sddefault.jpg', 'https://www.youtube.com/embed/fobiVgoeeZA?si=5agiCSwOBpFqhZ_K', 'Maintain Weight', 'Arm Advanced'),
(282, 'Modified Push-Up Low Hold', 'The modified push-up low hold is an isometric exercise that targets the muscles of the chest, shoulders, and triceps, as well as the core muscles. It involves holding the bottom position of a modified push-up, also known as a kneeling or incline push-up, to build strength and endurance in the upper body and core.', 'Strength', 'Upper Body', 'None', 'ADVANCE', '3 To 4 sets', '', '20 to 30 seconds', 'Start by kneeling on the ground with your hands placed slightly wider than shoulder-width apart on the floor, fingers pointing forward. Extend your legs behind you so that your body forms a straight line from head to knees. Engage your core muscles to keep your spine neutral and lower your body towards the ground by bending your elbows. Lower until your chest is just above the ground, then hold this position, keeping your elbows bent at approximately 90 degrees. Maintain tension in your core and avoid sagging or arching your back. Keep your head in line with your spine and your gaze slightly forward. Hold the low position of the push-up for 20-30 seconds, focusing on maintaining proper form and breathing steadily. Once the time is up, push yourself back up to the starting position. Rest briefly between sets as needed.', 'https://i.ytimg.com/vi/fobiVgoeeZA/sddefault.jpg', 'https://www.youtube.com/embed/fobiVgoeeZA?si=5agiCSwOBpFqhZ_K', 'Muscle Gain', ''),
(283, 'Curtsy Lunges', 'Curtsy lunges are a variation of the traditional lunge exercise that targets the quadriceps, hamstrings, glutes, and adductors while also engaging the core for stability. This exercise involves stepping back and across the body, mimicking the motion of a curtsy, to work different muscles than a standard lunge.', 'Strength', 'Legs', 'None', 'ADVANCE', '3 To 4 sets', '10 to 12 each leg', '5 to 10 minutes', 'Start by standing tall with your feet hip-width apart and your hands on your hips or by your sides. Engage your core muscles to stabilize your body. Take a step back and diagonally across your body with your right foot, placing it behind and to the left of your left foot. Bend both knees and lower your body towards the ground until your front thigh is parallel to the ground and your back knee nearly touches the ground. Keep your torso upright and your chest lifted throughout the movement. Push through your left heel to return to the starting position, bringing your right foot back to meet your left foot. Repeat the movement on the opposite side by stepping back and diagonally across with your left foot. Alternate between legs for the desired number of repetitions, focusing on maintaining proper form and control.', 'https://i.ytimg.com/vi/-rTyKlHjYT8/maxresdefault.jpg', 'https://www.youtube.com/embed/-rTyKlHjYT8?si=6in4i9Vo6iNF99d2', 'Weight Loss', 'Leg Advanced'),
(284, 'Curtsy Lunges', 'Curtsy lunges are a variation of the traditional lunge exercise that targets the quadriceps, hamstrings, glutes, and adductors while also engaging the core for stability. This exercise involves stepping back and across the body, mimicking the motion of a curtsy, to work different muscles than a standard lunge.', 'Strength', 'Lower Back', 'None', 'ADVANCE', '3 To 4 sets', '10 to 12 each leg', '5 to 10 minutes', 'Start by standing tall with your feet hip-width apart and your hands on your hips or by your sides. Engage your core muscles to stabilize your body. Take a step back and diagonally across your body with your right foot, placing it behind and to the left of your left foot. Bend both knees and lower your body towards the ground until your front thigh is parallel to the ground and your back knee nearly touches the ground. Keep your torso upright and your chest lifted throughout the movement. Push through your left heel to return to the starting position, bringing your right foot back to meet your left foot. Repeat the movement on the opposite side by stepping back and diagonally across with your left foot. Alternate between legs for the desired number of repetitions, focusing on maintaining proper form and control.', 'https://i.ytimg.com/vi/-rTyKlHjYT8/maxresdefault.jpg', 'https://www.youtube.com/embed/-rTyKlHjYT8?si=6in4i9Vo6iNF99d2', 'Muscle Gain', 'Leg Intermediate'),
(285, 'Curtsy Lunges', 'Curtsy lunges are a variation of the traditional lunge exercise that targets the quadriceps, hamstrings, glutes, and adductors while also engaging the core for stability. This exercise involves stepping back and across the body, mimicking the motion of a curtsy, to work different muscles than a standard lunge.', 'Strength', 'Cardio', 'None', 'ADVANCE', '3 To 4 sets', '10 to 12 each leg', '5 to 10 minutes', 'Start by standing tall with your feet hip-width apart and your hands on your hips or by your sides. Engage your core muscles to stabilize your body. Take a step back and diagonally across your body with your right foot, placing it behind and to the left of your left foot. Bend both knees and lower your body towards the ground until your front thigh is parallel to the ground and your back knee nearly touches the ground. Keep your torso upright and your chest lifted throughout the movement. Push through your left heel to return to the starting position, bringing your right foot back to meet your left foot. Repeat the movement on the opposite side by stepping back and diagonally across with your left foot. Alternate between legs for the desired number of repetitions, focusing on maintaining proper form and control.', 'https://i.ytimg.com/vi/-rTyKlHjYT8/maxresdefault.jpg', 'https://www.youtube.com/embed/-rTyKlHjYT8?si=6in4i9Vo6iNF99d2', 'Muscle Gain', 'Leg Beginner'),
(286, 'Side Leg Circles (Right Leg)', 'Side leg circles are a Pilates-inspired exercise that targets the muscles of the outer thighs, hips, and glutes. This exercise helps improve hip mobility, stability, and strength in the lower body.', 'Strength', 'Legs', 'None', 'ADVANCE', '3 To 4 sets', '8 to 12 circles in each direction', '5 to 10 minutes', 'Start by lying on your right side with your legs extended and stacked on top of each other. Rest your head on your right arm or place your right hand on the floor in front of you for support. Engage your core muscles to stabilize your body. Lift your left leg slightly off the ground, keeping it straight, and point your toes. Begin to make small circles with your left leg, moving it forward in a clockwise direction. Focus on controlling the movement and keeping your hips stable. After completing the desired number of circles in one direction, reverse the movement and make circles in a counterclockwise direction. Continue to alternate between clockwise and counterclockwise circles for the desired number of repetitions. Keep your movements controlled and maintain proper form throughout the exercise.', 'https://i.ytimg.com/vi/VgysBPnVJWg/sddefault.jpg', 'https://www.youtube.com/embed/VgysBPnVJWg?si=uUhaK1pe4PZIchit', 'Maintain Weight', 'Leg Intermediate'),
(287, 'Side Leg Circles (Right Leg)', 'Side leg circles are a Pilates-inspired exercise that targets the muscles of the outer thighs, hips, and glutes. This exercise helps improve hip mobility, stability, and strength in the lower body.', 'Strength', 'Lower Body', 'None', 'ADVANCE', '3 To 4 sets', '8 to 12 circles in each direction', '5 to 10 minutes', 'Start by lying on your right side with your legs extended and stacked on top of each other. Rest your head on your right arm or place your right hand on the floor in front of you for support. Engage your core muscles to stabilize your body. Lift your left leg slightly off the ground, keeping it straight, and point your toes. Begin to make small circles with your left leg, moving it forward in a clockwise direction. Focus on controlling the movement and keeping your hips stable. After completing the desired number of circles in one direction, reverse the movement and make circles in a counterclockwise direction. Continue to alternate between clockwise and counterclockwise circles for the desired number of repetitions. Keep your movements controlled and maintain proper form throughout the exercise.', 'https://i.ytimg.com/vi/VgysBPnVJWg/sddefault.jpg', 'https://www.youtube.com/embed/VgysBPnVJWg?si=uUhaK1pe4PZIchit', 'Weight Loss', 'Leg Advanced'),
(288, 'Side Leg Circles (Left Leg)', 'Side leg circles are a Pilates-inspired exercise that targets the muscles of the outer thighs, hips, and glutes. This exercise helps improve hip mobility, stability, and strength in the lower body.', 'Strength', 'CORE', 'None', 'ADVANCE', '3 To 4 sets', '8 to 12 circles in each direction', '5 to 10 minutes', 'Start by lying on your left side with your legs extended and stacked on top of each other. Rest your head on your left arm or place your left hand on the floor in front of you for support. Engage your core muscles to stabilize your body. Lift your right leg slightly off the ground, keeping it straight, and point your toes. Begin to make small circles with your right leg, moving it forward in a clockwise direction. Focus on controlling the movement and keeping your hips stable. After completing the desired number of circles in one direction, reverse the movement and make circles in a counterclockwise direction. Continue to alternate between clockwise and counterclockwise circles for the desired number of repetitions. Keep your movements controlled and maintain proper form throughout the exercise.', 'https://i.ytimg.com/vi/VgysBPnVJWg/sddefault.jpg', 'https://www.youtube.com/embed/VgysBPnVJWg?si=uUhaK1pe4PZIchit', 'Weight Loss', 'Leg Intermediate'),
(289, 'Side Leg Circles (Left Leg)', 'Side leg circles are a Pilates-inspired exercise that targets the muscles of the outer thighs, hips, and glutes. This exercise helps improve hip mobility, stability, and strength in the lower body.', 'Strength', 'Upper Body', 'None', 'ADVANCE', '3 To 4 sets', '8 to 12 circles in each direction', '5 to 10 minutes', 'Start by lying on your left side with your legs extended and stacked on top of each other. Rest your head on your left arm or place your left hand on the floor in front of you for support. Engage your core muscles to stabilize your body. Lift your right leg slightly off the ground, keeping it straight, and point your toes. Begin to make small circles with your right leg, moving it forward in a clockwise direction. Focus on controlling the movement and keeping your hips stable. After completing the desired number of circles in one direction, reverse the movement and make circles in a counterclockwise direction. Continue to alternate between clockwise and counterclockwise circles for the desired number of repetitions. Keep your movements controlled and maintain proper form throughout the exercise.', 'https://i.ytimg.com/vi/VgysBPnVJWg/sddefault.jpg', 'https://www.youtube.com/embed/VgysBPnVJWg?si=uUhaK1pe4PZIchit', 'Maintain Weight', 'Leg Advanced'),
(290, 'Glute Kickback (Left Leg)', 'Glute kickbacks are an effective exercise for targeting the gluteal muscles, specifically the gluteus maximus, to help strengthen and tone the buttocks. This exercise also engages the core muscles for stability.', 'Strength', 'Lower Body', 'None', 'ADVANCE', '3 to 4 sets', '10 to 15 reps', '5 to 10 minutes', 'Start on your hands and knees in a tabletop position with your wrists aligned under your shoulders and your knees under your hips. Engage your core muscles to stabilize your spine. Keeping your left knee bent at a 90-degree angle, lift your left leg up and back, extending it straight behind you while keeping your foot flexed. Focus on squeezing your left glute at the top of the movement. Avoid arching your back or rotating your hips. Hold for a moment at the top, then lower your left leg back to the starting position with control. Repeat for the desired number of repetitions. Ensure that your movements are slow and controlled throughout the exercise to maximize muscle engagement and minimize the risk of injury.', 'https://i.ytimg.com/vi/D4gxkgZQkAg/maxresdefault.jpg', 'https://www.youtube.com/embed/D4gxkgZQkAg?si=QYcwKlANcy8ssyz2', 'Weight Loss', 'Leg Advanced'),
(291, 'Glute Kickback (Left Leg)', 'Glute kickbacks are an effective exercise for targeting the gluteal muscles, specifically the gluteus maximus, to help strengthen and tone the buttocks. This exercise also engages the core muscles for stability.', 'Strength', 'Core', 'None', 'ADVANCE', '3 to 4 sets', '10 to 15 reps', '5 to 10 minutes', 'Start on your hands and knees in a tabletop position with your wrists aligned under your shoulders and your knees under your hips. Engage your core muscles to stabilize your spine. Keeping your left knee bent at a 90-degree angle, lift your left leg up and back, extending it straight behind you while keeping your foot flexed. Focus on squeezing your left glute at the top of the movement. Avoid arching your back or rotating your hips. Hold for a moment at the top, then lower your left leg back to the starting position with control. Repeat for the desired number of repetitions. Ensure that your movements are slow and controlled throughout the exercise to maximize muscle engagement and minimize the risk of injury.', 'https://i.ytimg.com/vi/D4gxkgZQkAg/maxresdefault.jpg', 'https://www.youtube.com/embed/D4gxkgZQkAg?si=QYcwKlANcy8ssyz2', 'Maintain Weight', 'Leg Intermediate'),
(292, 'Elliptical Trainer', 'The elliptical trainer is a stationary exercise machine that simulates walking, running, or stair climbing without causing excessive pressure on the joints. It features two foot pedals that move in an elliptical motion, along with handlebars for upper body support and resistance. Elliptical trainers provide a low-impact cardiovascular workout that targets the muscles of the legs, glutes, and upper body.', 'Cardiovascular', 'Cardio', 'Elliptical trainer machine', 'ADVANCE', '', '', '20 to 60 minutes per session', 'Start by adjusting the resistance and incline levels on the elliptical machine to match your fitness level and goals. Step onto the foot pedals and grasp the handlebars with a comfortable grip. Begin pedaling in a smooth and controlled motion, focusing on using both your arms and legs to drive the movement. Keep your posture upright, shoulders relaxed, and core engaged throughout the workout. Vary your speed, resistance, and incline settings to increase or decrease the intensity of your workout. Experiment with forward and reverse pedaling to target different muscle groups and add variety to your routine. Use the built-in heart rate monitor or wear a heart rate monitor to track your intensity and adjust your workout accordingly. Cool down with a few minutes of gentle pedaling at a lower resistance level, followed by stretching to improve flexibility and prevent muscle soreness.', 'https://i.ytimg.com/vi/gmRE8Djo-4M/maxresdefault.jpg', 'https://www.youtube.com/embed/JuIVGB2IBL0?si=rZFaY9OCaDdz4uk', 'Weight Loss', ''),
(293, 'Treadmill Sprints', 'Treadmill sprints are a high-intensity interval training (HIIT) exercise that involves alternating between short bursts of sprinting at maximum effort and periods of active recovery or rest on a treadmill. This workout helps improve cardiovascular fitness, speed, and endurance, while also burning calories and boosting metabolism.', 'Cardiovascular', 'Cardio', 'Treadmill', 'ADVANCE', '', '', '15 to 30 minutes', 'Begin by warming up with a 5-10 minute light jog or brisk walk on the treadmill to prepare your muscles and joints for the sprinting intervals. Once warmed up, increase the speed of the treadmill to a challenging sprinting pace, typically around 80-90% of your maximum effort. Sprint at this high intensity for 20-30 seconds, focusing on driving your knees up and pumping your arms to generate speed. After completing the sprint interval, reduce the speed of the treadmill to a comfortable walking or jogging pace for 1-2 minutes to allow for active recovery. Use this time to catch your breath and lower your heart rate before the next sprint interval. Repeat the cycle of sprinting and recovery for a total of 8-10 intervals, gradually increasing the duration or intensity of the sprints as your fitness level improves. Cool down with a 5-10 minute light jog or walk on the treadmill, followed by stretching to improve flexibility and prevent muscle soreness.', 'https://i.ytimg.com/vi/qSr32pQuUpQ/maxresdefault.jpg', 'https://www.youtube.com/embed/qSr32pQuUpQ?si=VDezj4S4kz1b6z2x', 'Weight Loss', ''),
(294, 'Wall Sit', 'The wall sit is a static exercise that targets the quadriceps, hamstrings, and glutes while also engaging the core muscles for stability. It involves holding a seated position with your back against a wall and your knees bent at a 90-degree angle.', 'Strength', 'Legs', 'Wall ', 'ADVANCE', '3 To 4 sets', '', '30 to 60 seconds per set', 'Start by standing with your back against a wall and your feet shoulder-width apart. Slide your back down the wall until your knees are bent at a 90-degree angle, with your thighs parallel to the ground. Keep your feet flat on the floor and your knees aligned with your ankles. Engage your core muscles to maintain a straight back and avoid arching or rounding your spine. Hold this position for the desired duration, focusing on keeping your thighs parallel to the ground and your weight evenly distributed between both legs. Avoid leaning forward or resting your hands on your thighs. Breathe deeply and evenly throughout the exercise. To release, slowly slide back up the wall to return to a standing position.', 'https://i.ytimg.com/vi/Yp3ZwACK9v4/maxresdefault.jpg', 'https://www.youtube.com/embed/Yp3ZwACK9v4?si=5O8vKEABocQxIF4c', 'Maintain Weight', 'Leg Advanced'),
(295, 'Wall Sit', 'The wall sit is a static exercise that targets the quadriceps, hamstrings, and glutes while also engaging the core muscles for stability. It involves holding a seated position with your back against a wall and your knees bent at a 90-degree angle.', 'Strength', 'Lower Body', 'Wall ', 'ADVANCE', '3 To 4 sets', '', '30 to 60 seconds per set', 'Start by standing with your back against a wall and your feet shoulder-width apart. Slide your back down the wall until your knees are bent at a 90-degree angle, with your thighs parallel to the ground. Keep your feet flat on the floor and your knees aligned with your ankles. Engage your core muscles to maintain a straight back and avoid arching or rounding your spine. Hold this position for the desired duration, focusing on keeping your thighs parallel to the ground and your weight evenly distributed between both legs. Avoid leaning forward or resting your hands on your thighs. Breathe deeply and evenly throughout the exercise. To release, slowly slide back up the wall to return to a standing position.', 'https://i.ytimg.com/vi/Yp3ZwACK9v4/maxresdefault.jpg', 'https://www.youtube.com/embed/Yp3ZwACK9v4?si=5O8vKEABocQxIF4c', 'Muscle Gain', 'Leg Advanced'),
(296, 'Left Quad Stretch with Wall', 'The left quad stretch with a wall is a static stretch that targets the quadriceps muscles of the left leg. It helps improve flexibility and mobility in the front of the thigh.', 'Flexibility', 'Legs', 'Wall ', 'ADVANCE', '1 to 2 sets ', '', '30 to 60 seconds', 'Start by standing upright facing a wall, with your feet hip-width apart. Place your left hand on the wall for support. Bend your left knee and lift your left foot towards your buttocks, reaching back with your left hand to grasp your left ankle or foot. Keep your knees close together and your thighs parallel. Gently pull your left foot towards your buttocks until you feel a stretch in the front of your left thigh. Keep your torso upright and avoid arching your back. Hold the stretch for 30-60 seconds, breathing deeply and maintaining a steady stretch. Release the stretch and repeat on the opposite side.', 'https://i.ytimg.com/vi/TfcRyYf7WLg/maxresdefault.jpg', 'https://www.youtube.com/embed/TfcRyYf7WLg?si=Y0KutAoAwEKm_Jep', 'Maintain Weight', 'Leg Beginner'),
(297, 'Right Quad Stretch with Wall', 'The right quad stretch with a wall is a static stretch that targets the quadriceps muscles of the right leg. It helps improve flexibility and mobility in the front of the thigh.', 'Flexibility', 'Legs', 'Wall ', 'ADVANCE', '1 to 2 sets ', '', '30 to 60 seconds', 'Start by standing upright facing a wall, with your feet hip-width apart. Place your right hand on the wall for support. Bend your right knee and lift your right foot towards your buttocks, reaching back with your right hand to grasp your right ankle or foot. Keep your knees close together and your thighs parallel. Gently pull your right foot towards your buttocks until you feel a stretch in the front of your right thigh. Keep your torso upright and avoid arching your back. Hold the stretch for 30-60 seconds, breathing deeply and maintaining a steady stretch. Release the stretch and repeat on the opposite side.', 'https://i.ytimg.com/vi/TfcRyYf7WLg/maxresdefault.jpg', 'https://www.youtube.com/embed/TfcRyYf7WLg?si=Y0KutAoAwEKm_Jep', 'Muscle Gain', 'Leg Beginner'),
(298, 'Leaning Stretcher Raises', 'Leaning stretcher raises are an exercise targeting the lower back muscles, specifically the erector spinae, to improve strength and stability in the lumbar spine.', 'Strength', 'Lower Body', 'None', 'BEGINNER', '3 to 4 sets', '10 to 15 reps', '5 to 10 minutes', 'Start by standing with your feet shoulder-width apart and your hands resting on your hips or hanging by your sides. Engage your core muscles to stabilize your spine. Lean forward from your hips while keeping your back straight, allowing your upper body to come parallel to the ground. Keep your knees slightly bent to prevent strain on your lower back. Once in this position, slowly raise your torso back up to the starting position by contracting your lower back muscles. Focus on using your lower back muscles to lift your upper body while keeping your spine neutral. Avoid arching your back or using momentum to lift your torso. Lower back down with control and repeat for the desired number of repetitions.', 'https://i.ytimg.com/vi/qQ-StR-AXzM/maxresdefault.jpg', 'https://www.youtube.com/embed/qQ-StR-AXzM?si=cRZF5jcZdUhybrpy', 'Maintain Weight', 'Leg Intermediate'),
(299, 'Hyperextensions', 'Hyperextensions, also known as back extensions, are a strength training exercise targeting the lower back muscles, specifically the erector spinae, as well as the glutes and hamstrings. This exercise helps improve spinal stability and strengthens the muscles of the posterior chain.', 'Strength', 'Lower Body', 'None', 'ADVANCE', '3 to 4 sets', '10 to 15 reps', '5 to 10 minutes', 'Start by positioning yourself face down on a hyperextension bench or Roman chair, with your hips resting at the edge of the pad and your feet secured under the footpads or held by a partner. Your thighs should be supported by the pads of the bench, and your upper body should hang freely. Place your hands either behind your head or crossed over your chest. Engage your core muscles to stabilize your spine. Slowly lift your torso up by contracting your lower back muscles until your body forms a straight line from your head to your heels. Avoid hyperextending your spine or arching your back excessively. Hold the top position briefly, then lower your torso back down with control. Repeat for the desired number of repetitions, focusing on maintaining proper form and control throughout the movement.', 'https://i.ytimg.com/vi/W9y8xq4Ya_E/maxresdefault.jpg', 'https://www.youtube.com/embed/W9y8xq4Ya_E?si=I4wysk3bDN7IdO4W', 'Maintain Weight', 'Shoulder & Back Advanced'),
(300, 'Pike Push-Ups', 'Pike push-ups are a bodyweight exercise that targets the shoulders, triceps, and chest muscles. This exercise is a variation of the traditional push-up and places greater emphasis on the shoulders and upper chest.', 'Strength', 'Upper Body', 'None', 'ADVANCE', '3 to 4 sets', '8 to 12 reps', '5 to 10 minutes', 'Start in a plank position with your hands shoulder-width apart and your wrists directly under your shoulders. Lift your hips up towards the ceiling, forming an inverted V shape with your body. Your feet should be hip-width apart, and your heels should be pressing towards the ground. Engage your core muscles to stabilize your body. Lower your upper body towards the ground by bending your elbows, allowing your head to move towards the floor. Keep your elbows pointing back, rather than flaring out to the sides. Lower until your head is between your hands or as far as comfortable, then press back up to the starting position by straightening your arms. Focus on maintaining a straight line from your wrists to your hips throughout the movement. Keep your core engaged and avoid sagging or arching your back. Repeat for the desired number of repetitions, focusing on controlled and steady movements.', 'https://i.ytimg.com/vi/Q2koXI9jphI/maxresdefault.jpg', 'https://www.youtube.com/embed/Q2koXI9jphI?si=j0qTA15usFsxxu31', 'Maintain Weight', 'Shoulder & Back Advanced'),
(301, 'Pike Push-Ups', 'Pike push-ups are a bodyweight exercise that targets the shoulders, triceps, and chest muscles. This exercise is a variation of the traditional push-up and places greater emphasis on the shoulders and upper chest.', 'Strength', 'Core', 'None', 'ADVANCE', '3 to 4 sets', '8 to 12 reps', '5 to 10 minutes', 'Start in a plank position with your hands shoulder-width apart and your wrists directly under your shoulders. Lift your hips up towards the ceiling, forming an inverted V shape with your body. Your feet should be hip-width apart, and your heels should be pressing towards the ground. Engage your core muscles to stabilize your body. Lower your upper body towards the ground by bending your elbows, allowing your head to move towards the floor. Keep your elbows pointing back, rather than flaring out to the sides. Lower until your head is between your hands or as far as comfortable, then press back up to the starting position by straightening your arms. Focus on maintaining a straight line from your wrists to your hips throughout the movement. Keep your core engaged and avoid sagging or arching your back. Repeat for the desired number of repetitions, focusing on controlled and steady movements.', 'https://i.ytimg.com/vi/Q2koXI9jphI/maxresdefault.jpg', 'https://www.youtube.com/embed/Q2koXI9jphI?si=j0qTA15usFsxxu31', 'Maintain Weight', 'Shoulder & Back Advanced'),
(302, 'Agility Ladder Drills', 'Agility ladder drills are a series of exercises performed using a ladder-shaped agility ladder to improve footwork, coordination, agility, and speed. These drills involve various movements such as side steps, high knees, shuffles, and hops, performed while stepping in and out of the ladder rungs in a specific pattern.', 'Cardiovascular', 'Lower Body', 'Agility Ladder', 'BEGINNER', '', '', '10 to 20 minutes per session', 'Lay the agility ladder flat on the ground in a clear space. Stand at one end of the ladder with your feet together and your arms relaxed by your sides. Begin with a light warm-up to prepare your muscles and joints for the drills. Start with basic drills such as forward runs, lateral shuffles, and high knees, gradually increasing the intensity and complexity as you become more proficient. Focus on maintaining proper form, staying light on your feet, and moving quickly and efficiently through the ladder rungs. Keep your eyes forward and your core engaged to stabilize your body. Perform each drill for 20-30 seconds, then rest for 10-20 seconds before moving on to the next drill. Repeat for several rounds or until you complete the desired duration of the workout.', 'https://i.ytimg.com/vi/7NeGJABh_yM/maxresdefault.jpg', 'https://www.youtube.com/embed/4WJhhSJCg9Q?si=qQc1Oc6CdjLWilC4', 'Weight Loss', 'Shoulder & Back Advanced'),
(303, 'Agility Ladder Drills', 'Agility ladder drills are a series of exercises performed using a ladder-shaped agility ladder to improve footwork, coordination, agility, and speed. These drills involve various movements such as side steps, high knees, shuffles, and hops, performed while stepping in and out of the ladder rungs in a specific pattern.', 'Cardiovascular', 'Cardio', 'Agility Ladder', 'BEGINNER', '', '', '10 to 20 minutes per session', 'Lay the agility ladder flat on the ground in a clear space. Stand at one end of the ladder with your feet together and your arms relaxed by your sides. Begin with a light warm-up to prepare your muscles and joints for the drills. Start with basic drills such as forward runs, lateral shuffles, and high knees, gradually increasing the intensity and complexity as you become more proficient. Focus on maintaining proper form, staying light on your feet, and moving quickly and efficiently through the ladder rungs. Keep your eyes forward and your core engaged to stabilize your body. Perform each drill for 20-30 seconds, then rest for 10-20 seconds before moving on to the next drill. Repeat for several rounds or until you complete the desired duration of the workout.', 'https://i.ytimg.com/vi/7NeGJABh_yM/maxresdefault.jpg', 'https://www.youtube.com/embed/4WJhhSJCg9Q?si=qQc1Oc6CdjLWilC4', 'Maintain Weight', 'Shoulder & Back Advanced'),
(304, 'Kickboxing', 'Kickboxing is a high-intensity workout that combines elements of boxing, martial arts, and cardiovascular exercises. It involves punching, kicking, knee strikes, and elbow strikes performed in combination with aerobic movements to improve cardiovascular fitness, muscle strength, endurance, and coordination.', 'Cardiovascular', 'Upper Body', 'Boxing Gloves, Punching Bag or Partner', 'ADVANCE', '', '', '30 to 60 minutes per session', 'Start with a dynamic warm-up to prepare your body for the workout, including jogging in place, jumping jacks, arm circles, and leg swings. Begin the kickboxing workout with basic punches and kicks, such as jabs, crosses, front kicks, and roundhouse kicks, focusing on proper technique and form. Gradually increase the intensity and speed of your movements as you become more comfortable with the techniques. Incorporate combinations of punches and kicks, as well as defensive moves such as blocks and evasions, to simulate a real kickboxing match. Use a punching bag or focus pads for striking practice, or partner up with a training buddy for pad work and sparring drills. Cool down with static stretches to improve flexibility and prevent muscle soreness.', 'https://i.ytimg.com/vi/4fao_RUnPXk/maxresdefault.jpg', 'https://www.youtube.com/embed/4fao_RUnPXk?si=k3w9uFox6kD7JS2R', 'Weight Loss', 'Shoulder & Back Advanced');
INSERT INTO `exercises` (`ExerciseID`, `ExerciseName`, `Description`, `CategoryID`, `PartOfBody`, `EquipmentID`, `Difficulty`, `set`, `reps`, `duration`, `Instructions`, `ImageURL`, `VideoURL`, `Goal`, `Workoutset`) VALUES
(305, 'Stair Climbing', 'Stair climbing is a cardiovascular exercise that involves ascending and descending flights of stairs to improve cardiovascular fitness, leg strength, and endurance. It can be performed indoors on staircases or stair machines, or outdoors on hills or stadium stairs.', 'Cardiovascular', 'Lower Body', 'Stairs', 'BEGINNER', '', '', '20 to 60 minutes per session', 'Start with a light warm-up to prepare your muscles and joints for the exercise, including dynamic stretches or a few minutes of walking or jogging. Begin by climbing stairs at a moderate pace, using the handrail for support if needed. Focus on using proper form, keeping your back straight, and engaging your core muscles as you climb. Use the entire foot to push off and step up onto each stair, rather than just using the toes. As you become more comfortable with the movement, gradually increase the intensity by picking up the pace or adding intervals of stair sprints. For outdoor stair climbing, choose a set of stairs with a manageable height and incline, and be mindful of safety precautions such as wearing appropriate footwear and staying hydrated. Cool down with a few minutes of walking or light stretching to help prevent muscle soreness.', 'https://i.ytimg.com/vi/olZUnp04JwA/maxresdefault.jpg', 'https://www.youtube.com/embed/gzj4980UvzY?si=tTraMHS0Yg4Errf_', 'Weight Loss', 'Shoulder & Back Advanced'),
(306, 'Side Shuffle', 'Side shuffle, also known as lateral shuffle or side-to-side shuffle, is a lateral movement exercise that improves agility, coordination, and lower body strength. It involves shuffling laterally from side to side while maintaining a low stance and quick footwork.', 'Cardiovascular', 'Lower Body', 'None', 'INTERMEDIATE', '', '', '20 to 30 minutes', 'Start in an athletic stance with your feet shoulder-width apart and your knees slightly bent. Keep your chest up, shoulders back, and core engaged throughout the exercise. Begin the movement by stepping laterally to one side, leading with your outside foot. Push off forcefully with the outside foot and bring the inside foot in to meet it, shuffling across the floor in a controlled manner. Stay light on your feet and maintain a low stance to maximize agility and speed. Keep your hips square and facing forward throughout the shuffle, avoiding excessive rotation of the torso. Continue shuffling laterally from side to side for the desired duration or distance. Focus on maintaining proper form and a steady rhythm throughout the exercise.', 'https://i.ytimg.com/vi/DwHiXO5ps_I/maxresdefault.jpg', 'https://www.youtube.com/embed/DwHiXO5ps_I?si=8d7YVcqtlgKst8E_', 'Weight Loss', ''),
(307, 'Skaters', 'Skaters, also known as lateral jumps or side-to-side jumps, are a plyometric exercise that targets the lower body and improves agility, balance, and explosive power. It involves jumping laterally from side to side, landing on one foot while swinging the opposite leg behind, mimicking the movement of a speed skater.', 'Cardiovascular', 'Lower Body', 'None', 'INTERMEDIATE', '', '', '20 to 30 minutes', 'Start in a standing position with your feet hip-width apart and your knees slightly bent. Keep your chest up, shoulders back, and core engaged throughout the exercise. Begin the movement by jumping laterally to one side, pushing off forcefully with both feet. Land softly on the outside foot, bending the knee to absorb the impact and keeping the opposite leg extended behind you for balance. Swing your arms across your body to help generate momentum and maintain balance. Immediately push off with the outside foot and jump laterally to the opposite side, landing softly on the other foot and swinging the opposite leg behind. Continue alternating sides in a fluid motion, jumping as far and as quickly as possible while maintaining control and balance. Focus on landing softly and absorbing the impact with each jump to reduce stress on the joints.', 'https://i.ytimg.com/vi/4RuxhVJ4-pg/maxresdefault.jpg', 'https://www.youtube.com/embed/4RuxhVJ4-pg?si=Z2wewaPkRcYj5GzD', 'Weight Loss', ''),
(308, 'Butt Kicks', 'Butt kicks are a dynamic warm-up exercise that targets the muscles of the legs, particularly the quadriceps and hamstrings. This exercise involves bringing the heels up towards the glutes in a rapid and continuous motion, similar to running in place, while focusing on quick footwork and maintaining an upright posture.', 'Cardiovascular', 'Lower Body', 'None', 'BEGINNER', '', '', '20 to 30 minutes', 'Start in a standing position with your feet hip-width apart and your arms relaxed by your sides. Engage your core muscles to stabilize your spine and maintain good posture throughout the exercise. Begin the movement by jogging in place, lifting your heels up towards your glutes with each step. Focus on bringing your heels as close to your buttocks as possible while maintaining a brisk and rhythmic pace. Keep your knees pointing downwards and your hips stable throughout the exercise. Swing your arms naturally in coordination with your leg movements to enhance the cardiovascular benefits. Continue to jog in place with butt kicks for the desired duration, breathing steadily and focusing on maintaining a consistent pace.', 'https://i.ytimg.com/vi/vXVPvY1UbJI/sddefault.jpg', 'https://www.youtube.com/embed/vXVPvY1UbJI?si=bo17ta7ybAuaHIwM', 'Weight Loss', ''),
(309, 'High Knees', 'High knees are a dynamic warm-up exercise that targets the muscles of the lower body, including the quadriceps, hamstrings, and hip flexors. This exercise involves lifting the knees up towards the chest in a rapid and alternating motion while jogging in place, focusing on quick footwork and maintaining an upright posture.', 'Cardiovascular', 'Lower Body', 'None', 'BEGINNER', '', '', '20 to 30 minutes', 'Start in a standing position with your feet hip-width apart and your arms relaxed by your sides. Engage your core muscles to stabilize your spine and maintain good posture throughout the exercise. Begin the movement by jogging in place, lifting your knees up towards your chest with each step. Focus on bringing your knees as high as possible while maintaining a brisk and rhythmic pace. Keep your torso upright and avoid leaning back or hunching forward. Swing your arms naturally in coordination with your leg movements to enhance the cardiovascular benefits. Continue to jog in place with high knees for the desired duration, breathing steadily and focusing on maintaining a consistent pace.', 'https://i.ytimg.com/vi/tx5rgpDAJRI/maxresdefault.jpg', 'https://www.youtube.com/embed/tx5rgpDAJRI?si=d936eVg43XYyUx9m', 'Weight Loss', ''),
(310, 'Elliptical Trainer', 'The elliptical trainer is a stationary exercise machine that simulates walking, running, or stair climbing without causing excessive pressure on the joints. It features two foot pedals that move in an elliptical motion, along with handlebars for upper body support and resistance. Elliptical trainers provide a low-impact cardiovascular workout that targets the muscles of the legs, glutes, and upper body.', 'Cardiovascular', 'Lower Body', 'Elliptical trainer machine', 'ADVANCE', '', '', '20 to 60 minutes per session', 'Start by adjusting the resistance and incline levels on the elliptical machine to match your fitness level and goals. Step onto the foot pedals and grasp the handlebars with a comfortable grip. Begin pedaling in a smooth and controlled motion, focusing on using both your arms and legs to drive the movement. Keep your posture upright, shoulders relaxed, and core engaged throughout the workout. Vary your speed, resistance, and incline settings to increase or decrease the intensity of your workout. Experiment with forward and reverse pedaling to target different muscle groups and add variety to your routine. Use the built-in heart rate monitor or wear a heart rate monitor to track your intensity and adjust your workout accordingly. Cool down with a few minutes of gentle pedaling at a lower resistance level, followed by stretching to improve flexibility and prevent muscle soreness.', 'https://i.ytimg.com/vi/gmRE8Djo-4M/maxresdefault.jpg', 'https://www.youtube.com/embed/JuIVGB2IBL0?si=rZFaY9OCaDdz4uk', 'Weight Loss', ''),
(311, 'Treadmill Sprints', 'Treadmill sprints are a high-intensity interval training (HIIT) exercise that involves alternating between short bursts of sprinting at maximum effort and periods of active recovery or rest on a treadmill. This workout helps improve cardiovascular fitness, speed, and endurance, while also burning calories and boosting metabolism.', 'Cardiovascular', 'Lower Body', 'Treadmill', 'ADVANCE', '', '', '15 to 30 minutes', 'Begin by warming up with a 5-10 minute light jog or brisk walk on the treadmill to prepare your muscles and joints for the sprinting intervals. Once warmed up, increase the speed of the treadmill to a challenging sprinting pace, typically around 80-90% of your maximum effort. Sprint at this high intensity for 20-30 seconds, focusing on driving your knees up and pumping your arms to generate speed. After completing the sprint interval, reduce the speed of the treadmill to a comfortable walking or jogging pace for 1-2 minutes to allow for active recovery. Use this time to catch your breath and lower your heart rate before the next sprint interval. Repeat the cycle of sprinting and recovery for a total of 8-10 intervals, gradually increasing the duration or intensity of the sprints as your fitness level improves. Cool down with a 5-10 minute light jog or walk on the treadmill, followed by stretching to improve flexibility and prevent muscle soreness.', 'https://i.ytimg.com/vi/qSr32pQuUpQ/maxresdefault.jpg', 'https://www.youtube.com/embed/qSr32pQuUpQ?si=VDezj4S4kz1b6z2x', 'Weight Loss', ''),
(312, 'Skaters', 'Skaters, also known as lateral jumps or side-to-side jumps, are a plyometric exercise that targets the lower body and improves agility, balance, and explosive power. It involves jumping laterally from side to side, landing on one foot while swinging the opposite leg behind, mimicking the movement of a speed skater.', 'Cardiovascular', 'Upper Body', 'None', 'INTERMEDIATE', '', '', '20 to 30 minutes', 'Start in a standing position with your feet hip-width apart and your knees slightly bent. Keep your chest up, shoulders back, and core engaged throughout the exercise. Begin the movement by jumping laterally to one side, pushing off forcefully with both feet. Land softly on the outside foot, bending the knee to absorb the impact and keeping the opposite leg extended behind you for balance. Swing your arms across your body to help generate momentum and maintain balance. Immediately push off with the outside foot and jump laterally to the opposite side, landing softly on the other foot and swinging the opposite leg behind. Continue alternating sides in a fluid motion, jumping as far and as quickly as possible while maintaining control and balance. Focus on landing softly and absorbing the impact with each jump to reduce stress on the joints.', 'https://i.ytimg.com/vi/4RuxhVJ4-pg/maxresdefault.jpg', 'https://www.youtube.com/embed/4RuxhVJ4-pg?si=Z2wewaPkRcYj5GzD', 'Weight Loss', ''),
(313, 'Skaters', 'Skaters, also known as lateral jumps or side-to-side jumps, are a plyometric exercise that targets the lower body and improves agility, balance, and explosive power. It involves jumping laterally from side to side, landing on one foot while swinging the opposite leg behind, mimicking the movement of a speed skater.', 'Cardiovascular', 'Legs', 'None', 'INTERMEDIATE', '', '', '20 to 30 minutes', 'Start in a standing position with your feet hip-width apart and your knees slightly bent. Keep your chest up, shoulders back, and core engaged throughout the exercise. Begin the movement by jumping laterally to one side, pushing off forcefully with both feet. Land softly on the outside foot, bending the knee to absorb the impact and keeping the opposite leg extended behind you for balance. Swing your arms across your body to help generate momentum and maintain balance. Immediately push off with the outside foot and jump laterally to the opposite side, landing softly on the other foot and swinging the opposite leg behind. Continue alternating sides in a fluid motion, jumping as far and as quickly as possible while maintaining control and balance. Focus on landing softly and absorbing the impact with each jump to reduce stress on the joints.', 'https://i.ytimg.com/vi/4RuxhVJ4-pg/maxresdefault.jpg', 'https://www.youtube.com/embed/4RuxhVJ4-pg?si=Z2wewaPkRcYj5GzD', 'Weight Loss', ''),
(314, 'Treadmill Sprints', 'Treadmill sprints are a high-intensity interval training (HIIT) exercise that involves alternating between short bursts of sprinting at maximum effort and periods of active recovery or rest on a treadmill. This workout helps improve cardiovascular fitness, speed, and endurance, while also burning calories and boosting metabolism.', 'Cardiovascular', 'Legs', 'Treadmill', 'ADVANCE', '', '', '15 to 30 minutes', 'Begin by warming up with a 5-10 minute light jog or brisk walk on the treadmill to prepare your muscles and joints for the sprinting intervals. Once warmed up, increase the speed of the treadmill to a challenging sprinting pace, typically around 80-90% of your maximum effort. Sprint at this high intensity for 20-30 seconds, focusing on driving your knees up and pumping your arms to generate speed. After completing the sprint interval, reduce the speed of the treadmill to a comfortable walking or jogging pace for 1-2 minutes to allow for active recovery. Use this time to catch your breath and lower your heart rate before the next sprint interval. Repeat the cycle of sprinting and recovery for a total of 8-10 intervals, gradually increasing the duration or intensity of the sprints as your fitness level improves. Cool down with a 5-10 minute light jog or walk on the treadmill, followed by stretching to improve flexibility and prevent muscle soreness.', 'https://i.ytimg.com/vi/qSr32pQuUpQ/maxresdefault.jpg', 'https://www.youtube.com/embed/qSr32pQuUpQ?si=VDezj4S4kz1b6z2x', 'Weight Loss', ''),
(315, 'High Knees', 'High knees are a dynamic warm-up exercise that targets the muscles of the lower body, including the quadriceps, hamstrings, and hip flexors. This exercise involves lifting the knees up towards the chest in a rapid and alternating motion while jogging in place, focusing on quick footwork and maintaining an upright posture.', 'Cardiovascular', 'Legs', 'None', 'BEGINNER', '', '', '20 to 30 minutes', 'Start in a standing position with your feet hip-width apart and your arms relaxed by your sides. Engage your core muscles to stabilize your spine and maintain good posture throughout the exercise. Begin the movement by jogging in place, lifting your knees up towards your chest with each step. Focus on bringing your knees as high as possible while maintaining a brisk and rhythmic pace. Keep your torso upright and avoid leaning back or hunching forward. Swing your arms naturally in coordination with your leg movements to enhance the cardiovascular benefits. Continue to jog in place with high knees for the desired duration, breathing steadily and focusing on maintaining a consistent pace.', 'https://i.ytimg.com/vi/tx5rgpDAJRI/maxresdefault.jpg', 'https://www.youtube.com/embed/tx5rgpDAJRI?si=d936eVg43XYyUx9m', 'Weight Loss', ''),
(316, 'Butt Kicks', 'Butt kicks are a dynamic warm-up exercise that targets the muscles of the legs, particularly the quadriceps and hamstrings. This exercise involves bringing the heels up towards the glutes in a rapid and continuous motion, similar to running in place, while focusing on quick footwork and maintaining an upright posture.', 'Cardiovascular', 'Legs', 'None', 'BEGINNER', '', '', '20 to 30 minutes', 'Start in a standing position with your feet hip-width apart and your arms relaxed by your sides. Engage your core muscles to stabilize your spine and maintain good posture throughout the exercise. Begin the movement by jogging in place, lifting your heels up towards your glutes with each step. Focus on bringing your heels as close to your buttocks as possible while maintaining a brisk and rhythmic pace. Keep your knees pointing downwards and your hips stable throughout the exercise. Swing your arms naturally in coordination with your leg movements to enhance the cardiovascular benefits. Continue to jog in place with butt kicks for the desired duration, breathing steadily and focusing on maintaining a consistent pace.', 'https://i.ytimg.com/vi/vXVPvY1UbJI/sddefault.jpg', 'https://www.youtube.com/embed/vXVPvY1UbJI?si=bo17ta7ybAuaHIwM', 'Weight Loss', ''),
(317, 'Stair Climbing', 'Stair climbing is a cardiovascular exercise that involves ascending and descending flights of stairs to improve cardiovascular fitness, leg strength, and endurance. It can be performed indoors on staircases or stair machines, or outdoors on hills or stadium stairs.', 'Cardiovascular', 'Legs', 'Stairs', 'BEGINNER', '', '', '20 to 60 minutes per session', 'Start with a light warm-up to prepare your muscles and joints for the exercise, including dynamic stretches or a few minutes of walking or jogging. Begin by climbing stairs at a moderate pace, using the handrail for support if needed. Focus on using proper form, keeping your back straight, and engaging your core muscles as you climb. Use the entire foot to push off and step up onto each stair, rather than just using the toes. As you become more comfortable with the movement, gradually increase the intensity by picking up the pace or adding intervals of stair sprints. For outdoor stair climbing, choose a set of stairs with a manageable height and incline, and be mindful of safety precautions such as wearing appropriate footwear and staying hydrated. Cool down with a few minutes of walking or light stretching to help prevent muscle soreness.', 'https://i.ytimg.com/vi/olZUnp04JwA/maxresdefault.jpg', 'https://www.youtube.com/embed/gzj4980UvzY?si=tTraMHS0Yg4Errf_', 'Weight Loss', ''),
(318, 'Side Shuffle', 'Side shuffle, also known as lateral shuffle or side-to-side shuffle, is a lateral movement exercise that improves agility, coordination, and lower body strength. It involves shuffling laterally from side to side while maintaining a low stance and quick footwork.', 'Cardiovascular', 'Legs', 'None', 'INTERMEDIATE', '', '', '20 to 30 minutes', 'Start in an athletic stance with your feet shoulder-width apart and your knees slightly bent. Keep your chest up, shoulders back, and core engaged throughout the exercise. Begin the movement by stepping laterally to one side, leading with your outside foot. Push off forcefully with the outside foot and bring the inside foot in to meet it, shuffling across the floor in a controlled manner. Stay light on your feet and maintain a low stance to maximize agility and speed. Keep your hips square and facing forward throughout the shuffle, avoiding excessive rotation of the torso. Continue shuffling laterally from side to side for the desired duration or distance. Focus on maintaining proper form and a steady rhythm throughout the exercise.', 'https://i.ytimg.com/vi/DwHiXO5ps_I/maxresdefault.jpg', 'https://www.youtube.com/embed/DwHiXO5ps_I?si=8d7YVcqtlgKst8E_', 'Weight Loss', ''),
(319, 'Cobra Stretch', 'The cobra stretch involves lying face down on the floor and lifting the chest while keeping the hips and lower body grounded. This movement resembles the raised hood of a cobra, hence the name.', 'Flexibility', 'Lower Body', 'None', 'BEGINNER', '', '', '30 to 60 seconds', 'Lie face down on the floor with legs extended and feet hip-width apart. Place palms on the floor under shoulders. Inhale and lift chest and head off the floor, keeping hips grounded. Keep shoulders relaxed, lengthen spine, and engage core. Hold for 15-30 seconds, breathing deeply. Exhale and lower chest and head back down to the floor.', 'https://cdn.yogajournal.com/wp-content/uploads/2022/06/Upward-Facing-Dog-Mod-1_Andrew-Clark-e1670972827524.jpg', 'https://www.youtube.com/embed/Nd3j6Avtv6Q?si=tVt4ZtaqieQ2gtbs', 'Weight Loss', 'Abs Intermediate'),
(320, 'Arm Raises', 'Arm raises are a simple yet effective exercise targeting the deltoid muscles of the shoulders. This exercise can be performed with or without weights, making it suitable for individuals of all fitness levels. Arm raises help strengthen the shoulders, improve shoulder stability, and enhance overall upper body strength.', 'Strength', 'Upper Body', 'None', 'BEGINNER', '2 to 3 sets', '10 to 12 reps', '5 to 10 minutes', 'To perform arm raises, stand with feet shoulder-width apart, holding dumbbells in each hand with palms facing inward. Keeping arms straight, raise them sideways until parallel to the floor. Hold briefly, then lower back down. Repeat for desired reps.', 'https://i.ytimg.com/vi/Bqvmyni_sKQ/sddefault.jpg', 'https://www.youtube.com/embed/Bqvmyni_sKQ?si=PlYcuA7B0t3sCzNT', 'Maintain Weight', 'Arm Beginner'),
(321, 'Side Arm Raises', 'Side arm raises are an exercise targeting the deltoid muscles of the shoulders. They can be done with dumbbells or resistance bands and are effective for strengthening the shoulders and improving overall upper body strength and stability.', 'Strength', 'Upper Body', 'None', 'BEGINNER', '2 to 3 sets', '10 to 12 reps', '5 to 10 minutes', 'To perform side arm raises, stand with feet shoulder-width apart, holding dumbbells by your sides. Raise arms out to the sides until parallel to the floor, then lower back down. Repeat for desired reps, ensuring proper form.', 'https://i.ytimg.com/vi/YslHgg2E-Ro/sddefault.jpg', 'https://www.youtube.com/embed/YslHgg2E-Ro?si=otqF8P7XTt6hWEg1', 'Muscle Gain', 'Arm Beginner'),
(322, 'Arm Raises', 'Arm raises are a simple yet effective exercise targeting the deltoid muscles of the shoulders. This exercise can be performed with or without weights, making it suitable for individuals of all fitness levels. Arm raises help strengthen the shoulders, improve shoulder stability, and enhance overall upper body strength.', 'Strength', 'Upper Body', 'None', 'BEGINNER', '2 to 3 sets', '10 to 12 reps', '5 to 10 minutes', 'To perform arm raises, stand with feet shoulder-width apart, holding dumbbells in each hand with palms facing inward. Keeping arms straight, raise them sideways until parallel to the floor. Hold briefly, then lower back down. Repeat for desired reps.', 'https://i.ytimg.com/vi/Bqvmyni_sKQ/sddefault.jpg', 'https://www.youtube.com/embed/Bqvmyni_sKQ?si=PlYcuA7B0t3sCzNT', 'Muscle Gain', 'Shoulder & Back Beginner'),
(323, 'Side Arm Raises', 'Side arm raises are an exercise targeting the deltoid muscles of the shoulders. They can be done with dumbbells or resistance bands and are effective for strengthening the shoulders and improving overall upper body strength and stability.', 'Strength', 'Upper Body', 'None', 'BEGINNER', '2 to 3 sets', '10 to 12 reps', '5 to 10 minutes', 'To perform side arm raises, stand with feet shoulder-width apart, holding dumbbells by your sides. Raise arms out to the sides until parallel to the floor, then lower back down. Repeat for desired reps, ensuring proper form.', 'https://i.ytimg.com/vi/YslHgg2E-Ro/sddefault.jpg', 'https://www.youtube.com/embed/YslHgg2E-Ro?si=otqF8P7XTt6hWEg1', 'Maintain Weight', 'Back Beginner'),
(324, 'Punches', 'Punches are a dynamic exercise that primarily targets the muscles of the arms, shoulders, chest, and core. This exercise helps improve upper body strength, endurance, and coordination.', 'Strength', 'Upper Body', 'None', 'BEGINNER', '3 to 4 sets', '20 to 30 reps', '10 to 15 minutes', 'Stand with your feet shoulder-width apart and your knees slightly bent. Keep your core engaged and your shoulders relaxed. Make a fist with each hand and bring your fists up to shoulder height, elbows bent and close to your sides. Begin punching forward with one arm at a time, extending your arm fully and twisting your torso slightly to generate power. As you punch with one arm, retract the other arm back to the starting position. Continue alternating punches between your left and right arms, moving at a steady pace. You can vary the speed and intensity of the punches based on your fitness level and goals.', 'https://i.ytimg.com/vi/reeBHtZJ1ts/maxresdefault.jpg', 'https://www.youtube.com/embed/reeBHtZJ1ts?si=LywLXQmyCV-JLhN0', 'Weight Loss', 'Arm Beginner'),
(325, 'Punches', 'Punches are a dynamic exercise that primarily targets the muscles of the arms, shoulders, chest, and core. This exercise helps improve upper body strength, endurance, and coordination.', 'Cardiovascular', 'Upper Body', 'None', 'BEGINNER', '3 to 4 sets', '20 to 30 reps', '10 to 15 minutes', 'Stand with your feet shoulder-width apart and your knees slightly bent. Keep your core engaged and your shoulders relaxed. Make a fist with each hand and bring your fists up to shoulder height, elbows bent and close to your sides. Begin punching forward with one arm at a time, extending your arm fully and twisting your torso slightly to generate power. As you punch with one arm, retract the other arm back to the starting position. Continue alternating punches between your left and right arms, moving at a steady pace. You can vary the speed and intensity of the punches based on your fitness level and goals.', 'https://i.ytimg.com/vi/reeBHtZJ1ts/maxresdefault.jpg', 'https://www.youtube.com/embed/reeBHtZJ1ts?si=LywLXQmyCV-JLhN0', 'Weight Loss', 'Arm Beginner'),
(326, 'Push-Up', 'A classic bodyweight exercise that targets the chest, shoulders, and triceps', 'Strength', 'Upper Body', 'None', 'BEGINNER', '2 to 3 sets', '8 to 12 reps per set', '5 minutes', 'Start in a plank position with your hands slightly wider than shoulder-width apart, arms fully extended, and your body forming a straight line from head to heels. Engage your core and glutes to maintain a stable position. Lower your body towards the floor by bending your elbows, keeping them close to your sides. Lower yourself until your chest nearly touches the ground or you reach a comfortable depth. Press through your palms to extend your arms and return to the starting position. Keep your body in a straight line throughout the movement, avoiding sagging or arching your back. Repeat for the desired number of repetitions.', 'https://www.inspireusafoundation.org/wp-content/uploads/2023/07/plank-benefits.png', 'https://www.youtube.com/embed/R08gYyypGto?si=pqF7riN58nDrOM3u', 'Muscle Gain', 'Arm Beginner'),
(327, 'Push-Up', 'A classic bodyweight exercise that targets the chest, shoulders, and triceps', 'Strength', 'Upper Body', 'None', 'BEGINNER', '2 to 3 sets', '8 to 12 reps per set', '5 minutes', 'Start in a plank position with your hands slightly wider than shoulder-width apart, arms fully extended, and your body forming a straight line from head to heels. Engage your core and glutes to maintain a stable position. Lower your body towards the floor by bending your elbows, keeping them close to your sides. Lower yourself until your chest nearly touches the ground or you reach a comfortable depth. Press through your palms to extend your arms and return to the starting position. Keep your body in a straight line throughout the movement, avoiding sagging or arching your back. Repeat for the desired number of repetitions.', 'https://www.inspireusafoundation.org/wp-content/uploads/2023/07/plank-benefits.png', 'https://www.youtube.com/embed/R08gYyypGto?si=pqF7riN58nDrOM3u', 'Muscle Gain', 'Chest Intermediate'),
(328, 'Inchworms', 'Inchworms are a full-body exercise that targets the hamstrings, core, shoulders, and upper back. They help improve flexibility, mobility, and strength.', 'Strength', 'Upper Body', 'None', 'BEGINNER', '3 to 4 sets', '8 to 12 reps', '10 to 15 minutes', 'Start standing with your feet hip-width apart and your arms by your sides. Bend forward at the hips and lower your hands to the floor, bending your knees if necessary to reach. Walk your hands forward until you\'re in a high plank position, keeping your core engaged and your body in a straight line from head to heels. Pause briefly in the plank position, then walk your hands back towards your feet, keeping your legs as straight as possible. Continue walking your hands back until you return to the starting position. That\'s one repetition. Repeat for the desired number of repetitions.', 'https://i.ytimg.com/vi/ZY2ji_Ho0dA/sddefault.jpg', 'https://www.youtube.com/embed/ZY2ji_Ho0dA?si=PQ_fsKogP7F9vGi0', 'Muscle Gain', 'Arm Beginner'),
(329, 'Inchworms', 'Inchworms are a full-body exercise that targets the hamstrings, core, shoulders, and upper back. They help improve flexibility, mobility, and strength.', 'Flexibility', 'Legs', 'None', 'BEGINNER', '3 to 4 sets', '8 to 12 reps', '10 to 15 minutes', 'Start standing with your feet hip-width apart and your arms by your sides. Bend forward at the hips and lower your hands to the floor, bending your knees if necessary to reach. Walk your hands forward until you\'re in a high plank position, keeping your core engaged and your body in a straight line from head to heels. Pause briefly in the plank position, then walk your hands back towards your feet, keeping your legs as straight as possible. Continue walking your hands back until you return to the starting position. That\'s one repetition. Repeat for the desired number of repetitions.', 'https://i.ytimg.com/vi/ZY2ji_Ho0dA/sddefault.jpg', 'https://www.youtube.com/embed/ZY2ji_Ho0dA?si=PQ_fsKogP7F9vGi0', 'Maintain Weight', 'Arm Beginner'),
(330, 'Jumping Jacks', 'Jumping jacks are a dynamic cardiovascular exercise that involves jumping while spreading the legs and arms to the sides and then returning to the starting position. This exercise elevates heart rate and improves overall cardiovascular fitness.', 'Cardiovascular', 'Legs', 'None', 'BEGINNER', '3 to 4 sets', '30 to 60 seconds', '5 to 10 minutes', 'Start with feet together and arms at sides. Jump up, spreading legs and raising arms overhead. Return to starting position and repeat.', 'https://media.post.rvohealth.io/wp-content/uploads/sites/2/2020/04/GRT-two-people-jumping-jacks-1296x728-header.jpg', 'https://www.youtube.com/embed/iSSAk4XCsRA?si=ZPfA-daml9Gv087T', 'Maintain Weight', 'Shoulder & Back Beginner'),
(331, 'Side Lying Leg Lift (Left Side)', 'The side lying leg lift targets the abductor muscles of the hip, primarily the gluteus medius and minimus. This exercise helps to strengthen the muscles on the side of the hip, improving hip stability and preventing injuries.', 'Strength', 'Legs', 'None', 'BEGINNER', '3 To 4 sets', '10 to 15 reps', '10 to 15 minutes', 'Lie on your left side with your legs extended and stacked on top of each other. Rest your head on your left arm or use a pillow for support. Engage your core muscles to stabilize your torso. Lift your right leg upward as high as you comfortably can while keeping it straight. Pause briefly at the top of the movement, then lower your right leg back down to the starting position with control. Avoid rolling your hips backward or forward during the movement. Repeat for the desired number of repetitions.', 'https://i.ytimg.com/vi/jgh6sGwtTwk/maxresdefault.jpg', 'https://www.youtube.com/embed/jgh6sGwtTwk?si=wrxZwMJgisZ4JL3m', 'Muscle Gain', 'Shoulder & Back Beginner'),
(332, 'Side Lying Leg Lift (Right Side)', 'The side lying leg lift targets the abductor muscles of the hip, primarily the gluteus medius and minimus. This exercise helps to strengthen the muscles on the side of the hip, improving hip stability and preventing injuries.', 'Strength', 'Lower Body', 'None', 'BEGINNER', '3 To 4 sets', '10 to 15 reps', '10 to 15 minutes', 'Lie on your right side with your legs extended and stacked on top of each other. Rest your head on your right arm or use a pillow for support. Engage your core muscles to stabilize your torso. Lift your left leg upward as high as you comfortably can while keeping it straight. Pause briefly at the top of the movement, then lower your left leg back down to the starting position with control. Avoid rolling your hips backward or forward during the movement. Repeat for the desired number of repetitions.', 'https://i.ytimg.com/vi/jgh6sGwtTwk/maxresdefault.jpg', 'https://www.youtube.com/embed/jgh6sGwtTwk?si=wrxZwMJgisZ4JL3m', 'Muscle Gain', 'Shoulder & Back Beginner'),
(333, 'Jumping Jacks', 'Jumping jacks are a dynamic cardiovascular exercise that involves jumping while spreading the legs and arms to the sides and then returning to the starting position. This exercise elevates heart rate and improves overall cardiovascular fitness.', 'Full Body', 'Lower Body', 'None', 'BEGINNER', '3 to 4 sets', '30 to 60 seconds', '5 to 10 minutes', 'Start with feet together and arms at sides. Jump up, spreading legs and raising arms overhead. Return to starting position and repeat.', 'https://media.post.rvohealth.io/wp-content/uploads/sites/2/2020/04/GRT-two-people-jumping-jacks-1296x728-header.jpg', 'https://www.youtube.com/embed/iSSAk4XCsRA?si=ZPfA-daml9Gv087T', 'Lose Weight', 'Abs Intermediate'),
(334, 'Abdominal Crunches', 'Abdominal crunches target the rectus abdominis, commonly known as the \"six-pack\" muscles, and also engage the obliques. This exercise helps strengthen the core and improve abdominal muscle definition.', 'Core', 'Legs', 'None', 'BEGINNER', '3 to 4 sets', '12 to 15 per set', '30 to 60 seconds per set', 'To perform a proper abdominal crunch, lie on your back with knees bent and feet flat on the floor, hip-width apart. Place your hands lightly behind your head or cross them over your chest. Engage your core muscles and lift your shoulder blades off the floor, curling your upper body towards your knees. Exhale as you crunch up, keeping your lower back pressed into the floor. Hold for a moment at the top of the movement, then slowly lower back down with control. Avoid pulling on your neck or using momentum to lift your upper body; instead, focus on using your abdominal muscles to perform the movement.', 'https://i.ytimg.com/vi/RUNrHkbP4Pc/maxresdefault.jpg', 'https://www.youtube.com/embed/RUNrHkbP4Pc?si=xGiv1v-IgVh-Dw_L', 'Muscle Gain', 'Abs Intermediate'),
(335, 'Jumping Jacks', 'Jumping jacks are a dynamic cardiovascular exercise that involves jumping while spreading the legs and arms to the sides and then returning to the starting position. This exercise elevates heart rate and improves overall cardiovascular fitness.', 'Cardiovascular', 'Legs', 'None', 'BEGINNER', '3 to 4 sets', '30 to 60 seconds', '5 to 10 minutes', 'Start with feet together and arms at sides. Jump up, spreading legs and raising arms overhead. Return to starting position and repeat.', 'https://media.post.rvohealth.io/wp-content/uploads/sites/2/2020/04/GRT-two-people-jumping-jacks-1296x728-header.jpg', 'https://www.youtube.com/embed/iSSAk4XCsRA?si=ZPfA-daml9Gv087T', 'Maintain Weight', 'Chest Intermediate'),
(336, 'Shoulder Stretch', 'The shoulder stretch targets the deltoid muscles and helps improve flexibility and mobility in the shoulders.', 'Flexibility', 'Upper Body', 'None', 'BEGINNER', '1 to 2 per side', '20 to 30 seconds ', '5 to 10 minutes', 'Stand tall with your feet hip-width apart and your arms relaxed by your sides. Reach your right arm across your body at chest height, keeping it straight or slightly bent at the elbow. Use your left hand to gently pull your right arm towards your chest, feeling a stretch in the back of your right shoulder. Hold the stretch for 20-30 seconds, breathing deeply and focusing on relaxing the muscles. Release the stretch and repeat on the opposite side. Ensure to keep your shoulders relaxed and avoid shrugging during the stretch.', 'https://i.ytimg.com/vi/9k0EN2RCGgU/maxresdefault.jpg', 'https://www.youtube.com/embed/9k0EN2RCGgU?si=k8Kz6MZBuYbat7LZ', '', 'Chest Intermediate'),
(337, 'Shoulder Stretch', 'The shoulder stretch targets the deltoid muscles and helps improve flexibility and mobility in the shoulders.', 'Flexibility', 'Upper Body', 'None', 'BEGINNER', '1 to 2 per side', '20 to 30 seconds ', '5 to 10 minutes', 'Stand tall with your feet hip-width apart and your arms relaxed by your sides. Reach your right arm across your body at chest height, keeping it straight or slightly bent at the elbow. Use your left hand to gently pull your right arm towards your chest, feeling a stretch in the back of your right shoulder. Hold the stretch for 20-30 seconds, breathing deeply and focusing on relaxing the muscles. Release the stretch and repeat on the opposite side. Ensure to keep your shoulders relaxed and avoid shrugging during the stretch.', 'https://i.ytimg.com/vi/9k0EN2RCGgU/maxresdefault.jpg', 'https://www.youtube.com/embed/9k0EN2RCGgU?si=k8Kz6MZBuYbat7LZ', '', 'Chest Beginner'),
(338, 'Arm Circles Counterclockwise', 'Arm circles clockwise is a dynamic stretching exercise that targets the shoulder joints and surrounding muscles. It involves making circular motions with the arms while standing', 'Flexibility', 'Core', 'None', 'BEGINNER', '', '', '30 to 60 seconds', 'Arm circles clockwise is a flexibility exercise targeting the shoulders. Stand with arms extended sideways. Make small circles with your arms, gradually increasing size. Do it for 30 seconds to 1 minute. Focus on shoulder engagement and steady breathing. Reverse to counterclockwise for balance. No equipment needed, suitable for all levels.', 'https://i.ytimg.com/vi/140RTNMciH8/maxresdefault.jpg', 'https://www.youtube.com/embed/140RTNMciH8?si=gS-c1lppYtXPflrK', 'Maintain Weight', 'Arm Intermediate'),
(339, 'Leg Barbell Curl (Right Leg)', 'The Leg Barbell Curl exercise targets the right hamstring and glute muscles.', 'Strength', 'Core', 'None', 'BEGINNER', '3 To 4 sets', '8 to 12 per set', '10 to 15 minutes', 'Lie face down on a bench or mat with your legs extended. Flex your right knee to bring your right heel towards your glutes, contracting your right hamstring. Hold the contraction briefly, then slowly lower your right leg back to the starting position. Repeat for the desired number of repetitions.', 'https://i.ytimg.com/vi/3kZS8HVFquk/maxresdefault.jpg', 'https://www.youtube.com/embed/3kZS8HVFquk?si=XQjZZzGx7LMXMt7a', 'Muscle Gain', 'Arm Beginner'),
(340, 'Triceps Stretch (Left Side)', 'The triceps stretch targets the muscles at the back of the upper arm. This stretch can help improve flexibility and range of motion in the triceps.', 'Flexibility', 'Upper Body', 'None', 'BEGINNER', '', '', '15 to 30 seconds', 'Stand or sit tall with your spine straight. Reach your left arm overhead and bend your elbow, bringing your left hand down towards the center of your upper back. Use your right hand to gently press down on the left elbow, increasing the stretch in the left triceps. Hold the stretch for 15-30 seconds, feeling a gentle pull along the back of your left arm. Repeat on the opposite side if desired.', 'https://i.ytimg.com/vi/zzvDO56B0HE/maxresdefault.jpg', 'https://www.youtube.com/embed/zzvDO56B0HE?si=65J6G3uaaoCPATIe', 'Maintain Weight', 'Arm Intermediate'),
(341, 'Triceps Stretch (Right Side)', 'The triceps stretch targets the muscles at the back of the upper arm. This stretch can help improve flexibility and range of motion in the triceps.', 'Flexibility', 'Core', 'None', 'BEGINNER', '', '', '15 to 30 seconds', 'Stand or sit tall with your spine straight. Reach your right arm overhead and bend your elbow, bringing your right hand down towards the center of your upper back. Use your left hand to gently press down on the right elbow, increasing the stretch in the right triceps. Hold the stretch for 15-30 seconds, feeling a gentle pull along the back of your right arm. Repeat on the opposite side if desired.', 'https://i.ytimg.com/vi/zzvDO56B0HE/maxresdefault.jpg', 'https://www.youtube.com/embed/zzvDO56B0HE?si=65J6G3uaaoCPATIe', 'Maintain Weight', 'Arm Beginner'),
(342, 'Triceps Stretch (Right Side)', 'The triceps stretch targets the muscles at the back of the upper arm. This stretch can help improve flexibility and range of motion in the triceps.', 'Flexibility', 'Core', 'None', 'BEGINNER', '', '', '15 to 30 seconds', 'Stand or sit tall with your spine straight. Reach your right arm overhead and bend your elbow, bringing your right hand down towards the center of your upper back. Use your left hand to gently press down on the right elbow, increasing the stretch in the right triceps. Hold the stretch for 15-30 seconds, feeling a gentle pull along the back of your right arm. Repeat on the opposite side if desired.', 'https://i.ytimg.com/vi/zzvDO56B0HE/maxresdefault.jpg', 'https://www.youtube.com/embed/zzvDO56B0HE?si=65J6G3uaaoCPATIe', 'Maintain Weight', 'Arm Beginner'),
(343, 'Standing Biceps Stretch (Left Si', 'The standing biceps stretch targets the muscles at the front of the upper arm. This stretch helps improve flexibility and range of motion in the biceps.', 'Flexibility', 'Upper Body', 'None', 'BEGINNER', '', '', '15 to 30 seconds', 'Stand tall with your feet shoulder-width apart and your spine straight. Extend your left arm straight out in front of you, palm facing up. Use your right hand to gently pull back on the fingers of your left hand, bending the left wrist backward. You should feel a stretch along the front of your left arm. Hold the stretch for 15-30 seconds, then release. Repeat on the opposite side if desired.', 'https://i.ytimg.com/vi/jw8EXo5h0ec/maxresdefault.jpg', 'https://www.youtube.com/embed/jw8EXo5h0ec?si=SSyAJa5Bx4J4bvxr', 'Maintain Weight', 'Arm Intermediate'),
(344, 'Jumping Jacks', 'Jumping jacks are a dynamic cardiovascular exercise that involves jumping while spreading the legs and arms to the sides and then returning to the starting position. This exercise elevates heart rate and improves overall cardiovascular fitness.', 'Cardiovascular', 'Legs', 'None', 'BEGINNER', '3 to 4 sets', '30 to 60 seconds', '5 to 10 minutes', 'Start with feet together and arms at sides. Jump up, spreading legs and raising arms overhead. Return to starting position and repeat.', 'https://media.post.rvohealth.io/wp-content/uploads/sites/2/2020/04/GRT-two-people-jumping-jacks-1296x728-header.jpg', 'https://www.youtube.com/embed/iSSAk4XCsRA?si=ZPfA-daml9Gv087T', 'Maintain Weight', 'Leg Intermediate'),
(345, 'Fire Hydrant (Left Side)', 'The fire hydrant exercise targets the gluteus medius and hip abductor muscles, helping to improve hip stability and strengthen the outer thighs.', 'Strength', 'Legs', 'None', 'BEGINNER', '3 to 4 sets', '10 to 15 reps', '10 to 15 minutes', 'Start on your hands and knees in a tabletop position, with your wrists aligned under your shoulders and your knees under your hips. Keep your core engaged to stabilize your spine. Lift your left knee out to the side, keeping your knee bent at a 90-degree angle and your foot flexed. Your thigh should be parallel to the ground. Hold for a moment at the top of the movement, then lower your knee back down to the starting position with control. Avoid arching your lower back or rotating your hips during the movement. Repeat for the desired number of repetitions.', 'https://i.ytimg.com/vi/7LnuhLi-78I/maxresdefault.jpg', 'https://www.youtube.com/embed/7LnuhLi-78I?si=TdQjLvyYqRbyW1kF', 'Maintain Weight', 'Leg Intermediate'),
(346, 'Fire Hydrant (Right Side)', 'The fire hydrant exercise targets the gluteus medius and hip abductor muscles, aiding in improving hip stability and strengthening the outer thighs.', 'Strength', 'Legs', 'None', 'BEGINNER', '3 to 4 sets', '10 to 15 reps', '10 to 15 minutes', 'Begin on your hands and knees in a tabletop position, ensuring your wrists are aligned under your shoulders and your knees are under your hips. Engage your core to stabilize your spine. Lift your right knee out to the side, maintaining a 90-degree angle at the knee and keeping your foot flexed. Your thigh should be parallel to the ground. Hold the position briefly at the peak of the movement, then lower your knee back down to the starting position under control. Maintain stability in your lower back and avoid rotating your hips. Repeat for the desired number of repetitions.', 'https://i.ytimg.com/vi/7LnuhLi-78I/maxresdefault.jpg', 'https://www.youtube.com/embed/7LnuhLi-78I?si=TdQjLvyYqRbyW1kF', 'Maintain Weight', 'Leg Intermediate'),
(347, 'Lunges', 'Lunges are a lower body exercise that targets the quadriceps, hamstrings, glutes, and calves. They help improve lower body strength, stability, and balance.', 'Strength', 'Legs', 'None', 'INTERMEDIATE', '3 to 4 sets', '8 to 12 per leg', '10 to 15 minutes', 'Start by standing tall with your feet hip-width apart and your hands on your hips or by your sides. Take a step forward with your right foot, landing on the heel first and then lowering your body until both knees are bent at a 90-degree angle. Your front thigh should be parallel to the ground, and your back knee should hover just above the floor. Keep your torso upright and your core engaged throughout the movement. Push through your right heel to return to the starting position. Repeat the movement on the opposite side, alternating legs for the desired number of repetitions.', 'https://i.ytimg.com/vi/1J8mVmtyYpk/maxresdefault.jpg', 'https://www.youtube.com/embed/1J8mVmtyYpk?si=sgN1iK6YUwWTn85J', 'Muscle Gain', 'Leg Intermediate'),
(348, 'Sumo Squat Raises with Wall', 'Sumo squat raises with a wall target the quadriceps, hamstrings, glutes, and calves. This exercise also engages the core muscles for stability and balance. The wall provides support and helps maintain proper form throughout the movement.', 'Strength', 'Lower Body', 'Wall ', 'BEGINNER', '3 to 4 sets', '12 to 15 reps', '10 to 15 minutes', 'Stand with your back against a wall and your feet wider than shoulder-width apart, toes pointed slightly outward. Rest your hands on your hips or by your sides for balance. Lower your body into a sumo squat position by bending your knees and pushing your hips back, keeping your back flat against the wall. Ensure your knees track in line with your toes and do not extend past your toes. Press through your heels to return to the starting position, simultaneously raising your heels off the ground to come onto the balls of your feet. Hold the raised position for a moment, then lower your heels back down as you descend into the next squat. Repeat for the desired number of repetitions.', 'https://i.ytimg.com/vi/Hcy81KUTIZ8/maxresdefault.jpg', 'https://www.youtube.com/embed/Hcy81KUTIZ8?si=-Q3iJVyP-elGflYa', 'Muscle Gain', 'Leg Intermediate'),
(349, 'Left Quad Stretch with Wall', 'The left quad stretch with a wall is a static stretch that targets the quadriceps muscles of the left leg. It helps improve flexibility and mobility in the front of the thigh.', 'Flexibility', 'Legs', 'Wall ', 'ADVANCE', '1 to 2 sets ', '', '30 to 60 seconds', 'Start by standing upright facing a wall, with your feet hip-width apart. Place your left hand on the wall for support. Bend your left knee and lift your left foot towards your buttocks, reaching back with your left hand to grasp your left ankle or foot. Keep your knees close together and your thighs parallel. Gently pull your left foot towards your buttocks until you feel a stretch in the front of your left thigh. Keep your torso upright and avoid arching your back. Hold the stretch for 30-60 seconds, breathing deeply and maintaining a steady stretch. Release the stretch and repeat on the opposite side.', 'https://i.ytimg.com/vi/TfcRyYf7WLg/maxresdefault.jpg', 'https://www.youtube.com/embed/TfcRyYf7WLg?si=Y0KutAoAwEKm_Jep', 'Maintain Weight', 'Leg Intermediate'),
(350, 'Right Quad Stretch with Wall', 'The right quad stretch with a wall is a static stretch that targets the quadriceps muscles of the right leg. It helps improve flexibility and mobility in the front of the thigh.', 'Flexibility', 'Legs', 'Wall ', 'ADVANCE', '1 to 2 sets ', '', '30 to 60 seconds', 'Start by standing upright facing a wall, with your feet hip-width apart. Place your right hand on the wall for support. Bend your right knee and lift your right foot towards your buttocks, reaching back with your right hand to grasp your right ankle or foot. Keep your knees close together and your thighs parallel. Gently pull your right foot towards your buttocks until you feel a stretch in the front of your right thigh. Keep your torso upright and avoid arching your back. Hold the stretch for 30-60 seconds, breathing deeply and maintaining a steady stretch. Release the stretch and repeat on the opposite side.', 'https://i.ytimg.com/vi/TfcRyYf7WLg/maxresdefault.jpg', 'https://www.youtube.com/embed/TfcRyYf7WLg?si=Y0KutAoAwEKm_Jep', 'Muscle Gain', 'Leg Intermediate'),
(351, 'Knee to Chest Stretch (Left Side', 'The knee to chest stretch targets the lower back, glutes, and hips, helping to relieve tension and improve flexibility in these areas.', 'Flexibility', 'Core', 'None', 'BEGINNER', '1 to 2 per side', '20 to 30 seconds ', '5 to 10 minutes', 'Lie on your back with your legs extended and your arms by your sides. Bend your left knee and bring it towards your chest. Interlace your fingers around your left shin or knee and gently pull your left knee towards your chest until you feel a stretch in your left glute and lower back. Keep your right leg extended or bend it slightly if more comfortable. Hold the stretch for 20-30 seconds, breathing deeply and relaxing into the stretch. Release and switch sides.', 'https://i.ytimg.com/vi/7xy99ZgARVA/maxresdefault.jpg', 'https://www.youtube.com/embed/7xy99ZgARVA?si=FU7DeVTqGAaHnGl', 'Maintain Weight', 'Leg Intermediate');
INSERT INTO `exercises` (`ExerciseID`, `ExerciseName`, `Description`, `CategoryID`, `PartOfBody`, `EquipmentID`, `Difficulty`, `set`, `reps`, `duration`, `Instructions`, `ImageURL`, `VideoURL`, `Goal`, `Workoutset`) VALUES
(352, 'Knee to Chest Stretch (Right Sid', 'The knee to chest stretch targets the lower back, glutes, and hips, helping to relieve tension and improve flexibility in these areas.', 'Flexibility', 'Lower Body', 'None', 'BEGINNER', '1 to 2 per side', '20 to 30 seconds ', '5 to 10 minutes', 'Lie on your back with your legs extended and your arms by your sides. Bend your right knee and bring it towards your chest. Interlace your fingers around your right shin or knee and gently pull your right knee towards your chest until you feel a stretch in your right glute and lower back. Keep your left leg extended or bend it slightly if more comfortable. Hold the stretch for 20-30 seconds, breathing deeply and relaxing into the stretch. Release and switch sides.', 'https://i.ytimg.com/vi/7xy99ZgARVA/maxresdefault.jpg', 'https://www.youtube.com/embed/7xy99ZgARVA?si=FU7DeVTqGAaHnGl', 'Maintain Weight', 'Leg Intermediate'),
(353, 'Wall Calf Raises', 'Wall calf raises are a simple yet effective exercise for targeting the calf muscles. This exercise helps strengthen the calves and improve ankle stability and balance.', 'Strength', 'Legs', 'Wall ', 'BEGINNER', '3 to 4 sets', '12 to 15 reps', '10 to 15 minutes', 'Stand facing a wall with your hands resting against the wall at shoulder height for support. Place your feet hip-width apart and flat on the ground. Keeping your core engaged and your back straight, lift your heels off the ground as high as you can, rising onto the balls of your feet. Hold the raised position for a moment, then lower your heels back down to the starting position. Control the movement and avoid bouncing at the bottom. Repeat for the desired number of repetitions.', 'https://i.ytimg.com/vi/GQa_N7wft7M/maxresdefault.jpg', 'https://www.youtube.com/embed/GQa_N7wft7M?si=GyMLJZqBGJIzvaR0', 'Muscle Gain', 'Leg Intermediate'),
(354, 'Single Leg Balance', 'Single leg balance is a balance exercise that targets the muscles of the legs and core. It improves proprioception, coordination, and stability. This exercise can help prevent falls and injuries by enhancing balance and control.', 'Balance', 'Legs', 'None', 'BEGINNER', '', '', '30 to 60 seconds per leg', 'Stand on one leg with knee slightly bent, engaging core for balance. Hold position for desired duration, then switch legs.', 'https://moticon.com/wp-content/uploads/2022/03/RT012-01.jpg', 'https://www.youtube.com/embed/HTVVv4ESgms?si=35Uu2sh64S19nDwJ', 'Maintain Weight', 'Leg Beginner'),
(355, 'Single Leg Balance', 'Single leg balance is a balance exercise that targets the muscles of the legs and core. It improves proprioception, coordination, and stability. This exercise can help prevent falls and injuries by enhancing balance and control.', 'Balance', 'Lower Body', 'None', 'BEGINNER', '', '', '30 to 60 seconds per leg', 'Stand on one leg with knee slightly bent, engaging core for balance. Hold position for desired duration, then switch legs.', 'https://moticon.com/wp-content/uploads/2022/03/RT012-01.jpg', 'https://www.youtube.com/embed/HTVVv4ESgms?si=35Uu2sh64S19nDwJ', 'Muscle Gain', 'Leg Beginner'),
(356, 'Jumping Jacks', 'Jumping jacks are a dynamic cardiovascular exercise that involves jumping while spreading the legs and arms to the sides and then returning to the starting position. This exercise elevates heart rate and improves overall cardiovascular fitness.', 'Cardiovascular', 'Legs', 'None', 'BEGINNER', '3 to 4 sets', '30 to 60 seconds', '5 to 10 minutes', 'Start with feet together and arms at sides. Jump up, spreading legs and raising arms overhead. Return to starting position and repeat.', 'https://media.post.rvohealth.io/wp-content/uploads/sites/2/2020/04/GRT-two-people-jumping-jacks-1296x728-header.jpg', 'https://www.youtube.com/embed/iSSAk4XCsRA?si=ZPfA-daml9Gv087T', 'Maintain Weight', 'Shoulder & Back Intermediate'),
(357, 'Triceps Kickbacks', 'Triceps kickbacks are a strength training exercise that targets the triceps muscles at the back of the upper arm. This exercise helps tone and strengthen the triceps.', 'Strength', 'Upper Body', 'Dumbells ', 'BEGINNER', '3 to 4 sets', '10 to 15 minutes', '10 to 15 minutes', 'Start by holding a dumbbell in each hand and standing with your feet hip-width apart. Hinge forward at the hips to bring your torso parallel to the ground, keeping your back straight and your core engaged. Bend your elbows to bring the dumbbells close to your chest, with your palms facing each other. Extend your arms straight back behind you, squeezing your triceps at the top of the movement. Keep your upper arms stationary throughout the exercise. Slowly lower the dumbbells back to the starting position. Repeat for the desired number of repetitions.', 'https://i.ytimg.com/vi/f3E7eEq2c6c/maxresdefault.jpg', 'https://www.youtube.com/embed/f3E7eEq2c6c?si=kmLbNxsZoFoZLyKO', 'Muscle Gain', 'Shoulder & Back Intermediate'),
(358, 'Rhomboid Pulls', 'Rhomboid pulls target the rhomboid muscles located between the shoulder blades. This exercise helps improve upper back strength and posture.', 'Strength', 'Upper Body', 'Ressistance Band', 'BEGINNER', '10 to 15 reps', '10 to 15 minutes', '10 to 15 minutes', 'Start by standing tall with your feet hip-width apart and holding the resistance band or handles of the cable machine in front of you with both hands, palms facing inward. Keep your arms extended at shoulder height with a slight bend in your elbows. Retract your shoulder blades and squeeze your shoulder blades together as you pull the band or handles towards your chest. Keep your elbows close to your sides throughout the movement. Pause briefly at the fully contracted position, then slowly return to the starting position with control. Repeat for the desired number of repetitions.', 'https://images.squarespace-cdn.com/content/v1/5f5e8592d2b0854b18af6975/a0e85462-4b3f-422a-81c1-942ee387630d/banded+pull+apart.jpg', 'https://www.youtube.com/embed/DEyDbzSudEU?si=XssMCFNGgBP_-ouL', 'Muscle Gain', 'Shoulder & Back Intermediate'),
(359, 'Jumping Jacks', 'Jumping jacks are a dynamic cardiovascular exercise that involves jumping while spreading the legs and arms to the sides and then returning to the starting position. This exercise elevates heart rate and improves overall cardiovascular fitness.', 'Cardiovascular', 'Legs', 'None', 'BEGINNER', '3 to 4 sets', '30 to 60 seconds', '5 to 10 minutes', 'Start with feet together and arms at sides. Jump up, spreading legs and raising arms overhead. Return to starting position and repeat.', 'https://media.post.rvohealth.io/wp-content/uploads/sites/2/2020/04/GRT-two-people-jumping-jacks-1296x728-header.jpg', 'https://www.youtube.com/embed/iSSAk4XCsRA?si=ZPfA-daml9Gv087T', 'Maintain Weight', 'Abs Advanced'),
(360, 'Sit-Ups', 'Sit-ups are a classic abdominal exercise that targets the rectus abdominis muscle, commonly known as the \"six-pack.\" They help strengthen the core and improve abdominal endurance.', 'Strength', 'Core', 'None', 'INTERMEDIATE', '3 to 4 sets', '10 to 15 reps', '10 to 15 minutes', 'Start by lying on your back with your knees bent and your feet flat on the floor, hip-width apart. Place your hands behind your head or crossed over your chest. Engage your core muscles to lift your upper body off the floor, curling your torso towards your thighs. Keep your lower back pressed into the floor throughout the movement. Exhale as you lift and inhale as you lower back down with control. Avoid pulling on your neck or using momentum to lift your body. Repeat for the desired number of repetitions.', 'https://i.ytimg.com/vi/swOyWKk7Oko/hqdefault.jpg', 'https://www.youtube.com/embed/swOyWKk7Oko?si=618gv3Y4Q6YGWgiq', 'Muscle Gain', 'Abs Advanced'),
(361, 'Abdominal Crunches', 'Abdominal crunches target the rectus abdominis, commonly known as the \"six-pack\" muscles, and also engage the obliques. This exercise helps strengthen the core and improve abdominal muscle definition.', 'Core', 'Legs', 'None', 'BEGINNER', '3 to 4 sets', '12 to 15 per set', '30 to 60 seconds per set', 'To perform a proper abdominal crunch, lie on your back with knees bent and feet flat on the floor, hip-width apart. Place your hands lightly behind your head or cross them over your chest. Engage your core muscles and lift your shoulder blades off the floor, curling your upper body towards your knees. Exhale as you crunch up, keeping your lower back pressed into the floor. Hold for a moment at the top of the movement, then slowly lower back down with control. Avoid pulling on your neck or using momentum to lift your upper body; instead, focus on using your abdominal muscles to perform the movement.', 'https://i.ytimg.com/vi/RUNrHkbP4Pc/maxresdefault.jpg', 'https://www.youtube.com/embed/RUNrHkbP4Pc?si=xGiv1v-IgVh-Dw_L', 'Muscle Gain', 'Abs Advanced'),
(362, 'Side Plank (Right Side)', 'The side plank is a static core exercise that primarily targets the obliques, but also engages the entire core, shoulders, and hips. This exercise helps improve core strength, stability, and endurance on the right side of the body.', 'Core', 'Core', 'None', 'ADVANCE', '2 to 3 sets', 'Hold for desired duration,', '20 to 30 seconds', 'Start by lying on your right side with your legs extended and stacked on top of each other. Place your right elbow directly beneath your shoulder, forearm perpendicular to your body. Engage your core muscles and lift your hips off the ground, creating a straight line from your head to your heels. Keep your body in a straight line without letting your hips sag or rise too high. Hold the position for 20-30 seconds, or longer if you can maintain proper form. Focus on breathing deeply and maintaining stability throughout the exercise. Lower your hips back down to the starting position with control. Repeat for the desired number of sets.', 'https://i.ytimg.com/vi/2W96p2PIoPg/maxresdefault.jpg', 'https://www.youtube.com/embed/2W96p2PIoPg?si=1gSQopE6spl2yOMD', 'Maintain Weight', 'Abs Advanced'),
(363, 'Heel Touch', 'The heel touch exercise targets the obliques and improves balance and stability. It involves lying on the back and reaching towards the heels while keeping the feet and shoulders elevated.', 'Balance', 'Legs', 'None', 'BEGINNER', '3 to 4 sets', '10 to 12 per set', '30 to 60 seconds per set', 'Lie on your back with knees bent and feet flat on the floor. Lift the shoulders off the ground and extend the arms towards the heels. Twist the torso to touch the right heel with the right hand, then return to the center and repeat on the left side.', 'https://i.ytimg.com/vi/9bR-elyolBQ/maxresdefault.jpg', 'https://www.youtube.com/embed/9bR-elyolBQ?si=kNqQT2FirHyZIpqR', 'Maintain Weight', 'Abs Advanced'),
(364, 'Crossover Crunch', 'The crossover crunch is a dynamic core exercise that targets the obliques and rectus abdominis. This exercise helps strengthen the abdominal muscles and improve core stability.', 'Core', 'Legs', 'None', 'ADVANCE', '3 to 4 sets', '12 to 15 each side', '5 to 10 minutes', 'tart by lying on your back on an exercise mat with your knees bent and feet flat on the floor. Place your hands behind your head, elbows pointing out to the sides. Engage your core muscles and lift your shoulder blades off the mat, bringing your right elbow towards your left knee while simultaneously straightening your right leg and rotating your torso to the left. Keep your left elbow pointing out to the side and avoid pulling on your neck with your hands. Return to the starting position and repeat on the other side by bringing your left elbow towards your right knee while straightening your left leg and rotating your torso to the right. Continue alternating sides in a controlled motion, focusing on contracting the obliques with each repetition.', 'https://i.ytimg.com/vi/q2_KHKE5CDE/maxresdefault.jpg', 'https://www.youtube.com/embed/q2_KHKE5CDE?si=ohT6TxZKDny9iVWo', 'Maintain Weight', 'Abs Advanced'),
(365, 'Cobra Stretch', 'The cobra stretch involves lying face down on the floor and lifting the chest while keeping the hips and lower body grounded. This movement resembles the raised hood of a cobra, hence the name.', 'Flexibility', 'Lower Body', 'None', 'BEGINNER', '', '', '30 to 60 seconds', 'Lie face down on the floor with legs extended and feet hip-width apart. Place palms on the floor under shoulders. Inhale and lift chest and head off the floor, keeping hips grounded. Keep shoulders relaxed, lengthen spine, and engage core. Hold for 15-30 seconds, breathing deeply. Exhale and lower chest and head back down to the floor.', 'https://cdn.yogajournal.com/wp-content/uploads/2022/06/Upward-Facing-Dog-Mod-1_Andrew-Clark-e1670972827524.jpg', 'https://www.youtube.com/embed/Nd3j6Avtv6Q?si=tVt4ZtaqieQ2gtbs', 'Weight Loss', 'Abs Advanced'),
(366, 'Spine Lumbar Twist Stretch (Righ', 'The spine lumbar twist stretch targets the lower back, hips, and spinal muscles. It helps improve spinal mobility and relieve tension in the lower back.', 'Flexibility', 'Legs', 'None', 'BEGINNER', '', '', '30 to 60 seconds per side', 'Lie on your back with knees bent and feet flat on the floor. Extend the arms out to the sides in a T position. Lower both knees to one side while keeping the shoulders grounded, feeling a gentle stretch in the lower back and hips. Hold for the desired duration, then switch sides.', 'https://i.ytimg.com/vi/BzYBkAvdCJY/maxresdefault.jpg', 'https://www.youtube.com/embed/BzYBkAvdCJY?si=rnxT58_ub4fH3EMI', 'Maintain Weight', 'Abs Advanced'),
(367, 'Spine Lumbar Twist Stretch (Left', 'This is the same stretch as above but performed on the opposite side to ensure balanced flexibility in the spine and lower back.', 'Flexibility', 'Lower Body', 'None', 'BEGINNER', '', '', '30 to 60 seconds per side', 'Repeat the instructions mentioned above, but this time lower both knees to the opposite side, feeling the stretch in the lower back, hips, and spinal muscles. Hold for the desired duration.', 'https://i.ytimg.com/vi/BzYBkAvdCJY/maxresdefault.jpg', 'https://www.youtube.com/embed/BzYBkAvdCJY?si=rnxT58_ub4fH3EMI', 'Maintain Weight', 'Abs Advanced'),
(368, 'Jumping Jacks', 'Jumping jacks are a dynamic cardiovascular exercise that involves jumping while spreading the legs and arms to the sides and then returning to the starting position. This exercise elevates heart rate and improves overall cardiovascular fitness.', 'Cardiovascular', 'Legs', 'None', 'BEGINNER', '3 to 4 sets', '30 to 60 seconds', '5 to 10 minutes', 'Start with feet together and arms at sides. Jump up, spreading legs and raising arms overhead. Return to starting position and repeat.', 'https://media.post.rvohealth.io/wp-content/uploads/sites/2/2020/04/GRT-two-people-jumping-jacks-1296x728-header.jpg', 'https://www.youtube.com/embed/iSSAk4XCsRA?si=ZPfA-daml9Gv087T', 'Maintain Weight', 'Chest Advanced'),
(369, 'Shoulder Stretch', 'The shoulder stretch targets the deltoid muscles and helps improve flexibility and mobility in the shoulders.', 'Flexibility', 'Upper Body', 'None', 'BEGINNER', '1 to 2 per side', '20 to 30 seconds ', '5 to 10 minutes', 'Stand tall with your feet hip-width apart and your arms relaxed by your sides. Reach your right arm across your body at chest height, keeping it straight or slightly bent at the elbow. Use your left hand to gently pull your right arm towards your chest, feeling a stretch in the back of your right shoulder. Hold the stretch for 20-30 seconds, breathing deeply and focusing on relaxing the muscles. Release the stretch and repeat on the opposite side. Ensure to keep your shoulders relaxed and avoid shrugging during the stretch.', 'https://i.ytimg.com/vi/9k0EN2RCGgU/maxresdefault.jpg', 'https://www.youtube.com/embed/9k0EN2RCGgU?si=k8Kz6MZBuYbat7LZ', '', 'Chest Advanced'),
(370, 'Arm Circles Counterclockwise', 'Arm circles counterclockwise is a dynamic stretching exercise that targets the shoulder joints and surrounding muscles. It involves making circular motions with the arms while standing', 'Flexibility', 'Core', 'None', 'BEGINNER', '', '', '30 to 60 seconds', 'Arm circles clockwise is a flexibility exercise targeting the shoulders. Stand with arms extended sideways. Make small circles with your arms, gradually increasing size. Do it for 30 seconds to 1 minute. Focus on shoulder engagement and steady breathing. Reverse to counterclockwise for balance. No equipment needed, suitable for all levels.', 'https://i.ytimg.com/vi/140RTNMciH8/maxresdefault.jpg', 'https://www.youtube.com/embed/140RTNMciH8?si=gS-c1lppYtXPflrK', 'Maintain Weight', 'Arm Advanced'),
(371, 'Arm Circles Clockwise', 'Arm circles clockwise is an upper body exercise that targets the shoulder muscles. It involves making circular motions with the arms in a clockwise direction to improve shoulder mobility and flexibility.', 'Flexibility', 'Upper Body', 'None', 'BEGINNER', '', '', '30 to 60 seconds', 'Arm circles clockwise is a flexibility exercise targeting the shoulders. Stand with arms extended sideways. Make small circles with your arms, gradually increasing size. Do it for 30 seconds to 1 minute. Focus on shoulder engagement and steady breathing. Reverse to counterclockwise for balance. No equipment needed, suitable for all levels.', 'https://i.ytimg.com/vi/140RTNMciH8/maxresdefault.jpg', 'https://www.youtube.com/embed/140RTNMciH8?si=gS-c1lppYtXPflrK', 'Maintain Weight', 'Arm Advanced'),
(372, 'Skipping Without Rope', 'kipping without a rope, also known as imaginary skipping or shadow skipping, mimics the motion of traditional skipping or jump rope without using an actual rope. It is a cardiovascular exercise that helps improve coordination, footwork, and endurance while burning calories.', 'Cardiovascular', 'Cardio', 'None', 'ADVANCE', '', '', '5 to 10 minutes', 'Start by standing with your feet shoulder-width apart and your arms by your sides. Imagine holding a skipping rope in your hands. Begin to simulate the motion of skipping rope by swinging your arms in small circles and hopping lightly on the balls of your feet. As you hop, alternate lifting your knees slightly towards your chest in a marching motion. Keep your movements light and controlled, landing softly on the balls of your feet with each hop. Continue to move at a steady pace, maintaining a consistent rhythm throughout the exercise. You can vary the intensity by increasing the speed of your movements or adding variations such as high knees, butt kicks, or double hops. Aim to perform the exercise for 5-10 minutes, gradually increasing the duration as your fitness level improves.', 'https://i.ytimg.com/vi/CYGeazlNbU4/maxresdefault.jpg', 'https://www.youtube.com/embed/CYGeazlNbU4?si=HYQEjZTK-yOx8wpa', 'Weight Loss', 'Arm Advanced'),
(373, 'Leg Barbell Curl (Left Side)', 'The Leg Barbell Curl exercise targets the hamstrings and glutes. This variation involves lying face down on a bench or mat and curling both legs simultaneously', 'Strength', 'Lower Body', 'None', 'BEGINNER', '3 To 4 sets', '8 to 12 per set', '10 to 15 minutes', 'Lie face down on a bench or mat with your legs extended. Flex your left knee to bring your left heel towards your glutes, contracting your left hamstring. Hold the contraction briefly, then slowly lower your left leg back to the starting position. Repeat for the desired number of repetitions.', 'https://i.ytimg.com/vi/3kZS8HVFquk/maxresdefault.jpg', 'https://www.youtube.com/embed/3kZS8HVFquk?si=XQjZZzGx7LMXMt7a', 'Maintain Weight', 'Arm Advanced'),
(374, 'Leg Barbell Curl (Right Leg)', 'The Leg Barbell Curl exercise targets the right hamstring and glute muscles.', 'Strength', 'Core', 'None', 'BEGINNER', '3 To 4 sets', '8 to 12 per set', '10 to 15 minutes', 'Lie face down on a bench or mat with your legs extended. Flex your right knee to bring your right heel towards your glutes, contracting your right hamstring. Hold the contraction briefly, then slowly lower your right leg back to the starting position. Repeat for the desired number of repetitions.', 'https://i.ytimg.com/vi/3kZS8HVFquk/maxresdefault.jpg', 'https://www.youtube.com/embed/3kZS8HVFquk?si=XQjZZzGx7LMXMt7a', 'Muscle Gain', 'Arm Advanced'),
(375, 'Leg Barbell Curl (Right Leg)', 'The Leg Barbell Curl exercise targets the right hamstring and glute muscles.', 'Strength', 'Core', 'None', 'BEGINNER', '3 To 4 sets', '8 to 12 per set', '10 to 15 minutes', 'Lie face down on a bench or mat with your legs extended. Flex your right knee to bring your right heel towards your glutes, contracting your right hamstring. Hold the contraction briefly, then slowly lower your right leg back to the starting position. Repeat for the desired number of repetitions.', 'https://i.ytimg.com/vi/3kZS8HVFquk/maxresdefault.jpg', 'https://www.youtube.com/embed/3kZS8HVFquk?si=XQjZZzGx7LMXMt7a', 'Muscle Gain', 'Arm Beginner'),
(376, 'Floor Triceps Dips', 'Floor triceps dips are a bodyweight exercise that targets the triceps, shoulders, and chest muscles. This exercise is performed using your own body weight and requires minimal equipment, making it an effective exercise for strengthening and toning the upper body.', 'Strength', 'Upper Body', 'None', 'ADVANCE', '3 to 4 sets', '8 to 12 reps', '5 to 10 minutes', 'tart by sitting on the floor with your knees bent and feet flat on the ground, hip-width apart. Place your hands behind your hips with your fingers pointing towards your feet and palms flat on the ground, shoulder-width apart. Press through your palms and lift your hips off the ground, straightening your arms. Your body should form a reverse tabletop position, with your hips lifted and knees bent at a 90-degree angle. Lower your body towards the ground by bending your elbows, keeping them close to your body. Lower until your elbows are bent at approximately 90 degrees, then press back up to the starting position by straightening your arms. Keep your core engaged and your back close to the ground throughout the movement. Repeat for the desired number of repetitions, focusing on maintaining proper form and control.', 'https://i.ytimg.com/vi/geNkbcZ6qDo/maxresdefault.jpg', 'https://www.youtube.com/embed/geNkbcZ6qDo?si=0xDAFoRjB-ktMV88', 'Muscle Gain', 'Arm Advanced'),
(377, 'Standing Biceps Stretch (Left Si', 'The standing biceps stretch targets the muscles at the front of the upper arm. This stretch helps improve flexibility and range of motion in the biceps.', 'Flexibility', 'Upper Body', 'None', 'BEGINNER', '', '', '15 to 30 seconds', 'Stand tall with your feet shoulder-width apart and your spine straight. Extend your left arm straight out in front of you, palm facing up. Use your right hand to gently pull back on the fingers of your left hand, bending the left wrist backward. You should feel a stretch along the front of your left arm. Hold the stretch for 15-30 seconds, then release. Repeat on the opposite side if desired.', 'https://i.ytimg.com/vi/jw8EXo5h0ec/maxresdefault.jpg', 'https://www.youtube.com/embed/jw8EXo5h0ec?si=SSyAJa5Bx4J4bvxr', 'Maintain Weight', 'Arm Advanced'),
(378, 'Standing Biceps Stretch (Right S', 'The standing biceps stretch targets the muscles at the front of the upper arm. This stretch helps improve flexibility and range of motion in the biceps.', 'Flexibility', 'Core', 'None', 'BEGINNER', '', '', '15 to 30 seconds', 'Stand tall with your feet shoulder-width apart and your spine straight. Extend your right arm straight out in front of you, palm facing up. Use your left hand to gently pull back on the fingers of your right hand, bending the right wrist backward. You should feel a stretch along the front of your right arm. Hold the stretch for 15-30 seconds, then release. Repeat on the opposite side if desired.', 'https://i.ytimg.com/vi/jw8EXo5h0ec/maxresdefault.jpg', 'https://www.youtube.com/embed/jw8EXo5h0ec?si=SSyAJa5Bx4J4bvxr', 'Maintain Weight', 'Arm Advanced'),
(379, 'Burpees', 'Burpees are a full-body, plyometric exercise that combines a squat, push-up, and jump. This exercise targets multiple muscle groups and provides cardiovascular benefits, making it an efficient and effective total-body workout.', 'Full Body', 'Legs', 'None', 'ADVANCE', '3 to 4 sets', '8 to 12 reps', '10 to 15 minutes', 'Start by standing with your feet hip-width apart. Lower into a squat position, placing your hands on the floor in front of you. Kick your feet back into a plank position, keeping your body in a straight line from head to heels. Perform a push-up by lowering your chest towards the ground and then pushing back up to the plank position. Jump your feet forward towards your hands, returning to the squat position. Explosively jump up into the air, reaching your arms overhead. Land softly and immediately lower back into the squat position to begin the next repetition. Focus on maintaining proper form and performing each movement with control and explosiveness.', 'https://i.ytimg.com/vi/818SkLAPyKY/maxresdefault.jpg', 'https://www.youtube.com/embed/818SkLAPyKY?si=RCS3bRrsDaWKB7Xf', 'Muscle Gain', 'Leg Advanced'),
(380, 'Burpees', 'Burpees are a full-body, plyometric exercise that combines a squat, push-up, and jump. This exercise targets multiple muscle groups and provides cardiovascular benefits, making it an efficient and effective total-body workout.', 'Full Body', 'Legs', 'None', 'ADVANCE', '3 to 4 sets', '8 to 12 reps', '10 to 15 minutes', 'Start by standing with your feet hip-width apart. Lower into a squat position, placing your hands on the floor in front of you. Kick your feet back into a plank position, keeping your body in a straight line from head to heels. Perform a push-up by lowering your chest towards the ground and then pushing back up to the plank position. Jump your feet forward towards your hands, returning to the squat position. Explosively jump up into the air, reaching your arms overhead. Land softly and immediately lower back into the squat position to begin the next repetition. Focus on maintaining proper form and performing each movement with control and explosiveness.', 'https://i.ytimg.com/vi/818SkLAPyKY/maxresdefault.jpg', 'https://www.youtube.com/embed/818SkLAPyKY?si=RCS3bRrsDaWKB7Xf', 'Muscle Gain', 'Leg Intermediate'),
(381, 'Glute Kickback (Right Leg)', 'Glute kickbacks are an effective exercise for targeting the gluteal muscles, specifically the gluteus maximus, to help strengthen and tone the buttocks. This exercise also engages the core muscles for stability.', 'Strength', 'Lower Body', 'None', 'ADVANCE', '3 to 4 sets', '10 to 15 reps', '5 to 10 minutes', 'Start on your hands and knees in a tabletop position with your wrists aligned under your shoulders and your knees under your hips. Engage your core muscles to stabilize your spine. Keeping your right knee bent at a 90-degree angle, lift your right leg up and back, extending it straight behind you while keeping your foot flexed. Focus on squeezing your left glute at the top of the movement. Avoid arching your back or rotating your hips. Hold for a moment at the top, then lower your left leg back to the starting position with control. Repeat for the desired number of repetitions. Ensure that your movements are slow and controlled throughout the exercise to maximize muscle engagement and minimize the risk of injury.', 'https://i.ytimg.com/vi/D4gxkgZQkAg/maxresdefault.jpg', 'https://www.youtube.com/embed/D4gxkgZQkAg?si=QYcwKlANcy8ssyz2', 'Weight Loss', 'Leg Advanced'),
(382, 'Glute Kickback (Right Leg)', 'Glute kickbacks are an effective exercise for targeting the gluteal muscles, specifically the gluteus maximus, to help strengthen and tone the buttocks. This exercise also engages the core muscles for stability.', 'Strength', 'Lower Body', 'None', 'ADVANCE', '3 to 4 sets', '10 to 15 reps', '5 to 10 minutes', 'Start on your hands and knees in a tabletop position with your wrists aligned under your shoulders and your knees under your hips. Engage your core muscles to stabilize your spine. Keeping your right knee bent at a 90-degree angle, lift your right leg up and back, extending it straight behind you while keeping your foot flexed. Focus on squeezing your left glute at the top of the movement. Avoid arching your back or rotating your hips. Hold for a moment at the top, then lower your left leg back to the starting position with control. Repeat for the desired number of repetitions. Ensure that your movements are slow and controlled throughout the exercise to maximize muscle engagement and minimize the risk of injury.', 'https://i.ytimg.com/vi/D4gxkgZQkAg/maxresdefault.jpg', 'https://www.youtube.com/embed/D4gxkgZQkAg?si=QYcwKlANcy8ssyz2', 'Weight Loss', 'Leg Intermediate'),
(383, 'Left Quad Stretch with Wall', 'The left quad stretch with a wall is a static stretch that targets the quadriceps muscles of the left leg. It helps improve flexibility and mobility in the front of the thigh.', 'Flexibility', 'Legs', 'Wall ', 'ADVANCE', '1 to 2 sets ', '', '30 to 60 seconds', 'Start by standing upright facing a wall, with your feet hip-width apart. Place your left hand on the wall for support. Bend your left knee and lift your left foot towards your buttocks, reaching back with your left hand to grasp your left ankle or foot. Keep your knees close together and your thighs parallel. Gently pull your left foot towards your buttocks until you feel a stretch in the front of your left thigh. Keep your torso upright and avoid arching your back. Hold the stretch for 30-60 seconds, breathing deeply and maintaining a steady stretch. Release the stretch and repeat on the opposite side.', 'https://i.ytimg.com/vi/TfcRyYf7WLg/maxresdefault.jpg', 'https://www.youtube.com/embed/TfcRyYf7WLg?si=Y0KutAoAwEKm_Jep', 'Maintain Weight', 'Leg Intermediate'),
(384, 'Right Quad Stretch with Wall', 'The right quad stretch with a wall is a static stretch that targets the quadriceps muscles of the right leg. It helps improve flexibility and mobility in the front of the thigh.', 'Flexibility', 'Legs', 'Wall ', 'ADVANCE', '1 to 2 sets ', '', '30 to 60 seconds', 'Start by standing upright facing a wall, with your feet hip-width apart. Place your right hand on the wall for support. Bend your right knee and lift your right foot towards your buttocks, reaching back with your right hand to grasp your right ankle or foot. Keep your knees close together and your thighs parallel. Gently pull your right foot towards your buttocks until you feel a stretch in the front of your right thigh. Keep your torso upright and avoid arching your back. Hold the stretch for 30-60 seconds, breathing deeply and maintaining a steady stretch. Release the stretch and repeat on the opposite side.', 'https://i.ytimg.com/vi/TfcRyYf7WLg/maxresdefault.jpg', 'https://www.youtube.com/embed/TfcRyYf7WLg?si=Y0KutAoAwEKm_Jep', 'Muscle Gain', 'Leg Intermediate'),
(385, 'Left Quad Stretch with Wall', 'The left quad stretch with a wall is a static stretch that targets the quadriceps muscles of the left leg. It helps improve flexibility and mobility in the front of the thigh.', 'Flexibility', 'Legs', 'Wall ', 'ADVANCE', '1 to 2 sets ', '', '30 to 60 seconds', 'Start by standing upright facing a wall, with your feet hip-width apart. Place your left hand on the wall for support. Bend your left knee and lift your left foot towards your buttocks, reaching back with your left hand to grasp your left ankle or foot. Keep your knees close together and your thighs parallel. Gently pull your left foot towards your buttocks until you feel a stretch in the front of your left thigh. Keep your torso upright and avoid arching your back. Hold the stretch for 30-60 seconds, breathing deeply and maintaining a steady stretch. Release the stretch and repeat on the opposite side.', 'https://i.ytimg.com/vi/TfcRyYf7WLg/maxresdefault.jpg', 'https://www.youtube.com/embed/TfcRyYf7WLg?si=Y0KutAoAwEKm_Jep', 'Maintain Weight', 'Leg Advanced'),
(386, 'Right Quad Stretch with Wall', 'The right quad stretch with a wall is a static stretch that targets the quadriceps muscles of the right leg. It helps improve flexibility and mobility in the front of the thigh.', 'Flexibility', 'Legs', 'Wall ', 'ADVANCE', '1 to 2 sets ', '', '30 to 60 seconds', 'Start by standing upright facing a wall, with your feet hip-width apart. Place your right hand on the wall for support. Bend your right knee and lift your right foot towards your buttocks, reaching back with your right hand to grasp your right ankle or foot. Keep your knees close together and your thighs parallel. Gently pull your right foot towards your buttocks until you feel a stretch in the front of your right thigh. Keep your torso upright and avoid arching your back. Hold the stretch for 30-60 seconds, breathing deeply and maintaining a steady stretch. Release the stretch and repeat on the opposite side.', 'https://i.ytimg.com/vi/TfcRyYf7WLg/maxresdefault.jpg', 'https://www.youtube.com/embed/TfcRyYf7WLg?si=Y0KutAoAwEKm_Jep', 'Muscle Gain', 'Leg Advanced'),
(387, 'Leaning Stretcher Raises', 'Leaning stretcher raises are an exercise targeting the lower back muscles, specifically the erector spinae, to improve strength and stability in the lumbar spine.', 'Strength', 'Lower Body', 'None', 'BEGINNER', '3 to 4 sets', '10 to 15 reps', '5 to 10 minutes', 'Start by standing with your feet shoulder-width apart and your hands resting on your hips or hanging by your sides. Engage your core muscles to stabilize your spine. Lean forward from your hips while keeping your back straight, allowing your upper body to come parallel to the ground. Keep your knees slightly bent to prevent strain on your lower back. Once in this position, slowly raise your torso back up to the starting position by contracting your lower back muscles. Focus on using your lower back muscles to lift your upper body while keeping your spine neutral. Avoid arching your back or using momentum to lift your torso. Lower back down with control and repeat for the desired number of repetitions.', 'https://i.ytimg.com/vi/qQ-StR-AXzM/maxresdefault.jpg', 'https://www.youtube.com/embed/qQ-StR-AXzM?si=cRZF5jcZdUhybrpy', 'Maintain Weight', 'Leg Advanced'),
(388, 'Calf Stretch (Left Side)', 'The calf stretch targets the calf muscles, specifically the gastrocnemius and soleus. This stretch helps improve flexibility and range of motion in the calf muscles.', 'Flexibility', 'Legs', 'None', 'BEGINNER', '1 to 2 per side', '20 to 30 seconds ', '5 to 10 minutes', 'Begin by standing facing a wall with your left foot positioned a step behind your right foot. Keep both feet flat on the ground and ensure your left heel is in contact with the floor. Lean forward, placing your hands against the wall for support. Keep your left leg straight and your left foot planted, while bending your right knee slightly. You should feel a stretch along the back of your left calf. Hold the stretch for 20-30 seconds, then release. Switch sides to stretch the right calf.', 'https://i.ytimg.com/vi/f1HzSAuB-Vw/maxresdefault.jpg', 'https://www.youtube.com/embed/f1HzSAuB-Vw?si=uArtg1r_u9lJW-uk', 'Maintain Weight', 'Leg Intermediate'),
(389, 'Calf Stretch (Right Side)', 'The calf stretch targets the calf muscles, specifically the gastrocnemius and soleus. This stretch helps improve flexibility and range of motion in the calf muscles.', 'Flexibility', 'Lower Body', 'None', 'BEGINNER', '1 to 2 per side', '20 to 30 seconds ', '5 to 10 minutes', 'Begin by standing facing a wall with your right foot positioned a step behind your left foot. Keep both feet flat on the ground and ensure your right heel is in contact with the floor. Lean forward, placing your hands against the wall for support. Keep your right leg straight and your right foot planted, while bending your left knee slightly. You should feel a stretch along the back of your right calf. Hold the stretch for 20-30 seconds, then release. Switch sides to stretch the left calf.', 'https://i.ytimg.com/vi/f1HzSAuB-Vw/maxresdefault.jpg', 'https://www.youtube.com/embed/f1HzSAuB-Vw?si=uArtg1r_u9lJW-uk', 'Maintain Weight', 'Leg Intermediate'),
(390, 'Calf Stretch (Left Side)', 'The calf stretch targets the calf muscles, specifically the gastrocnemius and soleus. This stretch helps improve flexibility and range of motion in the calf muscles.', 'Flexibility', 'Legs', 'None', 'BEGINNER', '1 to 2 per side', '20 to 30 seconds ', '5 to 10 minutes', 'Begin by standing facing a wall with your left foot positioned a step behind your right foot. Keep both feet flat on the ground and ensure your left heel is in contact with the floor. Lean forward, placing your hands against the wall for support. Keep your left leg straight and your left foot planted, while bending your right knee slightly. You should feel a stretch along the back of your left calf. Hold the stretch for 20-30 seconds, then release. Switch sides to stretch the right calf.', 'https://i.ytimg.com/vi/f1HzSAuB-Vw/maxresdefault.jpg', 'https://www.youtube.com/embed/f1HzSAuB-Vw?si=uArtg1r_u9lJW-uk', 'Maintain Weight', 'Leg Advanced'),
(391, 'Calf Stretch (Right Side)', 'The calf stretch targets the calf muscles, specifically the gastrocnemius and soleus. This stretch helps improve flexibility and range of motion in the calf muscles.', 'Flexibility', 'Lower Body', 'None', 'BEGINNER', '1 to 2 per side', '20 to 30 seconds ', '5 to 10 minutes', 'Begin by standing facing a wall with your right foot positioned a step behind your left foot. Keep both feet flat on the ground and ensure your right heel is in contact with the floor. Lean forward, placing your hands against the wall for support. Keep your right leg straight and your right foot planted, while bending your left knee slightly. You should feel a stretch along the back of your right calf. Hold the stretch for 20-30 seconds, then release. Switch sides to stretch the left calf.', 'https://i.ytimg.com/vi/f1HzSAuB-Vw/maxresdefault.jpg', 'https://www.youtube.com/embed/f1HzSAuB-Vw?si=uArtg1r_u9lJW-uk', 'Maintain Weight', 'Leg Advanced'),
(392, 'Jumping Jacks', 'Jumping jacks are a dynamic cardiovascular exercise that involves jumping while spreading the legs and arms to the sides and then returning to the starting position. This exercise elevates heart rate and improves overall cardiovascular fitness.', 'Cardiovascular', 'Legs', 'None', 'BEGINNER', '3 to 4 sets', '30 to 60 seconds', '5 to 10 minutes', 'Start with feet together and arms at sides. Jump up, spreading legs and raising arms overhead. Return to starting position and repeat.', 'https://media.post.rvohealth.io/wp-content/uploads/sites/2/2020/04/GRT-two-people-jumping-jacks-1296x728-header.jpg', 'https://www.youtube.com/embed/iSSAk4XCsRA?si=ZPfA-daml9Gv087T', 'Maintain Weight', 'Shoulder & Back Advanced');
INSERT INTO `foods` (`id`, `name`, `description`, `meal`, `diet`, `calories`, `protein`, `fat`, `carbohydrates`, `serving`, `photo`) VALUES
(1, 'Banana', 'Bananas are elongated, curved fruits with a creamy texture and a mild, sweet taste. They are rich in potassium and are often eaten as a convenient and portable snack.', 'lunch', 'Vegetarian', 104, 1, 1, 27, 151, 'https://images.everydayhealth.com/images/diet-nutrition/all-about-bananas-nutrition-facts-health-benefits-recipes-and-more-rm-722x406.jpg'),
(2, 'Alukon-Patani Gisado', 'Filipino dish consisting of winged beans (alukon) and lima beans (patani) saut?ed with garlic, onions, and tomatoes. It is seasoned with soy sauce or fish sauce and often includes tofu or shrimp for added flavor and texture.', 'lunch', 'Vegetarian', 180, 8, 5, 0, 200, 'https://i.ytimg.com/vi/XWM7dpEmeUw/sddefault.jpg'),
(3, 'Pork Tenderloin in Zesty Sauce', 'Pork Tenderloin in Zesty Sauce is a flavorful Filipino dish featuring tender slices of pork tenderloin smothered in a tangy and zesty sauce. The pork tenderloin is typically marinated in a mixture of citrus juices (such as lemon or calamansi), soy sauce, garlic, and spices to infuse it with flavor.', 'lunch', 'Non-vegetarian', 250, 25, 10, 15, 200, 'https://i.fnri.dost.gov.ph/assets/images/recipes/Pork_tenderloin_with_zesty_sauce.jpg'),
(4, 'Stir-fried Chicken with Kulitis', 'Stir-fried Chicken with Kulitis is a Filipino dish featuring tender pieces of chicken stir-fried with kulitis, also known as Chinese spinach or alugbati.', 'lunch', 'Vegetarian', 280, 25, 10, 20, 200, 'https://i.fnri.dost.gov.ph/assets/images/recipes/stir_fried_chicken_with_kulitis.JPG'),
(5, 'Sinigang na baboy', 'A sour soup dish made with tamarind as the base flavor, typically cooked with pork, beef, shrimp, or fish and various vegetables.', 'lunch', 'Non-vegetarian', 250, 15, 10, 30, 300, 'https://speedyrecipe.com/wp-content/uploads/2022/09/how-to-cook-sinigang-na-baboy.jpg'),
(6, 'Classic Oatmeal with Berries', 'A simple and nutritious breakfast featuring cooked oatmeal topped with a medley of fresh berries such as strawberries, blueberries, and raspberries.', 'breakfast', 'Vegetarian', 250, 7, 5, 45, 200, 'https://i2.wp.com/www.downshiftology.com/wp-content/uploads/2022/12/Berry-Baked-Oatmeal-main.jpg'),
(7, 'Sinigang na baboy', 'A sour soup dish made with tamarind as the base flavor, typically cooked with pork, beef, shrimp, or fish and various vegetables.', 'dinner', 'Non-vegetarian', 250, 15, 10, 30, 300, 'https://speedyrecipe.com/wp-content/uploads/2022/09/how-to-cook-sinigang-na-baboy.jpg'),
(8, 'Huli Huli chicken', 'Huli Huli chicken is a Hawaiian dish that features tender chicken marinated in a sweet and savory sauce, then grilled or roasted to perfection. ', 'breakfast', 'Non-vegetarian', 300, 25, 15, 10, 200, 'https://www.chewoutloud.com/wp-content/uploads/2015/09/huli-huli-chicken-vertical.jpg'),
(9, 'Huli Huli chicken', 'Huli Huli chicken is a Hawaiian dish that features tender chicken marinated in a sweet and savory sauce, then grilled or roasted to perfection. ', 'lunch', 'Non-vegetarian', 300, 25, 15, 10, 200, 'https://www.chewoutloud.com/wp-content/uploads/2015/09/huli-huli-chicken-vertical.jpg'),
