(89, 'Turon', 'liced bananas and sometimes jackfruit wrapped in spring roll wrappers, deep-fried, and coated in caramelized sugar.', 'snack', 'Non-vegetarian', 150, 1, 8, 20, 100, 'https://www.foxyfolksy.com/wp-content/uploads/2018/10/mini-turon-640.jpg'),
(90, 'Banana Cue', 'Saba bananas skewered, coated in caramelized sugar, and deep-fried until golden and crispy.', 'snack', 'Non-vegetarian', 200, 1, 10, 30, 100, 'https://recipes.net/wp-content/uploads/2023/10/how-to-cook-banana-cue-filipino-style-1698768704.jpg'),
(91, 'Puto', 'Steamed rice cakes made from rice flour, sugar, and baking powder, often served with grated coconut or butter on top.', 'snack', 'Vegetarian', 100, 2, 1, 20, 50, 'https://theskinnypot.com/wp-content/uploads/2018/11/Puto-Cheese-500x375.jpg'),
(92, 'Maruya', 'Sliced bananas dipped in batter, deep-fried until golden brown, and sprinkled with sugar.', 'snack', 'Non-vegetarian', 150, 1, 5, 25, 100, 'https://images.yummy.ph/yummy/uploads/2016/05/maruya-640-1.jpg'),
(93, 'Chicharon', 'Deep-fried pork rinds or belly, seasoned with salt and spices, resulting in a crispy and savory snack.', 'snack', 'Non-vegetarian', 200, 10, 15, 0, 30, 'https://t3.ftcdn.net/jpg/01/27/14/06/360_F_127140696_ftOGPuOTkk1KzQwvoBWBoHMdfW4rUTDz.jpg'),
(94, 'Espasol', 'Sweet rice cake made from rice flour, coconut milk, and sugar, often shaped into cylinders and coated with toasted rice flour.', 'snack', 'Vegetarian', 150, 2, 5, 25, 50, 'https://www.foxyfolksy.com/wp-content/uploads/2017/09/espasol-640-1.jpg'),
(95, 'Kamote Cue', 'Sweet potato slices skewered, coated in caramelized sugar, and deep-fried until caramelized and tender.', 'snack', 'Vegetarian', 150, 1, 5, 30, 100, 'https://upload.wikimedia.org/wikipedia/commons/thumb/0/0e/3395San_Antonio_Valley_Street_Foods_06.jpg/1200px-3395San_Antonio_Valley_Street_Foods_06.jpg'),
(96, 'Puto Bumbong', 'Purple-colored steamed rice cakes made from glutinous rice flour, cooked in bamboo tubes, and served with grated coconut and muscovado sugar.', 'snack', 'Vegetarian', 200, 3, 1, 40, 100, 'https://images.yummy.ph/yummy/uploads/2020/12/putobumbongrecipe5-2.jpg'),
(97, 'Taho', 'Silken tofu topped with caramelized sugar syrup and sago pearls, often served warm in the mornings by street vendors.', 'snack', 'Vegetarian', 150, 5, 2, 30, 50, 'https://www.kawalingpinoy.com/wp-content/uploads/2015/09/taho-2.jpg'),
(98, 'Nilupak', 'Mashed boiled cassava mixed with coconut milk, sugar, and sometimes grated coconut, molded into patties or balls, and served as a snack.', 'snack', 'Vegetarian', 150, 1, 5, 30, 100, 'https://www.createwithnestle.ph/sites/default/files/srh_recipes/f1872479ebcba0a3c1eeed52c8aa6e17.jpg'),
(99, 'Bibingka', 'A traditional Filipino rice cake made from rice flour and coconut milk, topped with salted egg and grated coconut, then baked in banana leaves.', 'snack', 'Vegetarian', 200, 3, 5, 30, 100, 'https://www.createwithnestle.ph/sites/default/files/srh_recipes/f1872479ebcba0a3c1eeed52c8aa6e17.jpg'),
(100, 'Suman', 'Glutinous rice cooked in coconut milk, wrapped in banana leaves, and steamed until firm, often served with sugar or latik (coconut caramel sauce).', 'snack', 'Vegetarian', 150, 2, 5, 30, 100, 'https://images.yummy.ph/yummy/uploads/2018/08/sumanibos-1.jpg'),
(101, 'Binatog', 'Boiled white corn kernels topped with grated coconut and sugar, a simple and satisfying snack often enjoyed during the summer.', 'snack', 'Vegetarian', 150, 2, 5, 30, 100, 'https://i.ytimg.com/vi/pwaYtPFaKxU/maxresdefault.jpg'),
(102, 'Sapin-sapin', 'A layered rice cake made from glutinous rice flour, coconut milk, and sugar, with each layer tinted in different colors and flavors.', 'snack', 'Vegetarian', 200, 2, 5, 40, 100, 'https://i.pinimg.com/564x/a3/33/1d/a3331d0e5e4c8c3e9b21bfa7d39da216.jpg'),
(103, 'Pandesal', 'andesal is a classic Filipino bread roll that is soft, fluffy, and slightly sweet. It is typically enjoyed for breakfast or as a snack, often eaten plain or filled with various spreads such as butter, cheese, or jam.', 'breakfast', 'Vegetarian', 100, 3, 10, 18, 50, 'https://upload.wikimedia.org/wikipedia/commons/thumb/e/e6/Pan_de_sal_%28Philippines%29_02.jpg/1200px-Pan_de_sal_%28Philippines%29_02.jpg'),
(104, 'Ensaymada', 'Ensaymada is a sweet and buttery Filipino bread topped with sugar, cheese, and sometimes salted egg. It is often served as a snack or dessert, and it is best enjoyed with a cup of hot chocolate or coffee.', 'snack', 'Non-vegetarian', 300, 5, 15, 35, 100, 'https://chefrv.com/wp-content/uploads/2022/02/Ensaymada.jpg'),
(105, 'Spanish Bread', 'Spanish Bread is a sweet Filipino bread roll filled with a sugary butter mixture. It has a soft texture and a slightly crunchy exterior due to the sugar coating. Spanish Bread is often enjoyed as a snack or dessert.', 'snack', 'Non-vegetarian', 200, 4, 8, 30, 80, 'https://www.womanscribbles.net/wp-content/uploads/2019/01/Spanish-Bread-2.jpg'),
(106, 'Cheese Roll', 'Cheese Roll is a Filipino bread roll filled with sweetened cheese. It is similar to a dinner roll but with a sweet and cheesy filling. Cheese Roll is often enjoyed as a snack or dessert.', 'snack', 'Non-vegetarian', 250, 6, 10, 25, 100, 'https://www.foxyfolksy.com/wp-content/uploads/2020/09/cheese-rolls.jpg'),
(107, 'Bicho-Bicho', 'icho-Bicho, also known as \"twisted doughnuts,\" are deep-fried Filipino bread twists coated in sugar. They are light, fluffy, and slightly crispy on the outside. Bicho-Bicho is often enjoyed as a snack or dessert.', 'snack', 'Vegetarian', 200, 3, 10, 25, 80, 'https://i.pinimg.com/736x/02/fc/dc/02fcdc387aaa0ff34362ccb07c32820d.jpg'),
(108, 'Puto', 'uto is a traditional Filipino steamed rice cake made from rice flour, sugar, and coconut milk. It has a soft and fluffy texture and is often served as a snack or dessert. Puto comes in various flavors and colors, such as cheese, ube (purple yam), and pandan.', 'snack', 'Non-vegetarian', 100, 2, 2, 20, 50, 'https://theskinnypot.com/wp-content/uploads/2018/11/Puto-Cheese-500x375.jpg'),
(109, 'Pan de Coco', 'Pan de Coco is a sweet Filipino bread roll filled with sweetened coconut filling. The bread dough is often made with coconut milk, giving it a subtle coconut flavor. Pan de Coco is usually enjoyed as a snack or dessert.', 'snack', 'Vegetarian', 240, 4, 10, 35, 100, 'https://www.kawalingpinoy.com/wp-content/uploads/2018/04/filipino-pan-de-coco.jpg'),
(110, 'Ube Cheese Pandesal', 'Ube Cheese Pandesal is a Filipino bread roll infused with purple yam (ube) and filled with cheese. It has a vibrant purple color and a slightly sweet flavor from the ube. Ube Cheese Pandesal is often enjoyed as a snack or breakfast item.', 'snack', 'Non-vegetarian', 200, 6, 8, 30, 80, 'https://theunlikelybaker.com/wp-content/uploads/2022/01/Ube-Pandesal-Feature.jpg'),
(112, 'Taisan', 'Taisan is a Filipino chiffon cake that is light, fluffy, and buttery. It is often topped with butter, sugar, and grated cheese for added flavor. Taisan is typically enjoyed as a snack or dessert, and it pairs well with coffee or tea.', 'snack', 'Vegetarian', 200, 3, 10, 25, 80, 'https://www.womanscribbles.net/wp-content/uploads/2019/12/taisan-2-720x720.jpg'),
(113, 'Baked Chicken Breast', 'Baked chicken breast is a classic and healthy dish made by seasoning chicken breast fillets and baking them in the oven until they are cooked through. ', 'lunch', 'Non-vegetarian', 165, 31, 3.6, 0, 100, 'https://www.savorynothings.com/wp-content/uploads/2022/01/baked-chicken-breast-recipe-image-sq.jpg'),
(114, 'Baked Chicken Breast', 'Baked chicken breast is a classic and healthy dish made by seasoning chicken breast fillets and baking them in the oven until they are cooked through. ', 'dinner', 'Non-vegetarian', 165, 31, 3.6, 0, 100, 'https://www.savorynothings.com/wp-content/uploads/2022/01/baked-chicken-breast-recipe-image-sq.jpg'),
(115, 'Sheet Pan Chicken and Veggies', 'Sheet pan chicken and veggies is a convenient and nutritious one-pan meal made by roasting chicken pieces and assorted vegetables together on a baking sheet.', 'breakfast', 'Non-vegetarian', 300, 25, 12, 20, 250, 'https://www.wellplated.com/wp-content/uploads/2019/04/Sheet-Pan-Chicken-with-Vegetables.jpg'),
(116, 'Sheet Pan Chicken and Veggies', 'Sheet pan chicken and veggies is a convenient and nutritious one-pan meal made by roasting chicken pieces and assorted vegetables together on a baking sheet.', 'lunch', 'Non-vegetarian', 300, 25, 12, 20, 250, 'https://www.wellplated.com/wp-content/uploads/2019/04/Sheet-Pan-Chicken-with-Vegetables.jpg'),
(117, 'Sheet Pan Chicken and Veggies', 'Sheet pan chicken and veggies is a convenient and nutritious one-pan meal made by roasting chicken pieces and assorted vegetables together on a baking sheet.', 'dinner', 'Non-vegetarian', 300, 25, 12, 20, 250, 'https://www.wellplated.com/wp-content/uploads/2019/04/Sheet-Pan-Chicken-with-Vegetables.jpg'),
(118, 'Pan-Fried Chicken Breast', 'Pan-fried chicken breast is a simple and versatile dish that features boneless, skinless chicken breast fillets cooked in a skillet on the stovetop.', 'breakfast', 'Non-vegetarian', 200, 30, 8, 0, 150, 'https://fitfoodiefinds.com/wp-content/uploads/2023/03/Crispy-Fried-Chicken-Breast-10.jpg'),
(119, 'Pan-Fried Chicken Breast', 'Pan-fried chicken breast is a simple and versatile dish that features boneless, skinless chicken breast fillets cooked in a skillet on the stovetop.', 'lunch', 'Non-vegetarian', 200, 30, 8, 0, 150, 'https://fitfoodiefinds.com/wp-content/uploads/2023/03/Crispy-Fried-Chicken-Breast-10.jpg'),
(120, 'Pan-Fried Chicken Breast', 'Pan-fried chicken breast is a simple and versatile dish that features boneless, skinless chicken breast fillets cooked in a skillet on the stovetop.', 'dinner', 'Non-vegetarian', 200, 30, 8, 0, 150, 'https://fitfoodiefinds.com/wp-content/uploads/2023/03/Crispy-Fried-Chicken-Breast-10.jpg'),
(121, 'Apple', 'pples are one of the most popular and widely consumed fruits worldwide. They come in various colors, including red, green, and yellow, and have a sweet and crisp flavor. ', 'snack', 'Vegetarian', 95, 1, 1, 25, 182, 'https://parade.com/.image/t_share/MTkwNTgxNDY1MzcxMTkxMTY0/different-types-of-apples-jpg.jpg'),
(122, 'Pineapple', 'Pineapple is a tropical fruit known for its sweet and tangy flavor, as well as its spiky, rough exterior. It has a juicy yellow flesh with a fibrous core, and it can be eaten fresh, juiced, or used in cooking and baking. ', 'snack', 'Vegetarian', 82, 1, 1, 22, 165, 'https://post.medicalnewstoday.com/wp-content/uploads/sites/3/2023/08/Pineapple_reflux_GettyImages809105674_Header-1024x575.jpg'),
(123, 'Oranges', 'Oranges are rich in vitamin C, which helps support the immune system and aids in recovery from intense workouts. They also contain carbohydrates for energy and hydration.', 'snack', 'Vegetarian', 62, 1.2, 1, 15, 131, 'https://www.health.com/thmb/m9S0Q8klaiVPouH-sFrfP5GaOrY=/2121x0/filters:no_upscale():max_bytes(150000):strip_icc()/TypesOfOranges-f95153e786554ba5b6da0370387ee563.jpg'),
(124, 'Berries (e.g., strawberries, blueberries, raspberries)', 'Berries are packed with antioxidants, which help reduce inflammation and oxidative stress caused by intense exercise. They are also low in calories and high in fiber, making them a nutritious and refreshing snack option.', 'snack', 'Vegetarian', 50, 1, 1, 12, 140, 'https://www.dictionary.com/e/wp-content/uploads/2018/09/berries_1000x700.jpg'),
(125, 'Greek Salad', 'Greek salad typically consists of fresh lettuce, tomatoes, cucumbers, red onions, olives, and feta cheese, dressed with olive oil, lemon juice, and oregano. It offers a refreshing and flavorful combination of vegetables and cheese.', 'breakfast', 'Vegetarian', 200, 8, 15, 10, 150, 'https://www.italianbellavita.com/wp-content/uploads/2022/08/739C7136-CBA2-4DDC-8D56-ECA409F69AB9-3-735x735.jpeg'),
(126, 'Chicken Caesar Salad', 'Chicken Caesar salad consists of romaine lettuce, grilled chicken breast, croutons, Parmesan cheese, and Caesar dressing. It\'s a classic salad choice that is both satisfying and protein-rich.', 'breakfast', 'Non-vegetarian', 350, 30, 20, 15, 300, 'https://www.eatingbirdfood.com/wp-content/uploads/2023/06/grilled-chicken-caesar-salad-hero.jpg'),
(127, 'Cobb Salad', 'Cobb salad is made with chopped lettuce, grilled chicken breast, hard-boiled eggs, bacon, avocado, tomatoes, and blue cheese, topped with a vinaigrette dressing. It\'s a hearty and flavorful salad that offers a balance of protein, healthy fats, and vegetables.', 'breakfast', 'Non-vegetarian', 400, 25, 30, 10, 300, 'https://www.herwholesomekitchen.com/wp-content/uploads/2021/02/cobbsaladrecipe-1.jpg'),
(128, 'Caprese Salad', 'Caprese salad features fresh tomatoes, mozzarella cheese, basil leaves, and a drizzle of balsamic glaze or vinaigrette. It\'s a simple yet elegant salad that highlights the flavors of ripe tomatoes and creamy cheese.', 'breakfast', 'Non-vegetarian', 250, 15, 25, 10, 150, 'https://natashaskitchen.com/wp-content/uploads/2019/08/Caprese-Salad-6.jpg'),
(129, 'Spinach Salad with Strawberries and Walnuts', 'Spinach salad with strawberries and walnuts combines fresh spinach leaves with sliced strawberries, chopped walnuts, and a light vinaigrette dressing. It\'s a refreshing and nutritious salad that offers a burst of flavor and texture.', 'breakfast', 'Vegetarian', 180, 5, 12, 15, 150, 'https://pinchandswirl.com/wp-content/uploads/2021/04/Spinach-Strawberry-Walnut-Salad_.jpg'),
(130, 'Tuna Salad', 'una salad typically consists of canned tuna, mayonnaise, celery, onions, and seasonings, served over a bed of lettuce or mixed greens. It\'s a protein-rich salad option that can be customized with various vegetables and dressings.', 'breakfast', 'Non-vegetarian', 250, 20, 15, 5, 120, 'https://littlespoonfarm.com/wp-content/uploads/2021/08/tuna-salad-recipe-card.jpg'),
(131, 'Quinoa Salad', 'Quinoa salad features cooked quinoa tossed with a variety of vegetables, such as bell peppers, cucumbers, cherry tomatoes, and herbs, dressed with a lemon vinaigrette. It\'s a protein-packed salad that is also gluten-free and suitable for vegans.', 'breakfast', 'Vegetarian', 300, 10, 10, 40, 180, 'https://www.inspiredtaste.net/wp-content/uploads/2023/01/Quinoa-Salad-Recipe-Video.jpg'),
(132, 'Atchara ', 'Atchara is a traditional Filipino condiment made from shredded unripe papaya, carrots, bell peppers, and onions, marinated in a sweet and tangy vinegar solution. It\'s a popular accompaniment to grilled or fried dishes, providing a refreshing contrast to savory flavors.', 'lunch', 'Vegetarian', 30, 1, 1, 0, 15, 'https://panlasangpinoy.com/wp-content/uploads/2024/02/recipe-for-atachara.jpg'),
(133, 'Pako Salad', 'Pako salad is a traditional Filipino salad made from fiddlehead ferns (pako). The ferns are blanched to remove bitterness, then combined with tomatoes, onions, salted eggs, and sometimes shrimp or vinegar dressing. ', 'breakfast', 'Vegetarian', 70, 4, 4, 6, 100, 'https://assets.unileversolutions.com/recipes-v2/242704.jpg'),
(134, 'Ensaladang Talong ', 'Ensaladang talong is a Filipino salad featuring grilled or roasted eggplant as its main ingredient. The eggplant is charred over an open flame or roasted until tender, then peeled and mashed or chopped. It is typically mixed with tomatoes, onions, and sometimes salted eggs or shrimp paste (bagoong). ', 'breakfast', 'Non-vegetarian', 60, 2, 3, 10, 150, 'https://images.yummy.ph/yummy/uploads/2021/06/ensaladangtalongrecipe1.jpg'),
(135, 'Ensaladang Lato', 'nsaladang lato is a Filipino salad made from a type of edible seaweed called lato or sea grapes. Lato has small, bead-like structures resembling tiny grapes, which burst with a salty-sweet flavor when bitten into.', 'breakfast', 'Vegetarian', 20, 1, 1, 3, 100, 'https://i.pinimg.com/736x/4a/db/87/4adb87974dd2f3b7c4cf30c6eb221a69.jpg'),
(136, 'Raspberry Coconut Oatmeal', 'Oats cooked with coconut milk and topped with fresh raspberries and toasted coconut flakes.', 'breakfast', 'Vegetarian', 320, 6, 10, 52, 240, 'https://cleanplatemama.com/wp-content/uploads/2023/04/raspberry-overnight-oats-thumbnail-.jpg'),
(137, 'Maple Pecan Oatmeal', 'Oatmeal sweetened with maple syrup and topped with chopped pecans for a crunchy texture.', 'breakfast', 'Vegetarian', 340, 7, 12, 52, 250, 'https://beamingbaker.com/wp-content/uploads/2021/11/IG-Maple-Pecan-Overnight-Oats-Oatmeal-3.jpg'),
(138, 'Savory Parmesan Herb Oatmeal', 'Oatmeal cooked with vegetable broth, mixed with grated Parmesan cheese, and seasoned with herbs like thyme and parsley.', 'breakfast', 'Vegetarian', 280, 9, 7, 42, 220, 'https://media.self.com/photos/5a1f0016e549b010d825d833/master/pass/1117-savory-parmesan-oatmeal.jpg'),
(139, 'Banana Nutella Oatmeal', 'Oats combined with sliced bananas and a swirl of Nutella hazelnut spread.', 'breakfast', 'Vegetarian', 370, 8, 12, 58, 270, 'https://www.simplyscratch.com/wp-content/uploads/2012/01/close-up1.jpg'),
(140, 'Cranberry Orange Oatmeal', 'Oatmeal infused with orange zest and dried cranberries, topped with a sprinkle of cinnamon.', 'breakfast', 'Vegetarian', 300, 5, 4, 62, 220, 'https://www.liveeatlearn.com/wp-content/uploads/2021/11/orange-cranberry-oatmeal-vert.jpg'),
(141, 'Savory Mediterranean Oatmeal', 'Oatmeal cooked with sun-dried tomatoes, olives, feta cheese, and a drizzle of olive oil.', 'breakfast', 'Vegetarian', 310, 10, 8, 48, 240, 'https://www.savoryonline.com/app/uploads/recipes/243244/savory-mediterranean-oatmeal-with-eggs.jpg'),
(142, 'Tropical Pineapple Coconut Oatmeal', 'Oats cooked with coconut milk, topped with fresh pineapple chunks, and shredded coconut.', 'breakfast', 'Vegetarian', 330, 5, 11, 54, 250, 'https://www.eatingbirdfood.com/wp-content/uploads/2021/04/tropical-overnight-oats-overhead.jpg'),
(143, 'Almond Joy Oatmeal', 'Oatmeal infused with almond extract, topped with sliced almonds, shredded coconut, and dark chocolate chips.', 'breakfast', 'Vegetarian', 360, 9, 16, 0, 260, 'https://saltandbaker.com/wp-content/uploads/2021/03/Almond-Joy-Oatmeal-1.jpg'),
(144, 'Green Tea Matcha Oatmeal', 'Oatmeal mixed with matcha green tea powder, topped with sliced strawberries and a drizzle of honey.', 'breakfast', 'Vegetarian', 310, 7, 5, 56, 230, 'https://www.cottercrunch.com/wp-content/uploads/2016/01/matcha-tea-green-latte-oatmeal..jpg'),
(145, 'Spiced Pumpkin Oatmeal', 'Oatmeal cooked with pumpkin puree and pumpkin pie spices (cinnamon, nutmeg, ginger), topped with a dollop of Greek yogurt.', 'breakfast', 'Vegetarian', 290, 10, 4, 52, 220, 'https://pickyeaterblog.com/wp-content/uploads/2021/08/pumpkin-spice-oatmeal.jpg'),
(146, 'Rice', 'Rice is a staple food and a primary source of carbohydrates for many cultures worldwide. It comes in various varieties such as white rice, brown rice, basmati rice, jasmine rice, etc. Rice is a versatile ingredient used in a wide range of dishes.', 'lunch', 'Vegetarian ', 200, 4, 1, 45, 195, 'https://hips.hearstapps.com/vidthumb/images/delish-u-rice-2-1529079587.jpg'),
(147, 'Rice', 'Rice is a staple food and a primary source of carbohydrates for many cultures worldwide. It comes in various varieties such as white rice, brown rice, basmati rice, jasmine rice, etc. Rice is a versatile ingredient used in a wide range of dishes.', 'lunch', 'Non-vegetarian', 200, 4, 1, 45, 195, 'https://hips.hearstapps.com/vidthumb/images/delish-u-rice-2-1529079587.jpg'),
